INSERT INTO `product_name` (`id`, `product_code`, `name`, `detail`, `id_producttype_level1`, `id_producttype_level2`, `id_producttype_level3`, `box_weight`, `box_width`, `box_long`, `box_height`, `tags`, `is_bestseller`, `is_drop`) VALUES
(1, 'IRT-3613HT', 'โต๊ะรีดผ้า', '<h2><strong>โต๊ะรีดผ้า&nbsp;/&nbsp;โต๊ะรองรีดผ้า</strong></h2><div><ul><li>รูปแบบ: การใช้งานปรับได้ถึง 10 ระดับ (สูงสุด&nbsp;80 ซม.) ไม่โยกคลอน</li><li>แผ่นรองรีด:&nbsp;แผ่นเหล็กตาข่ายรับแรงกด ผ้าสะท้อนความร้อน ยาว 93 ซม. กว้าง 35 ซม.</li><li>ขาตั้ง:&nbsp;ท่อเหล็กหนา 1มิล เคลือบเมทาลิค ∅22 มิล.(ขาคู่) , ∅28มิล.(ขาเดี่ยว) , ∅35มิล.(ขาฐาน)</li><li>ปรับขาตั้งยืน-นั่งรีดได้อย่างมั่นคง</li><li>แผ่นรองรีดหนา 10 มิล 600 แกรม พร้อมฟองน้ำแบบเย็บติด<br></li><li>ผ้าคอดตอน 100 % เคลือบสารกันความร้อนที่ผิวหน้า<br></li><li>พับเก็บ (H)8 x (L)125 ซ.ม.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;IRT-3613HT-T1</div><div>ขนาด : (W)35&nbsp;x (L)112 ซม.</div><div>สี : เทาเข้ม</div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/โต๊ะรีดผ้า/IRT-3613HT-T2-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%;\" alt=\"โต๊ะรีดผ้า โต๊ะรองเรีด สีเทาเข้ม\" ><br></div><div><br></div>  ', 1, 1, 1, 6, 38, 131, 9, '', 'Y', 'N'),
(2, 'IRT-ผ้ารองรีด', 'ผ้ารองรีด เชือกรูด', '<h2><strong>ผ้ารองรีดสะท้อนความร้อน แบบเชือกรูด ไม่เปียกชื้น เหมาะกับเตารีดไอน้ำ</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ผ่านขบวนการผลิตเทคโนโลยีทันสมัย</li>\r\n<li>ผ้า COTTON 100% ผสมสารทนความร้อน ทำให้หน้าผ้ารองรับความร้อนได้อย่างดี</li>\r\n<li>มีความคงทน ใช้ได้ยาวนาน</li>\r\n<li>เนื้อผ้าไม่เปียกชื้น</li>\r\n<li>ใช้คู่กับโต๊ะรีดผ้า IRT-1338HT-T1 และ T2 ( 34 x 97 ซม.)</li>\r\n<li>โต๊ะรีดผ้าขนาด (กว้าง)34-41 ซม. (ยาว)97-105 ซม.</li>\r\n<li>ใช้ได้ทั้งเตารีดทั่วไปและเตารีดไอน้ำ</li>\r\n</ul>\r\n</div>\r\n\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>รหัสสินค้า :&nbsp;IRT-ผ้ารองรีด</div>\r\n<div>ขนาด : (ก)46 x (ย)109 ซม.</div>\r\n<div>สี : เทาอ่อน, เทาเข้ม</div>\r\n<div><img src=\"https://th-live-01.slatic.net/p/b4db31f9b389fc95555b65656e990052.jpg_q80_.webp\" style=\"max-width:100%;\" alt=\"ผ้ารองรีด\"></div>\r\n<div>\r\n<img src=\"https://th-live-01.slatic.net/p/04148fcf3b10be7d91a919a1509f1c6b.jpg_q80_.webp\" alt=\"ผ้ารองรีด\" style=\"max-width:100%;\">\r\n</div>  \r\n<div>\r\n<img src=\"https://th-live-01.slatic.net/p/45c4bd8d9bdfd554c613dc83ebadad40.jpg_q80_.webp\" style=\"max-width:100%;\" alt=\"ผ้ารองรีด-เทา\" >\r\n</div>\r\n<div>\r\n<img src=\"https://th-live-01.slatic.net/p/468aae73c3243c34d9973a96e65be988.jpg_q80_.webp\" style=\"max-width:100%;\" alt=\"ผ้ารองรีด-ดำ\">\r\n</div>\r\n', 1, 1, 2, 0, 0, 0, 0, '', 'Y', 'N'),
(3, 'IRT-3613C', 'ผ้ารองรีดฟองน้ำ', '<h2><strong>ผ้ารองรีด&nbsp;พร้อมฟองน้ำแบบเย็บติด<br></strong></h2>\r\n<div>\r\n<ul>\r\n<li>ผ่านขบวนการผลิตเทคโนโลยีทันสมัย</li>\r\n<li>ผ้า COTTON 100% ผสมสารทนความร้อน ทำให้หน้าผ้ารองรับความร้อนได้อย่างดี</li>\r\n<li>มีความคงทน ใช้ได้ยาวนาน</li>\r\n<li>เนื้อผ้าไม่เปียกชื้น</li>\r\n<li>พร้อมฟองน้ำแบบเย็บติด หนา 1 ซม.</li>\r\n<li>ใช้คู่กับโต๊ะรีดผ้า IRT-3613HT-T2</li>\r\n<li>ใช้ได้ทั้งเตารีดทั่วไปและเตารีดไอน้ำ</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>ขนาด : (W)13&nbsp;x (L)35&nbsp;นิ้ว.</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า :&nbsp;IRT-3613C-T1</div>\r\n<div>สี : เทาอ่อน</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า :&nbsp;IRT-3613C-T2</div>\r\n<div>สี : เทาเข้ม</div>\r\n<div><br></div>\r\n<div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/โต๊ะรีดผ้า/IRT-3613C-T2-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%\" alt=\"ผ้ารองรีด สีเทา\"><br></div>  ', 1, 1, 2, 0, 0, 0, 0, '', 'Y', 'N'),
(4, 'IRT-JF487', 'แผงแขวนโต๊ะรีดผ้า', '<h2><strong>ที่แขวนโต๊ะรีดผ้า-วางเตารีด</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ที่แขวนโต๊ะรีดผ้าและเก็บวางเตารีดร้อนหลังใช้งาน ติดกับผนังได้สะดวกปลอดภัยเป็นระเบียบเรียบร้อย</li>\r\n<li>ผลิตด้วยวัสดุ&nbsp;พลาสติกเกรดพิเศษ PBT Resin ทนความร้อนได้ถึง 200 องศา</li>\r\n<li>ติดตั้งกับผนัง แข็งแรง ทนทาน รูปทรงกะทัดรัด</li>\r\n</ul>\r\n</div>\r\n<div><p><strong>คุณสมบัติเฉพาะ<br></strong></p></div>\r\n<div></div>\r\n<p>วัสดุ : PBT (Polybutylene terephthalate Resin)<br>ขนาด&nbsp;:&nbsp;(L)31 x (W) 14&nbsp;x (H) 11 cm.</p>\r\n<div>รหัสสินค้า IRT-JF487-W  </div>\r\n<div>สีขาว</div>\r\n<div><br></div>\r\n<div><div>รหัสสินค้า IRT-JF487-B</div>\r\n<div>สีดำ</div>\r\n</div><div><br></div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/โต๊ะรีดผ้า/IRT-JF487-BL-%28d-1%29-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%\" ><br></div>\r\n<div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/โต๊ะรีดผ้า/IRT-JF487-BL-%28d-2%29.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%\" ><br></div>  ', 1, 1, 3, 1, 13, 16, 33, '', 'N', 'N'),
(5, 'IRT-H01', 'ตะขอแขวนโต๊ะรีดผ้า', '<h2><strong>ตะขอแขวนโต๊ะรีดผ้า<br></strong></h2><div><ul><li>เก็บแขวนโต๊ะรีดผ้าได้สะดวก</li><li>แผ่นเหล็กหนาเคลือบสี ยึดติดผนัง คงรูปไม่ยืด<br></li><li>ติดกับผนังแข็งแรง ทนทาน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;IRT-H01</div><div>วัสดุ : แผ่นเหล็กหนาเคลือบสี</div><div>ขนาด : (ยาว)15.5&nbsp;x (สูง) 4.4 x&nbsp;(ลึก)4.4&nbsp;ซม.</div><div>สี : ดำ</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/โต๊ะรีดผ้า/IRT-H01-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%\" alt=\"ตะขอแขวนโต๊ะรีดผ้า\"><br></div>  ', 1, 1, 3, 0, 0, 0, 0, '', 'N', 'N'),
(6, 'MNB-BCH-28', 'ตู้เย็น-มินิบาร์ 28 ลิตร', '<h2><strong>มินิบาร์ ตู้เย็นโรงแรม</strong></h2><div><ul><li>นวัตกรรมระบบทำความเย็นเทอร์โมอิเล็กทริก+ฮีทไปป์เทคโนโลยี ซึ่งใช้กันมายาวนานทางด้านวิศวกรรมการบินและอวกาศ <span style=\"text-decoration:underline\">ช่วยประหยัดค่าไฟมากกว่าตู้เย็นทั่วไปที่ใช้ตัวคอมเพรสเซอร์</span></li><li>ตัวตู้ไม่เกิดการสั่นและเสียงรบกวน (0 เดซิเบล) เหมาะกับห้องพักโรงแรมและบ้านพักทั่วไป</li><li>ประสิทธิภาพความเย็น 3~8˚C (ณ อุณหภูมิภายในห้องแอร์ 25˚C)</li><li>ปลอดสาร CFC และผลิตภัณฑ์เป็นมิตรกับสิ่งแวดล้อม</li><li>ภายในตู้ออกแบบตั้งวางตะแกรงได้หลายระดับชั้น เพื่อจัดวางขวด-กระป๋องเครื่องดื่ม ทั้งแนวตั้งและแนวนอนได้อย่างลงตัว รวมทั้งเก็บแช่ เครื่องสำอาง และเวชภัณฑ์น้ำ&nbsp;ที่ต้องมีอุณหภูมิความเย็นพอเหมาะ เพื่อเก็บคงคุณภาพไว้ได้อย่างดี</li><li>บานประตูฝาทึบ ขาตั้งตู้เย็นปรับได้  หลอดไฟในตู้นวลแสง LED<br></li><li>บานพับประตูและโครงตู้ผลิตจากเหล็กกล้า และพ่นด้วยสีกันฝุ่น</li><li>รับรองจากสถาบันมาตราฐานโลก ETL , CE , ROHS</li><li>รับประกัน 2&nbsp;ปี&nbsp;</li><li>หลังหมดอายุประกัน มีอะไหล่และบริการซ่อม</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุภายนอกตู้ : เหล็กกล้าพ่นด้วยสีกันฝุ่น</div><div>วัสดุภายในตู้ : พลาสติกคุณภาพอย่างดี</div><div>ขนาด : 28&nbsp;ลิตร (0.99&nbsp;คิว)</div><div>ขนาดภายนอก  : (กว้าง)38 x (ลึก)38&nbsp;x (สูง)47.5 ซม.              <br>ขนาดภายใน  : (กว้าง)29.3 x (ลึก)21&nbsp;x (สูง)36.2 ซม.<br></div><div>กำลังไฟ : 220V/50Hz &nbsp; 65W<br>สายไฟยาว : 160 ซม.</div><div>น้ำหนัก : 9.2&nbsp;กิโลกรัม</div><div>เสียง : 0&nbsp;dBA</div><div><br></div><div>รหัสสินค้า :&nbsp;MNB-BCH-28-BL</div><div>สี :&nbsp;ดำ</div><div><br></div><div><div>รหัสสินค้า :&nbsp;MNB-BCH-28-W</div><div>สี :&nbsp;ขาว</div>  </div><div><br></div><p><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ตู้เย็นโรงแรม/hotelmate-heatpipe-min.jpg\" style=\"vertical-align:baseline;border:0px #000000;max-width:100%;\" alt=\"แผงวงจรหลังตู้เย็น\"></p><br><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ตู้เย็นโรงแรม/heat%20pipe-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%;\" alt=\"แผงวงจรการทำงาน\"><br></div>  ', 3, 5, 29, 0, 0, 0, 0, '', 'N', 'N'),
(7, 'MNB-BCH-40', 'ตู้เย็น-มินิบาร์ 40 ลิตร', '<h2><strong>มินิบาร์ ตู้เย็นโรงแรม</strong></h2><div><ul><li>ระบบทำความเย็นเทอร์โมอิเล็กทริก ฮีทไปป์&nbsp;เทคโนโลยี ซึ่งใช้กันมายาวนานทางด้านวิศวกรรมการบินและอวกาศ <span style=\"text-decoration:underline\">ช่วยประหยัดค่าไฟ และไม่ใช้ตัวคอมเพรสเซอร์ เหมือนตู้เย็นทั่วไป</span></li><li>ตัวตู้ไม่เกิดการสั่นและเสียงรบกวน (0 เดซิเบล)<br></li><li>ประสิทธิภาพความเย็น 3~8˚C (ณ อุณหภูมิภายในห้องแอร์ 25˚C)</li><li>ปลอดสาร CFC และผลิตภัณฑ์เป็นมิตรกับสิ่งแวดล้อม</li><li>ภายในตู้ออกแบบตั้งวางตะแกรงได้หลายระดับชั้น เพื่อจัดวางขวด-กระป๋องเครื่องดื่ม ทั้งแนวตั้งและแนวนอนได้อย่างลงตัว รวมทั้งเก็บแช่ เครื่องสำอาง และเวชภัณฑ์น้ำ&nbsp;ที่ต้องมีอุณหภูมิความเย็นพอเหมาะ เพื่อเก็บคงคุณภาพไว้ได้อย่างดี</li><li>บานประตูฝาทึบ ขาตั้งตู้เย็นปรับได้  หลอดไฟในตู้นวลแสง LED<br></li><li>บานพับประตูและโครงตู้ผลิตจากเหล็กกล้า และพ่นด้วยสีกันฝุ่น</li><li>รับรองจากสถาบันมาตราฐานโลก ETL&nbsp;, CE&nbsp;, ROHS</li><li>รับประกัน 2&nbsp;ปี</li><li>หลังหมดอายุประกัน มีอะไหล่และบริการซ่อม<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุภายนอกตู้ : เหล็กกล้าพ่นด้วยสีกันฝุ่น</div><div>วัสดุภายในตู้ : พลาสติกคุณภาพอย่างดี</div><div>ขนาด : 40&nbsp;ลิตร (1.42 คิว)</div><div>ขนาดภายนอก  : (กว้าง)40.5&nbsp;x (ลึก)44.5&nbsp;x (สูง)54.5 ซม.              <br>ขนาดภายใน  : (กว้าง)34.1 x (ลึก)26.1 x (สูง)41 ซม.<br></div><div>กำลังไฟ : 220V/50Hz &nbsp; 65W<br>สายไฟยาว : 160 ซม.</div><div>น้ำหนัก : 13.2&nbsp;กิโลกรัม</div><div>เสียง : 0&nbsp;dBA<br></div><div><br></div><div>รหัสสินค้า :&nbsp;MNB-BCH-40-BL</div><div>สี :&nbsp;ดำ</div><div><br></div><div><div>รหัสสินค้า :&nbsp;MNB-BCH-40-W</div><div>สี :&nbsp;ขาว</div>  </div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ตู้เย็นโรงแรม/hotelmate-heatpipe-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%;\" alt=\"เปรีบเทียบแผงวงจรหลังตู้\" ><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back