(11, 'HSB-FC-1541D', 'ตู้เซฟโรงแรม แบบเปิดฝาบน', '<h2><strong>ตู้เซฟโรงแรม แบบเปิดฝาบน</strong></h2><div><ul><li>ตู้เซฟอิเล็คโทรนิค ปุ่มกดหน้าปัดดิจิตอลเรืองแสง LED</li><li>เปิด-ปิด ฝาขึ้น-ลง เบามือด้วยโช๊คอัพ</li><li>ใช้งานง่าย กดตั้งรหัสส่วนตัว 3-6 หลัก&nbsp;ตู้เชฟจะล็อคด้วยระบบ <br>   อิเล็คโทรนิคอัตโนมัติ สลักแกนเหล็ก 2 เดือย ขนาดหนา Ø20 mm.</li><li>ในกรณีกดรหัสส่วนตัวผิดต่อเนื่อง 3 ครั้ง เครื่องจะหยุดทำงาน 5 นาที</li><li>กรณีลูกค้าลืมรหัสส่วนตัว เปิดได้ด้วยรหัสเครื่อง หรือใช้กุญแจ</li><li>ติดตั้งโดยขันน๊อตยึดติดกับพื้นด้านล่างตู้</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติ</strong></p><div>วัสดุ : เหล็กกล้าเคลือบด้วยสีกันฝุ่น<br>แบตเตอรี่ : 2A 1.5V จำนวน 4 ก้อน<br></div><div></div><div>ขนาด : (กว้าง)41&nbsp;x (ลึก)35 x (สูง)15 CM.</div><div>น้ำหนัก :&nbsp;10 กิโลกรัม.</div><div><br></div><div>รหัสสินค้า :&nbsp;HSB-FC-1541D-(BL)</div><div>สี : ดำ</div><div><br>รหัสสินค้า :&nbsp;HSB-FC-1541D-(W)<br>สี : ขาว</div><div><br></div><div><img src=\"https://th-test-11.slatic.net/shop/884284ffd627d7e949eb8fcf7fcd36ae.jpeg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%;\" alt=\"ตู้เซฟเปิดฝาบน HSB-FC-1541D-(BL)(W)\"><br></div>', 1, 4, 7, 0, 0, 0, 0, '', 'N', 'N'),
(12, 'HSB-FD-2042F', 'ตู้เซฟโรงแรม หน้าปัดเหลี่ยมโค้ง', '<h2><strong>ตู้เซฟโรงแรมหน้าปัดเหลี่ยมโค้ง</strong></h2>\r\n<div><ul>\r\n<li>ตุู้เซฟอิเล็คโทรนิค เปิด-ปิด อัตโนมัติ ปุ่มกดหน้าจอดิจิตอลเรืองแสง LED</li>\r\n<li>ใช้งานง่าย กดตั้งรหัสส่วนตัว 3-6 หลัก แล้วปิดตู้ล็อคอัตโนมัติ&nbsp;</li>\r\n<li>ขับเคลื่อนด้วยมอเตอร์&nbsp;แกนเหล็กหนา 20 มิล</li>\r\n<li>ป้อนรหัสผิดติดต่อกัน 3 ครั้ง หน้าจอจะขึ้นคำว่า \"HOLD\" ระบบเครื่องจะหยุดทำงาน 5 นาที</li>\r\n<li>กรณีลูกค้าลืมรหัสกดส่วนตัว เปิดตู้ได้ด้วยรหัสเครื่องหรือใช้กุญแจไข</li>\r\n<li>แจ้งเตือนเมื่อถ่านในตู้เชฟไฟอ่อนหรือหมดให้ใช้กล่องไฟแบตเตอรี่ฉุกเฉินเสียบแทน</li>\r\n<li>ติดตั้งโดยขันน๊อตยึดติดกับพื้นด้านล่างหรือผนังตู้</li>\r\n<li>รับประกัน 1 ปี</li></ul>\r\n<div><strong>คุณสมบัติ</strong></div>\r\n</div>\r\n<div><br></div>\r\n<div>วัสดุ : เหล็กกล้าเคลือบด้วยสีกันฝุ่น</div><div>แบตเตอรี่ : 2A 1.5V จำนวน 4 ก้อน</div>\r\n<div>ขนาด : (กว้าง)42&nbsp;x (ลึก)37 x (สูง)20 ซม.</div>\r\n<div>น้ำหนัก :&nbsp;11 กิโลกรัม</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า : HSB-FD-2042F-(BL)<br>สี : ดำ<br><br>\r\nรหัสสินค้า : HSB-FD-2042F-(W)<br>สี:&nbsp;ขาว<br></div>\r\n<div><br></div>  \r\n<div><h2 style=\"color:#FF0000;\">ตู้เซฟ ELEGANCE ปลอดภัย ทนทาน ใช้งานง่าย</h2></div>\r\n<div><br></div>  \r\n<div><img src=\"https://th-test-11.slatic.net/shop/9c108ddeee22f54f98bbe70d71afac36.jpeg\" style=\"max-width:100%;\" alt=\"ตู้เซฟโรงแรม หน้าปัดเหลี่ยมโค้ง\"></div>\r\n<div><h2>ตู้เซฟโรงแรม หน้าปัดเหลี่ยมโค้ง ตู้เซฟอีเล็คโทรนิค ขนาดใหญ่ ใส่โน๊ตบุ๊คได้ เหมาะเก็บของสำคัญ เงินสด / แหวน / นาฬิกา / เครื่องเพชร / เอกสารสำคัญต่าง ๆ</h2></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/25da8e88fc9574f3e90dab2d10d66def.jpeg\" style=\"max-width:100%;\" alt=\"ตู้เซฟโรงแรม หน้าปัดเหลี่ยมโค้ง\"></div>', 1, 4, 6, 0, 0, 0, 0, '', 'Y', 'N'),
(13, 'HRD-RCY-67220', 'ไดร์เป่าผมติดผนัง เสียบวางหัวตรง', '<h2><strong>ไดร์เป่าผมติดผนัง (เสียบวางหัวตรง)</strong></h2><div><ul><li>รูปทรง เสียบวางหัวตรง&nbsp;ง่ายต่อการหยิบใช้ ตัวมอเตอร์และพัดลมคุณภาพสูง ทำงานเงียบ รับประกัน 1 ปี<br></li><li>เปิด-ปิด ปุ่มที่ตัวฐานเพื่อจ่ายกระแสไฟฟ้าเข้าตัวเครื่องเริ่มใช้งาน</li><li>กดปุ่มที่ด้ามเครื่อง เพื่อหมุนมอเตอร์เป่าลมทำงานเป็นเอกลักษณ์ความปลอดภัย สำหรับไดร์เป่าผมใช้ในห้องพักโรงแรม สถานประกอบการ และบ้านพัก<br></li><li>เครื่องจะตัดอัตโนมัติ ถ้ามีการใช้งานจนความร้อนขึ้นสูงเกินผิดวิสัย แล้วเครื่องจะกลับทำงานใหม่เมื่อความร้อนลดลงระดับปกติ ช่วยป้องกันไฟซ๊อตจากการใช้งาน<br></li><li>ปรับระดับลมร้อนได้ 2 ระดับ โดยเลื่อนตัวปรับขึ้น-ลง</li><li><span style=\"color:#ff0000\">ได้รับ มอก.1985-2549 เลขที่ น21600-908/1985</span><br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;HRD-RCY-67220</div><div>แรงดันไฟฟ้า : AC220v/50Hz</div><div>กำลังไฟ :&nbsp;1200 W</div><div>ระบบป้องกัน : ตัดไฟอัตโนมัติเมื่อเกิดความร้อนสูงเกิน</div><div>สี :&nbsp;ขาว</div><div><br></div><br><div><strong><span style=\"text-decoration-line:underline\"><p style=\"display:inline !important\">ข้อกำหนดและเงื่อนไขการรับประกัน</p></span></strong></div><div><strong><span style=\"text-decoration:underline\"><p style=\"display:inline !important\"><br></p></span></strong></div><div><div>บริษัทฯ รับประกันความบกพร่อง ชำรุด เสียหาย อันเนื่องมาจากมาตรฐานการผลิต และการใช้ผลิตภัณฑ์อย่าง&nbsp; ถูกวิธี เป็นการใช้งานตามปกติ ในระยะเวลารับประกัน 1 ปี นับจากวันที่จัดส่งสินค้า (บริษัทยินดีเปลี่ยนสินค้าให้ใหม่&nbsp; ในกรณีสินค้าชำรุดเกิดจากการผลิต ภายใน 7 วัน นับจากวันที่เซ็นรับสินค้าและฝ่ายช่างบริษัทฯ ได้ตรวจสอบแล้ว)</div><div><strong><br></strong></div><div><strong>กรณีบริการซ่อมในระยะเวลาประกัน&nbsp;<br></strong></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;บริษัทบริการรับซ่อมและเปลี่ยนอะไหล่ให้ฟรีในระยะเวลารับประกัน 1 ปี&nbsp; ตามที่ฝ่ายช่างบริษัทได้ตรวจสอบแล้วว่าอะไหล่ชิ้นที่เสียนั้นมิได้เกิดจาก กรณีไม่อยู่ในข่ายประกัน 5 ข้อดังกล่าวต่อไปนี้</div><div><strong><br></strong></div><div><strong>กรณีไม่อยู่ในข่ายประกัน</strong></div><div><ol><li>การชำรุดของผลิตภัณฑ์ ที่ใช้งานผิดวัตถุประสงค์ที่ออกแบบไว้ อุปกรณ์ แตก หัก ร้าว เนื่องจากการกระแทก&nbsp; หรือหล่น</li><li>ความเสียหายที่เกิดจากอุบัติเหตุ ภัยธรรมชาติ (ฟ้าฝ่า น้ำท่วม) ไฟตก จากแมลงและสัตว์ และการนำไปใช้งานในสภาพแวดล้อมที่ผิดปกติเกี่ยวกับอุณหภูมิความชื้น สารเคมี หรือเกิดจากความประมาทในการใช้งาน</li><li>ความเสียหายสืบเนื่องมาจาการนำอุปกรณ์อื่นมาต่อพ่วง การซ่อมแซมและดัดแปลงอย่างไม่ถูกต้องรวมทั้งการใช้อะไหล่อื่นมาทดแทน</li><li>แรงเคลื่อนไฟฟ้าไม่สม่ำเสมอจากหน้าสัมผัสหัวปลั๊กที่เป็นสะพานไฟ เช่น ผู้ใช้เสียบปลั๊กไฟไม่แน่น ทำให้ไฟเกิดการสปาร์ค</li><li>ขณะที่ใช้งานสินค้าเกิดการลัดวงจร</li></ol></div><div><strong>หมายเหตุ&nbsp;</strong></div><div><ul><li>ลูกค้าเป็นผู้ออกค่าใช้จ่ายในการส่งซ่อมและรับสินค้ากลับ</li><li>ในวันแจ้งซ่อม ควรระบุเลขที่ใบกำกับสินค้าและวันที่</li><li>สินค้าที่เสียหายหรือมีตำหนิเกิดจากบริษัทขนส่ง จะไม่อยู่ในข่ายการประกัน&nbsp;</li><li>สินค้าที่ส่งมาซ่อมจะถูกตรวจสอบโดยช่างผู้ชำนาญการของบริษัทฯ ว่าเกิดจากสาเหตุใด<br></li></ul></div>  <p style=\"text-decoration-line:underline;font-weight:bold;display:inline !important\"><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ไดร์เป่าผมติดผนัง/HRD-RCY-67220-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%;\" alt=\"ไดร์เป่าผมติดผนัง\"><br></p></div>  ', 3, 7, 26, 0, 0, 0, 0, '', 'N', 'N'),
(14, 'HRD-RCY-67300', 'ไดร์เป่าผมติดผนัง เสียบวางหัวลง', '<h2><strong>ไดร์เป่าผมติดผนัง (เสียบวางหัวลง)</strong></h2><div><ul><li>รูปทรง เสียบวางหัวลง ง่ายต่อการหยิบใช้ ตัวมอเตอร์และพัดลมคุณภาพสูง ทำงานเงียบ รับประกัน 1 ปี<br></li><li>เปิด-ปิด ปุ่มที่ตัวฐานเพื่อจ่ายกระแสไฟฟ้าเข้าตัวเครื่องเริ่มใช้งาน</li><li>กดปุ่มที่ด้ามเครื่อง เพื่อหมุนมอเตอร์เป่าลมทำงานเป็นเอกลักษณ์ความปลอดภัย สำหรับไดร์เป่าผมใช้ในห้องพักโรงแรม สถานประกอบการ และบ้านพัก<br></li><li>เครื่องจะตัดอัตโนมัติ ถ้ามีการใช้งานจนความร้อนขึ้นสูงเกินผิดวิสัย แล้วเครื่องจะกลับทำงานใหม่เมื่อความร้อนลดลงระดับปกติ ช่วยป้องกันไฟซ๊อตจากการใช้งาน<br></li><li>ปรับระดับลมร้อนได้ 2 ระดับ โดยเลื่อนตัวปรับขึ้น-ลง</li><li><span style=\"color:#ff0000\">ได้รับ มอก.1985-2549 เลขที่ น21600-908/1985</span><br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;HRD-RCY-67300</div><div>แรงดันไฟฟ้า : AC220v/50Hz</div><div>กำลังไฟ :&nbsp;1200 W</div><div>ระบบป้องกัน : ตัดไฟอัตโนมัติเมื่อเกิดความร้อนสูงเกิน</div><div>สี :&nbsp;ขาว</div><div><br></div><div><br></div><br><div><strong><span style=\"text-decoration-line:underline\"><p style=\"display:inline !important\">ข้อกำหนดและเงื่อนไขการรับประกัน</p></span></strong></div><div><strong><span style=\"text-decoration:underline\"><p style=\"display:inline !important\"><br></p></span></strong></div><div><div>บริษัทฯ รับประกันความบกพร่อง ชำรุด เสียหาย อันเนื่องมาจากมาตรฐานการผลิต และการใช้ผลิตภัณฑ์อย่าง&nbsp; ถูกวิธี เป็นการใช้งานตามปกติ ในระยะเวลารับประกัน 1 ปี นับจากวันที่จัดส่งสินค้า (บริษัทยินดีเปลี่ยนสินค้าให้ใหม่&nbsp; ในกรณีสินค้าชำรุดเกิดจากการผลิต ภายใน 7 วัน นับจากวันที่เซ็นรับสินค้าและฝ่ายช่างบริษัทฯ ได้ตรวจสอบแล้ว)</div><div><strong><br></strong></div><div><strong>กรณีบริการซ่อมในระยะเวลาประกัน&nbsp;<br></strong></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;บริษัทบริการรับซ่อมและเปลี่ยนอะไหล่ให้ฟรีในระยะเวลารับประกัน 1 ปี&nbsp; ตามที่ฝ่ายช่างบริษัทได้ตรวจสอบแล้วว่าอะไหล่ชิ้นที่เสียนั้นมิได้เกิดจาก กรณีไม่อยู่ในข่ายประกัน 5 ข้อดังกล่าวต่อไปนี้</div><div><strong><br></strong></div><div><strong>กรณีไม่อยู่ในข่ายประกัน</strong></div><div><ol><li>การชำรุดของผลิตภัณฑ์ ที่ใช้งานผิดวัตถุประสงค์ที่ออกแบบไว้ อุปกรณ์ แตก หัก ร้าว เนื่องจากการกระแทก&nbsp; หรือหล่น</li><li>ความเสียหายที่เกิดจากอุบัติเหตุ ภัยธรรมชาติ (ฟ้าฝ่า น้ำท่วม) ไฟตก จากแมลงและสัตว์ และการนำไปใช้งานในสภาพแวดล้อมที่ผิดปกติเกี่ยวกับอุณหภูมิความชื้น สารเคมี หรือเกิดจากความประมาทในการใช้งาน</li><li>ความเสียหายสืบเนื่องมาจาการนำอุปกรณ์อื่นมาต่อพ่วง การซ่อมแซมและดัดแปลงอย่างไม่ถูกต้องรวมทั้งการใช้อะไหล่อื่นมาทดแทน</li><li>แรงเคลื่อนไฟฟ้าไม่สม่ำเสมอจากหน้าสัมผัสหัวปลั๊กที่เป็นสะพานไฟ เช่น ผู้ใช้เสียบปลั๊กไฟไม่แน่น ทำให้ไฟเกิดการสปาร์ค</li><li>ขณะที่ใช้งานสินค้าเกิดการลัดวงจร</li></ol></div><div><strong>หมายเหตุ&nbsp;</strong></div><div><ul><li>ลูกค้าเป็นผู้ออกค่าใช้จ่ายในการส่งซ่อมและรับสินค้ากลับ</li><li>ในวันแจ้งซ่อม ควรระบุเลขที่ใบกำกับสินค้าและวันที่</li><li>สินค้าที่เสียหายหรือมีตำหนิเกิดจากบริษัทขนส่ง จะไม่อยู่ในข่ายการประกัน&nbsp;</li><li>สินค้าที่ส่งมาซ่อมจะถูกตรวจสอบโดยช่างผู้ชำนาญการของบริษัทฯ ว่าเกิดจากสาเหตุใด<br></li></ul></div>  <p style=\"text-decoration-line:underline;font-weight:bold;display:inline !important\"><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ไดร์เป่าผมติดผนัง/HRD-RCY-67300-min.jpg\" style=\"vertical-align:baseline;border:0px #000000;max-width:100%;\" alt=\"ไดร์เป่าผมติดผนัง เสียบวางหัวลง\" ><br></p></div><div><p style=\"text-decoration-line:underline;font-weight:bold;display:inline !important\"><br></p></div>  ', 3, 7, 26, 0, 0, 0, 0, '', 'N', 'N'),
(15, 'HRD-RCY-67260', 'ไดร์เป่าผมติดผนัง เสียบวางด้านข้าง', '<h2><strong>ไดร์เป่าผมติดผนัง (เสียบวางหัวข้าง)</strong></h2><div><ul><li>รูปทรง เสียบวางหัวข้าง ง่ายต่อการหยิบใช้ ตัวมอเตอร์และพัดลมคุณภาพสูง ทำงานเงียบ รับประกัน 1 ปี<br></li><li>เปิด-ปิด ปุ่มที่ตัวฐานเพื่อจ่ายกระแสไฟฟ้าเข้าตัวเครื่องเริ่มใช้งาน</li><li>กดปุ่มที่ด้ามเครื่อง เพื่อหมุนมอเตอร์เป่าลมทำงานเป็นเอกลักษณ์ความปลอดภัย สำหรับไดร์เป่าผมใช้ในห้องพักโรงแรม สถานประกอบการ และบ้านพัก<br></li><li>เครื่องจะตัดอัตโนมัติ ถ้ามีการใช้งานจนความร้อนขึ้นสูงเกินผิดวิสัย แล้วเครื่องจะกลับทำงานใหม่เมื่อความร้อนลดลงระดับปกติ ช่วยป้องกันไฟซ๊อตจากการใช้งาน<br></li><li>ปรับระดับลมร้อนได้ 2 ระดับ โดยเลื่อนตัวปรับขึ้น-ลง</li><li>มีปลั๊กเสียบ 2 คู่ที่ฐาน&nbsp;เพื่อเสียบเครื่องใช้กำลังไฟต่ำ</li><li><span style=\"color:#ff0000\">ได้รับ มอก.1985-2549 เลขที่ น21600-908/1985</span><br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>แรงดันไฟฟ้า : AC220v/50Hz</div><div>กำลังไฟ :&nbsp;1200 W</div><div><br></div><div><strong>รหัสสินค้า : HRD-RCY-67260</strong><br></div><div>สี :&nbsp;ขาว</div><div><br></div><div><strong>รหัสสินค้า : HRD-RCY-67260-BL</strong><br>สี : ดำ<br></div><div><br></div><br><div><strong><span style=\"text-decoration-line:underline\"><p style=\"display:inline !important\">ข้อกำหนดและเงื่อนไขการรับประกัน</p></span></strong></div><div><strong><span style=\"text-decoration:underline\"><p style=\"display:inline !important\"><br></p></span></strong></div><div><div>บริษัทฯ รับประกันความบกพร่อง ชำรุด เสียหาย อันเนื่องมาจากมาตรฐานการผลิต และการใช้ผลิตภัณฑ์อย่าง&nbsp; ถูกวิธี เป็นการใช้งานตามปกติ ในระยะเวลารับประกัน 1 ปี นับจากวันที่จัดส่งสินค้า (บริษัทยินดีเปลี่ยนสินค้าให้ใหม่&nbsp; ในกรณีสินค้าชำรุดเกิดจากการผลิต ภายใน 7 วัน นับจากวันที่เซ็นรับสินค้าและฝ่ายช่างบริษัทฯ ได้ตรวจสอบแล้ว)</div><div><strong><br></strong></div><div><strong>กรณีบริการซ่อมในระยะเวลาประกัน&nbsp;<br></strong></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;บริษัทบริการรับซ่อมและเปลี่ยนอะไหล่ให้ฟรีในระยะเวลารับประกัน 1 ปี&nbsp; ตาม