(17, 'BWO-HH758', 'ที่เปิดขวด/ที่เปิดจุกขวด', '<h2><strong>ที่เปิดขวด/ที่เปิดจุกขวด</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ใช้เพื่อเปิดฝาขวด&nbsp;,&nbsp;เปิดจุกขวด ,&nbsp;ตัดซีลหุ้มฝาขวด</li>\r\n</ul>\r\n</div>\r\n<div><p><strong>คุณสมบัติเฉพาะ</strong></p></div>\r\n<div>รหัสสินค้า&nbsp;BWO-HH758-RD</div>\r\n<div>สี :&nbsp;แดง</div>\r\n<div><br></div>\r\n<div>รหัสสินค้าBWO-HH758-BL</div>\r\n<div>สี :&nbsp;ดำ</div>\r\n<div><br></div>\r\n<div>วัสดุ : สแตนเลสหนา + พลาสติก<br>ขนาด : &nbsp;(ย) 14 ซม.<br></div> \r\n<div><br></div>\r\n<div><img src=\"https://th-live-01.slatic.net/p/9c3ad4c4183abb35145644ce1d81d634.jpg_q80_.webp\" style=\"max-width:100%;\" a;t=\"ที่เปิดขวด ที่เปิดจุกขวด\"></div>', 4, 11, 0, 0, 0, 0, 0, '', 'N', 'N'),
(18, 'ICB-0321', 'ถังน้ำแข็งอคริลิคใส', '<h2><strong>ถังน้ำแข็งอคริลิคใส</strong></h2><div><ul><li>วัสดุอะคริลิคใส</li><li>แต่งเหลียม พร้อมห่วงหูจับ</li><li>พร้อมที่หนีบน้ำแข็ง</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;ICB-0321  </div><div>ขนาด (ซม.) : &nbsp;∅14.5 x (H) 14 ซม.</div><div>ปริมาตร : 1.7 ลิตร</div><div><br></div><div><div>รหัสสินค้า : ICB-0322</div><div>ขนาด (ซม.) :<strong>&nbsp;</strong>∅19 x (H) 20 ซม.</div><div>ปริมาตร :&nbsp;3.5 ลิตร</div></div><br><div><br></div><div></div>  ', 4, 9, 0, 0, 0, 0, 0, '', 'N', 'N'),
(19, 'ICB-B666', 'ถังน้ำแข็งอคริลิคใส', '<h2><strong>ถังน้ำแข็งอคริลิคใส</strong></h2>\r\n<div>\r\n<ul>\r\n<li>วัสดุอะคริลิคใส</li>\r\n<li>ทรง 6 เหลียม พร้อมหูหิ้ว</li>\r\n<li>พร้อมที่หนีบน้ำแข็ง</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>รหัสสินค้า :&nbsp;ICB-B666</div>\r\n<div>วัสดุ : อะคริลิค</div>\r\n<div>ปริมาตร :&nbsp;1.2 ลิตร</div>\r\n<div>ขนาด :<strong>&nbsp;</strong>∅12 x (H) 12.5 ซม.</div> \r\n<div><br></div>\r\n<h2>ถังน้ำแข็ง อะคริลิค ถังน้ำแข็งอคิลิคใส ทรง 6 เหลียม<br>\r\nพร้อมหูหิ้ว พร้อมที่หนีบน้ำแข็ง ขนาด 1.2 ลิตร</h2>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/db94afe9fe77d0688e4a28daefab6da5.jpeg\" style=\"max-width:100%;\" alt=\"ถังน้ำแข็งอคริลิคใส\"></div>', 4, 9, 0, 0, 0, 0, 0, '', 'N', 'N'),
(20, 'ICB-JB8020', 'ถังน้ำแข็งพลาสติกแกะลาย', '<h2><strong>ถังน้ำแข็งพลาสติกแกะลาย</strong></h2>\r\n<div>\r\n<ul>\r\n<li>วัสดุพลาสติก เจียรเหลี่ยมคริสตัล</li>\r\n<li>ทรงกลม พร้อมหูหิ้ว</li>\r\n<li>พร้อมที่หนีบน้ำแข็ง</li>\r\n</ul></div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>รหัสสินค้า :&nbsp;ICB-JB8020</div>\r\n<div>วัสดุ : พลาสติก</div>\r\n<div>ปริมาตร : 1.3 ลิตร</div>\r\n<div>ขนาด :&nbsp;∅12.5 x (H) 14 ซม.</div>  \r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/6702a0ccd43e6c84c98f8aa26a9ec671.jpeg\" style=\"max-width:750px;\" alt=\"ถังน้ำแข็งพลาสติกแกะลาย\"></div>\r\n<div><br></div>\r\n<div><h2>ถังน้ำแข็ง อะคริลิค ถังน้ำแข็งอคิลิคใส แต่งเหลียมคริสตัล<br>\r\nพร้อมห่วงหูจับสแตนเลส ถังใส่น้ำแข็ง</h2></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/d0437e66d7195f80556f2b9d9a0c0dac.jpeg\" style=\"max-width:100%\" alt=\"ถังน้ำแข็งอคิลิคใสแกะลาย\"></div>', 4, 9, 0, 0, 0, 0, 0, '', 'N', 'N'),
(21, 'ICB-JF615M', 'กระติกน้ำแข็งพลาสติก 2ชั้น', '<h2><strong>กระติกน้ำแข็งพลาสติก&nbsp;2ชั้น</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ตัวถังพลาสติก 2 ชั้น ขอบ 1 ซม. ไร้รอยต่อ</li>\r\n<li>รูปทรงกระบอก ผิวนอกเคลือบสีดำ</li>\r\n<li>หูหิ้วสแตนเลสแบน จับถนัดมือ พร้อมรังผึ้ง</li>\r\n<li>ที่คีบน้ำแข็งเก็บสอดช่องฝาปิด</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>รหัสสินค้า :&nbsp;ICB-JF615M-BL  </div>\r\n<div>วัสดุ :&nbsp;พลาสติกอย่างดี<br>ปริมาตร&nbsp;: 1.3 ลิตร<br>ขนาด :&nbsp;∅14&nbsp;x สูง 19&nbsp;cm.</div>\r\n<div>สี : ดำ</div>\r\n<div>\r\n<div><br></div>\r\n<h2>กระติกน้ำแข็งคุณภาพพิเศษ พลาสติก 2ชั้น<br>\r\nขอบ 1 ซม. ไร้รอยต่อ พร้อมรังผึ้ง ที่ฝาปิดมีช่องเก็บที่คีบน้ำแข็ง</h2>\r\n</div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/c3bdc7f4d6b8e22f55510040b3eb50ba.jpeg\" style=\"max-width:100%;\" alt=\"\"></div>', 4, 9, 0, 0, 0, 0, 0, '', 'N', 'N'),
(22, 'PLM-NO.005-F', 'แผ่นรองจาน ทอลายเส้นด้าย', '<h2><strong>แผ่นรองจาน ทอลายเส้นด้าย</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ไม่เปอะเปื้อนเป็นคราบ เหมือนการใช้แผ่นรองจานที่ทำด้วยเนื้อผ้า</li>\r\n<li>เนื้อพลาสติกไม่ดูดซับ น้ำ หรือ น้ำมัน</li>\r\n<li>ใช้งานได้ทนทาน สีไม่ซีดจาง ดูใหม่อยู่เสมอ</li>\r\n<li>พื้นผิวเรียบทนต่อแรงดึงไม่ฉีกขาดเปื่อยยุ่ย</li>\r\n<li>สะดวกในการใช้ ไม่อับชื้น ไม่เป็นเชื้อรา เพียงเช็ดทำความสะอาดหลังการใช้งาน</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\n<ul>\r\n<li>รหัสสินค้า 005-(E-F)  </li>\r\n<li>วัสดุทอด้วยเส้นด้าย โพลีเอสเตอร์ 30% หุ้มเคลือบด้วย พีวีซี 70%</li>\r\n<li>สี/ลาย&nbsp;มีให้เลือกหลากหลายแบบและสีสัน ให้เข้ากับชุดโต๊ะอาหาร หรือผ้าปูโต๊ะให้ดูภูมิฐาน เพื่มบรรยากาศการรับประทานอาหาร</li>\r\n</ul>\r\n<p><strong>ขนาด</strong></p>\r\n<ul><li>กว้าง 30 x ยาว 45 cm.</li></ul>\r\n<div><br></div>\r\n<div>\r\n<img src=\"https://th-live-01.slatic.net/shop/f6d5036f27ff1edbe74653227f72eb03.jpeg_q80_.webp\" style=\"max-width:100%;\" alt=\"แผ่นรองจาน\">\r\n</div>\r\n<div><img src=\"https://th-live-01.slatic.net/shop/3d561d61e3f05af49121a0784c659f1e.jpeg\" style=\"max-width:100%;\" alt=\"แผ่นรองจาน PVC\"</div>', 4, 10, 0, 0, 0, 0, 0, '', 'N', 'N'),
(23, 'ATT-8025', 'ถาดเมลามีนพิมพ์ลายดอกไม้', '<h2><strong>ถาดเมลามีน&nbsp;พิมพ์ลายดอกไม้&nbsp;</strong></h2>\r\n<div>\r\n<ul>\r\n<li>รูปทรงสี่เหลี่ยม ขอบมน</li>\r\n<li>พื้นถาดสีขาวพิมพ์ลายดอกไม้</li>\r\n<li>ด้านใต้ถาดมีปุ่มยก</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\n<ul>\r\n<li>รหัสสินค้า :&nbsp;ATT-8025</li>\r\n<li>วัสดุ : เมลามีน</li>\r\n<li>ขนาด&nbsp; :38 x 27 cm.</li>\r\n<li>สีพื้นขาว พิมพ์ลายดอกไม้</li>\r\n</ul>\r\n</div>\r\n<div>\r\n<img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/ถาด/เมลามีน/ATT-8025-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%;\" alt=\"ถาดเมลามีนพิมพ์ลายดอกไม้-ATT-8025\" ><br></div>  ', 8, 19, 0, 0, 0, 0, 0, '', 'Y', 'N'),
(24, 'ATT-T331', 'ถาดเมลามีนสีขาวพิมพ์ลาย', '<h2><strong>ถาดเมลามีนสีขาว&nbsp;พิมพ์ลาย&nbsp;</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ถาดขาวพิมพ์ลาย พื้นเงา สวยงาม ขอบเฉียงลาดมน</li>\r\n<li>ด้านข้างยื่นออกเป็นที่จับ เพื่อความสะดวก</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\n<ul>\r\n<li>รหัสสินค้า :&nbsp;ATT-T331</li>\r\n<li>วัสดุ : เมลามีน</li>\r\n<li>ขนาด : 33 x 20 cm.</li>\r\n<li>สีพื้นขาว พิมพ์ลายน้ำเงินเข้ม</li>\r\n</ul>\r\n<div>\r\n<img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/ถาด/เมลามีน/ATT-T331-min.jpg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%\" alt=\"ถาดเมลามีนสีขาวพิมพ์ลาย-ATT-T331\" ><br></div></div>  ', 8, 19, 0, 0, 0, 0, 0, '', 'Y', 'N'),
(25, 'SLP-TRCH', 'สลิปเปอร์ แบบใช้แล้วทิ้ง', '<h2><strong>รองเท้าสลิปเปอร์ แบบใช้แล้วทิ้ง</strong></h2><div>\r\n<ul>\r\n<li>ตัดเย็บ ขนาด รูปทรง ได้มาตราฐาน</li>\r\n<li>พื้นรองเท้ายางกันลื่น</li>\r\n<li>พื้นด้านใน เป็นผ้าสปันบอนด์</li>\r\n</ul></div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\n<ul>\r\n<li><strong>รหัสสินค้า :</strong>&nbsp;SLP-TRCH</li>\r\n<li><strong>วัสดุ :</strong> ผ้าสปันบอนด์ พื้นยาง</li>\r\n<li><strong>ขนาด :</strong>&nbsp;11 x 28.5 ซม.</li><li><strong>สี :&nbsp;</strong>ขาว</li>\r\n</ul>\r\n</div> \r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/fac1a1722360946f4ea7bd91698601f1.jpeg\" style=\"max-width:100%;\" alt=\"สลิปเปอร์ใช้แล้วทิ้ง\"></div> \r\n<div><br></div>\r\n<div><h2>\r\nรองเท้าสลิปเปอร์ใช้แล้วทิ้ง สีขาว<br>\r\nเหมาะสำหรับ ใช้ในโรงแรม รองเท้าสปา โรงพยาบาล<br>\r\nรองเท้าสลิปเปอร์โรงแรม  สลิปเปอร์สปา<br>\r\nสลิปเปอร์โรงพยาบาล สลิปเปอร์ใช้ในบ้าน\r\n</h2></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/bcb0ef9dbd655768367156e7594a2d0b.jpeg\" style=\"max-width:100%;\" alt=\"สลิปเปอร์ใช้แล้วทิ้ง\"></div>', 8, 17, 0, 0, 0, 0, 0, '', 'N', 'N'),
(26, 'SLP-07', 'สลิปเปอร์ ผ้าขนหนูหัวเปิด', '<h2><strong>รองเท้าสลิปเปอร์ ผ้าขนหนูหัวเปิด</strong></h2>\r\n<div>\r\n<ul>\r\n<li>พื้นตัดเย็บ ขนาด รูปทรง หัวเปิดได้มาตรฐาน</li><li>พื้นรองเท้า EVA 5 มิล เย็บหนา 2 ชั้น กันลื่น</li><li>ผ้าขนหนูหนานุ่ม สวมใส่สบาย ถอดซักได้</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\n<ul>\r\n<li><strong>รหัสสินค้า :</strong>&nbsp;SLP-07</li>\r\n<li><strong>วัสดุ :</strong> ผ้าขนหนูหนา พื้น EVA</li>\r\n<li><strong>ขนาด :</strong>&nbsp;11 x 29 ซม.</li>\r\n<li><strong>สี :&nbsp;</strong>ขาว</li>\r\n</ul>\r\n</div>  \r\n<div><h2 style=\"color:#FF0000;\"><u>ปกป้องเท้าจากสิ่งสกปรกและเชื้อโรคในห้อง</u></h2></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/18bd24f6eec2a14362b2f5b9ad46c444.jpeg\" style=\"max-width:100%;\" alt=\"สลิปเปอร์ ผ้าขนหนูหัวเปิด\"></div>\r\n<div><br></div>\r\n<div><h2>\r\nรองเท้าสลิปเปอร์ผ้าขนหนูหนานุ่ม เย็บหนา 2 ชั้น<br>\r\nพื้นยาง EVA 5มิล กันลื่น รองเท้าแบบหัวเปิด ซักได้<br>\r\nรองเท้าสลิปเปอร์โรงแรม  สลิปเปอร์สปา<br>\r\nสลิปเปอร์โรงพยาบาล สลิปเปอร์ใช้ในบ้าน\r\n</h2></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/471b991f07c59d0b6fa7c50ef8b3c830.jpeg\" style=\"max-width:100%;\" alt=\"สลิปเปอร์ผ้าขนหนู\"></div>', 8, 17, 0, 0, 0, 0, 0, '', 'N', 'N'),
(27, 'SLP-05', 'สลิปเปอร์ ผ้ารังผึ้ง', '<h2><strong>รองเท้าสลิปเปอร์ ผ้ารังผึ้ง</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ตัดเย็บ ขนาด รูปทรง ได้มาตรฐาน</li>\r\n<li>พื้นรองเท้า EVA เย็บประกบในตัว หนา 5 มิล</li>\r\n<li>ผ้ารังผึ้งหนานุ่ม สวมใส่สบาย กันลื่น ถอดซักได้</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\n<ul>\r\n<li><strong>รหัสสินค้า :</strong>&nbsp;SLP-05</li>\r\n<li><strong>วัสดุ :</strong> ผ้ารังผึ้งหน้า พื้น EVA</li>\r\n<li><strong>ขนาด :</strong>&nbsp;11 x 27.5 ซม.</li>\r\n<li><strong>สี :&nbsp;</strong>ขาว</li>\r\n</ul>\r\n</div>\r\n</div>  \r\n<div><h2 style=\"color:#FF0000;\"><u>ปกป้องเท้าจากสิ่งสกปรกและเชื้อโรคในห้อง</u></h2></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/4f3d2740e2418ceea3bb7aadce2a2db2.jpeg\" style=\"max-width:100%; margin-top:15px; margin-bottom:15px;\" alt=\"สลิปเปอร์ ผ้ารังผึ้ง\"></div>\r\n<div><br></div>\r\n<div><h2>\r\nรองเท้าสลิปเปอร์ผ้าขนหนูหนานุ่ม เย็บหนา 2 ชั้น<br>\r\nพื้นยาง EVA 5มิล กันลื่น รองเท้าแบบหัวเปิด ซักได้<br>\r\nรองเท้าสลิปเปอร์โรงแรม  สลิปเปอร์สปา<br>\r\nสลิปเปอร์โรงพยาบาล สลิปเปอร์ใช้ในบ้าน\r\n</h2></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/68177ea0ccfed86b642dc834bc9be5c9.jpeg\" style=\"max-width:100%; margin-top:15px; margin-bottom:15px;\" alt=\"รองเท้าสลิปเปอร์ผ้ารังผึ้ง\"></div>', 8, 17, 0, 0, 0, 0, 0, '', 'N', 'N'),
(28, 'RW3-9405T-03', 'ถังขยะฝาสวิง ทรงกลม', '<div><h2><strong>ถังขยะฝาสวิง ทรงกลม</strong></h2><div>\r\n<div>\r\n<ul>\r\n<li>ฝาสวิงเปิด-ปิดง่าย ใช้งานสะดวก</li>\r\n<li>สแตนเลสหนาคุณภาพ ไม่เป็นรอยขีดข่วน</li>\r\n<li>มีขอบยางกันลื่น ยึดติดกับพื้นได้ดี</li>\r\n</ul>\r\n</div></div>\r\n<p><strong>คุณสมบัติ</strong></p>\r\n<div>\r\n<ul>\r\n<li>รหัส&nbsp;RW3-9405T-03</li>\r\n<li>ขนาด ∅ 20 x (H)30 CM.</li>\r\n<li>ปริมาตร 9 ลิตร</li>\r\n<li>สีเงิน</li>\r\n</ul>\r\n<div>\r\n<img src=\"https://th-test-11.slatic.net/shop/614f8cfdbd763944886dbd576146b185.jpeg\" style=\"vertical-align:baseline;border:0px #000000; max-width:100%;\" alt=\"ถังขยะฝาสวิง ทรงกลม รุ่น RW3-9405T-03\"></div>', 9, 0, 0, 0, 0, 0, 0, '', 'Y', 'N'),
(29, 'HGS-SA-002', 'ไม้แขวน กำมะหยี่', '<h2><strong>ไม้แขวนเสื้อกำมะหยี่ โค้งงอได้ไม่หักง่าย</strong></h2>\r\n<div>\r\n<ul>\r\n<li>แขวนเสื้อผ้าไม่หลุดง่าย</li>\r\n<li>หัวตะขอสแตนเลส แข็งแข็ง ทนทาน</li>\r\n<li>ตัวก้านพลาสติกหุ้มกำมะหยี่โค้งงอได้ไม่หักง่าย</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>รหัสสินค้า&nbsp;HGS-SA-002-G</div>\r\n<div>ขนาด&nbsp;ยาว41ซม.</div>\r\n<div>สีครีม</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า&nbsp;HGS-SA-002-BL</div>\r\n<div>ขนาด&nbsp;ยาว41ซม.</div>\r\n<div>สีดำ</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า&nbsp;HGS-SA-002-GR</div>\r\n<div>ขนาด&nbsp;ยาว41ซม.</div>\r\n<div>สีเทา&nbsp;</div>\r\n<div><br></div>\r\n<div><img src=\"https://th-live-01.slatic.net/p/08992f48f68d476d743fa4361607ac76.jpg_q80_.webp\" style=\"max-width:100%;\" alt=\"ไม้แขวนเสื้อกำมะหยี่\"></div> \r\n\r\n<div><img src=\"https://th-live-01.slatic.net/p/012d6814765fa4df6d3a287b8dcda060.jpg_q80_.webp\" style=\"max-width:100%\" alt=\"ไม้แขวนเสื้อกำมะหยี่\"></div> ', 1, 2, 0, 0, 0, 0, 0, '', 'N', 'N'),
(30, 'MNM-QL-738-8Inch', 'กระจกแต่งหน้าตั้งโต๊ะ ทรงกลม ขยาย 3 เท่า', '<h2><strong>กระจกส่องหน้าตั้งโต๊ะ&nbsp;กระจกขยายตั้งโต๊ะ กระจกตั้งโต๊ะ</strong></h2>\r\n<div>\r\n<ul>\r\n<li>ออกแบบรูปทรง ขาตั้งตรง&nbsp;หรูหรา เด่นสะดุดตา</li>\r\n<li>ตั้งวาง ปรับระดับได้ทุกมุมมอง 360 องศา</li>\r\n<li>กระจกส่องหน้าธรรมดา 1 ด้าน ขยาย 3 เท่า 1 ด้าน</li>\r\n<li>ช่วยเพิ่มอารมณ์สุนทรีย์ในการตกแต่งหน้า</li>\r\n<li>เหมาะสำหรับ สุภาพสตรีส่องกระจกแต่งหน้า ได้เห็น สี แสง เงา รายละเอียดบนใบหน้าได้คมชัดยิ่งขึ้น<br></li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>รหัสสินค้า :&nbsp;MNM-QL-738-8Inch<br>\r\nวัสดุ :&nbsp;ทองแดงชุบโครเมี่ยม<br>\r\nขนาด :&nbsp;∅ 8&nbsp;นิ้ว\r\n</div>  \r\n<div>\r\n<div><br></div>\r\n<h2>กระจกแต่งหน้า ตั้งโต๊ะ Elegance กระจกส่องหน้า ส่องได้ 2 ด้าน หมุนได้รอบตัว 360 องศา แบบกระจกขยาย 3 เท่า และแบบ กระจกเงา ปกติ กระจกแต่งหน้าแบบ ทรงกลม</h2>\r\n</div>\r\n<div><br></div>\r\n<div>\r\n<img src=\"https://th-test-11.slatic.net/shop/b2081e90534947e9e6cadd8521575650.jpeg\" style=\"max-width:100%;\" alt=\"กระจกแต่งหน้าบบตั้งโต๊ะ\">\r\n</div>', 1, 3, 4, 0, 0, 0, 0, '', 'N', 'N'),
(31, 'SOD-7101-A', 'ที่กดสบู่ติดผนัง หัวเดี่ยว ก้านพลาสติก 500 ml.', '<h2><strong>ที่กดสบู่ ติดผนังหัวเดี่ยว ทรงกระบอกยาว ก้านพลาสติก</strong></h2>\r\n\r\n<div>\r\n<ul>\r\n<li>รูปทรงหรูหรา ทันสมัย ช่องเติมน้ำยากว้าง</li>\r\n<li>เปิดฝาด้าน บน พร้อมกุญแจล็อกเปิด- ปิดฝา</li>\r\n<li>กระบอกชนิดลดความถ่วง กดง่ายได้ปริมาณแน่นอน ไม่ไหลเยิ้ม</li>\r\n<li>ที่แป้นใช้กุญแจขันล๊อคกับกระบอกได้ ป้องกันสูญหาย</li>\r\n<li>จ่ายน้ำยา โดยการดึงแกนเข้าหาตัว</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\nรหัสสินค้า :&nbsp;SOD-7101-A<br>\r\nวัสดุ กระบอกพลาสติก ABS&nbsp;</div>\r\n<div>สี :&nbsp;กระบอกขาว, ฝาสีเทา, แผ่นครอบขัดซาติน<br>\r\nขนาด :&nbsp; (H)24.1x(W)10.0x(L)12.2cm</div>\r\n<div>ปริมาตร : 500 ml.</div>\r\n<div>  <br></div><div><br></div><div>\r\n<div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  </div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/ที่กดสบู่/หัวเดี่ยว/SOD-7101-A-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"ที่กดสบู่-ทรงกระบอกยาว-sod-7101-a\" width=\"650\" height=\"1625\"><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
(32, 'SOD-7101-E', 'ที่กดสบู่ติดผนัง หัวเดี่ยว ก้านเหล็ก 500 ml.', '<h2><strong>ที่กดสบู่ ติดผนังหัวเดี่ยว ทรงกระบอกยาว</strong></h2><div><ul><li>รูปทรงหรูหรา ทันสมัย ช่องเติมน้ำยากว้าง</li><li>เปิดฝาด้าน บน พร้อมกุญแจล็อกเปิด- ปิดฝา</li><li>กระบอกชนิดลดความถ่วง กดง่ายได้ปริมาณแน่นอน ไม่ไหลเยิ้ม</li><li>ที่แป้นใช้กุญแจขันล๊อคกับกระบอกได้ ป้องกันสูญหาย</li><li>จ่ายน้ำยา โดยการดึงแกนเข้าหาตัว</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong><br></p><div><div>วัสดุ :&nbsp;กระบอกพลาสติก ABS , แผ่นครอบ Stainless 304</div><div>ขนาด :&nbsp; (H)24.1x(W)10.0x(L)12.2cm.&nbsp;</div><div>ปริมาตร :&nbsp;500 ml.</div><div><br></div>รหัสสินค้า : SOD-7101-C<br>สี : กระบอกขาว, ฝาโครมเงิน, แผ่นครอบขัดซาติน<br><br>รหัสสินค้า : SOD-7101-D <br>สี : กระบอกเงิน, ฝาโครมเงิน, แผ่นครอบขัดซาติน<br><br>รหัสสินค้า : SOD-7101-E<br>สี : กระบอกดำ, ฝาโครมเงิน, แผ่นครอบขัดซาติน<br></div><div><br></div><div><br></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div>  <br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/ที่กดสบู่/หัวเดี่ยว/SOD-7101-E-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"ที่กดสบู่-ทรงกระบอกยาว-สีดำ\" width=\"650\" height=\"2168\"><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N');
