(33, 'SWC-028-2020-IV', 'ผ้าม่านห้องน้ำ โพลีเอสเตอร์ 180x180.5ซม. ', '<h2><strong>ผ้าม่านห้องน้ำ ม่านห้องน้ำ โพลีเอสเตอร์ 100% ขนาดตัวผ้า 180x180.5 ซม. ไม่ซับน้ำ กันเชื้อรา ไร้กลิ่นอับ ซักทำความสะอาดได้ สำหรับแบ่งพื้นที่โซนเปียก และโซนแห้ง</strong></h2>\r\n<div>\r\n<ul>\r\n<li>เนื้อผ้าโพลีเอสเตอร์ 100%</li>\r\n<li>ไม่ซับน้ำ กันเชื้อรา ไร้กลิ่นอับ</li>\r\n<li>ป้องกันความร้อน คราบสกปรก</li>\r\n<li>ทำความสะอาดได้ง่าย ไม่อุ้มน้ำ ไม่อับชื้น</li>\r\n<li>เนื้อผ้ามีความอ่อนนุ่มและยืดหยุ่นได้ดี แข็งแรง ทนทาน ต่อการใช้งาน</li>\r\n<li>ซักทำความสะอาดได้</li>\r\n</ul>\r\n</div>\r\n<div><strong>คุณสมบัติเฉพาะ</strong></div>\r\n<div>\r\n<ul>\r\n<li>รหัสสินค้า&nbsp;SWC-028-2020-IV</li>\r\n<li>วัสดุ&nbsp;โพลีเอสเตอร์ 100%</li>\r\n<li>ขนาด&nbsp;180x180.5ซม.</li>\r\n</ul>\r\n</div>\r\n<div>\r\n<img src=\"https://th-test-11.slatic.net/shop/83cc0a11a0acee314c4267de38eb490f.jpeg\" style=\"width:90%\">\r\n</div>\r\n<div>\r\n<img src=\"https://th-test-11.slatic.net/shop/c2fc01bc2e8f2fb235c409040d7a32d5.jpeg\" style=\"width:90%\">\r\n</div>\r\n', 5, 15, 0, 0, 0, 0, 0, '', 'N', 'N'),
(34, 'SPM-SL-3T', 'เครื่องขัดรองเท้าอัตโนมัติ', '<h2><strong>เครื่องขัดรองเท้าอัตโนมัติ ตัวเล็ก (ใช้ตามบ้านพัก)</strong></h2>\r\n<div>\r\n<ul>\r\n<li>หัวขัดรองเท้า 2 หัว หมุนทำงานด้วยระบบ Sensor</li>\r\n<li>หัวขัดเส้นใยฟู (ขัดเงา) + ขนแปรง (ปัดฝุ่น) ทนทาน แรงขัดเงาสูง</li>\r\n<li>เพียงแค่ยื่นเท้าผ่าน Sensor เข้าหา หัวขัดจะหมุนขัดรองเท้าอัตโนมัติ&nbsp;ทันที โดยดันแตะน้ำยาที่กระบอก แล้วพลิกเท้าให้ขัดโดยรอบ&nbsp;ทั้ง 2 ข้าง</li>\r\n<li>เสียงเครื่องเบา ดังระดับเสียงคุยกันปกติ&nbsp;≤&nbsp;50 dB</li>\r\n<li>ไฟฟ้า AC 220V/50Hz 60W</li>\r\n<li>ความเร็วมอเตอร์ 900 รอบ/นาที</li>\r\n<li>พร้อมน้ำยาขัดเงา 1 ขวด</li>\r\n<li>รับประกัน 1 ปี (หลังประกันมีบริการซ่อมและอะไหล่)</li>\r\n</ul>\r\n</div>\r\n<div>\r\n<p><strong>วิธีใช้</strong></p>\r\n<ul>\r\n<li>เริ่มโดย ยื่นเท้าไปที่หัวแปรงปัดฝุ่นรอบรองเท้าดูสะอาด</li>\r\n<li>ยื่นเท้า แตะดันที่ปุ่มกระบอก น้ำยาไหลหยดลงรองเท้าแล้วยื่นเท้าไปที่หัวขัดเส้นใยฟู พลิกรองเท้าให้ขัดมันเงาทุกด้าน\r\n</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>รหัสสินค้า :&nbsp;SPM-SL-3T-G</div>\r\n<div>ขนาด :&nbsp;&nbsp;(ก)19 x (ย)37 x (ส)27 + (หูหิ้วสูง 4.5) ซม.</div>\r\n<div>กระบอกน้ำยา : 100 ML.</div>\r\n<div>น้ำหนัก : 7 กก.  </div>\r\n<div>วัสดุ : ตู้ไม้ + สแตนเลส</div>\r\n<div>สี : สีทอง , สีเงิน</div>\r\n<div><br></div>\r\n<div><p><strong>หมายเหตุ</strong></p></div>\r\n<div>พื้นพรม อาจมีการปรับเปลี่ยนสี ในการผลิตแต่ละครั้ง <br>\r\nกรุณาสอบถามก่อนสั่งซื้อ</div><div><br></div>  \r\n<div>\r\n<img src=\"https://th-test-11.slatic.net/shop/a88dee9d605c865846a1fc68816ade5a.jpeg\" style=\"width:90%\">\r\n</div>\r\n<br>', 3, 8, 0, 0, 0, 0, 0, '', 'N', 'N'),
(35, 'HGS-SA-001', 'ไม้แขวนเสื้อซาติน', '<h2><strong>ไม้แขวนเสื้อซาติน ไม้แขวนหุ้มผ้าซาติคุณภาพดี บุด้วยฟองน้ำหนา</strong></h2>\r\n<div>\r\n<ul>\r\n<li>สำหรับแขวนเสื้อผ้า</li>\r\n<li>งานปราณีต สวยงาม แข็งแรง</li>\r\n<li>ใช้งานง่าย สะดวก</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>วัสดุ : ผ้าซาติน</div>\r\n<div>ขนาด : 38 ซม.</div>\r\n<div>บรรจุ : 6 ชิ้น/แพ็ค</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า&nbsp;HGS-SA-001-white</div>\r\n<div>สีขาว</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า&nbsp;HGS-SA-001-pink</div>\r\n<div>สีชมพู</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า&nbsp;HGS-SA-001-brown</div>\r\n<div>สีน้ำตาล&nbsp;</div>\r\n<div><br></div>\r\n<div>รหัสสินค้า&nbsp;HGS-SA-001-black</div>\r\n<div>สีดำ&nbsp;</div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/15fbe3b2150346af10c897172898326c.jpeg\" style=\"max-width:100%;\" alt=\"ไม้แขวนเสื้อซาติน\"></div> \r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/9fc68f04f82f56812378a0f0d5f3d359.jpeg\" style=\"max-width:100%;\" alt=\"ไม้แขวนเสื้อซาติน\"></div> \r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/cf7d547589ef51e136d3125bc36be92f.jpeg\" style=\"max-width:100%;\" alt=\"ไม้แขวนซาติน\"></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/80e77f84ab93b66946553fb5e8e81d04.jpeg\" style=\"max-width:100%;\" alt=\"ไม้แขวนซาติน\"></div>', 1, 2, 0, 0, 0, 0, 0, '', 'N', 'N'),
(36, 'HGS-J003-H-C1', 'ไม้หนีบกระโปรง', '<h2><strong>ไม้แขวนหนีบกระโปรง หนีบกางเกง</strong></h2>\r\n<div>\r\n<ul>\r\n<li>สำหรับหนีบกระโปรง หนีบกางเกง</li>\r\n<li>บาร์ไม้มีฟัน กันกระโปรงหรือกางเกงหลุด</li>\r\n<li>งานไม้ปราณีต สวยงาม แข็งแรง</li>\r\n<li>ใช้งานง่าย สะดวก</li>\r\n</ul>\r\n</div>\r\n<p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>วัสดุ : ไม้ Lotus Wood</div>\r\n<div>ขนาด : 28 ซม. ไม้หนา 1 ซม.</div>\r\n<div>สี : เบจ</div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/2fe6922526433635b1effc40971c23de.jpeg\" style=\"max-width:100%;\" alt=\"ไม้หนีบกระโปรง\"></div> \r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/56cda9ba1dfb9a87dd7da4de8f475f2d.jpeg\" style=\"max-width:100%;\" alt=\"ไม้หนีบกระโปรง\"></div> \r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/21c88dea6a286c135dfcd0a243207a62.jpeg\" style=\"max-width:100%;\" alt=\"ไม้หนีบกระโปรง\"></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/fdfbc372170238ccc3a765ced7c805df.jpeg\" style=\"max-width:100%;\" alt=\"้หนีบกระโปรง\"></div>\r\n<div><br></div>\r\n<div><img src=\"https://th-test-11.slatic.net/shop/86ec6177bf776baab397c92d0da61237.jpeg\" style=\"max-width:100%;\" alt=\"้หนีบกระโปรง\"></div>\r\n', 1, 2, 0, 0, 0, 0, 0, '', 'N', 'N'),
