(43, 'ETK-8039', 'ถ้วยชุดชงชา-กาแฟ', '<h2><strong>ถ้วยชุดชงชา-กาแฟ Stainless Steel</strong></h2><div><ul><li>ถ้วยชุด ชงชา/กาแฟ สะดวกพร้อมดื่ม 4 ที่</li><li>ทำจาก เนื้อแก้วทนความร้อนและสเตนเลส อย่างดี</li><li>รูปทรงทันสมัย วางจัดบนชุดถาดพร้อมเสิร์ฟ</li><li>ชงง่ายๆ เพียงตักผงกาแฟ/ชา ใส่ลงในถ้วยแล้วเทน้ำร้อน</li><li>ปิดฝารอบ่ม 3-5 นาที ดึงฝาขึ้นเทกากทิ้ง แล้วรินเสิร์ฟ</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : ETK-8039<br>วัสดุ : แก้ว และ สแตนเลสคุณภาพอย่างดี<br>ปริมาตร : 600 มล.<br>ขนาด : ∅ 8.5&nbsp;ซม. สูง 21&nbsp;ซม.<br>สี : แก้วใส &nbsp;ตัวโครงสแตนเลส</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/กาต้มน้ำร้อน/ถ้วยชงกาแฟ/ETK-8039-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"ถ้วยชุดชงชา ถ้วยชงกาแฟ\" width=\"650\" height=\"2927\"><br></div>  ', 3, 43, 24, 0, 0, 0, 0, '', 'N', 'N'),
(44, 'ETK-CK-600', 'ถ้วยชุดชงชา-กาแฟ', '<h2><strong>ถ้วยชุดชงชา-กาแฟ Stainless Steel</strong></h2><div><ul><li>ถ้วยชุด ชงชา/กาแฟ สะดวกพร้อมดื่ม 4 ที่</li><li>ทำจาก เนื้อแก้วทนความร้อนและสเตนเลส อย่างดี</li><li>รูปทรงทันสมัย วางจัดบนชุดถาดพร้อมเสิร์ฟ</li><li>ชงง่ายๆ เพียงตักผงกาแฟ/ชา ใส่ลงในถ้วยแล้วเทน้ำร้อน</li><li>ปิดฝารอบ่ม 3-5 นาที ดึงฝาขึ้นเทกากทิ้ง แล้วรินเสิร์ฟ</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : ETK-CK-600<br>วัสดุ : แก้ว และ สแตนเลสคุณภาพอย่างดี<br>ปริมาตร : 600 มล.<br>ขนาด : ∅9 ซม. สูง 19 ซม.<br>สี : แก้วใส + สแตนเลส</div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/กาต้มน้ำร้อน/ถ้วยชงกาแฟ/ETK-CK-600-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"ถ้วยชุดชงชา-กาแฟ Stainless Steel\" width=\"650\" height=\"2264\"></div>  ', 3, 43, 24, 0, 0, 0, 0, '', 'N', 'N'),
(45, 'WCL-BCW-70A', 'ตู้แช่ไวน์ (28 ขวด)', '<h2><strong>ตู้แช่ไวน์  70 ลิตร/4 ขวด x 7 ชั้น (28 ขวด)<br></strong></h2><div><ul><li>ระบบทำความเย็นล้ำยุค Thermoelectric Cooling Technology&nbsp;<br>   เก็บแช่คงคุณภาพไวน์ดีกว่าตู้ระบบความเย็นแบบ Compressor <br>   เครื่องเดินเงียบ ไร้เสียงรบกวนและตู้ไม่สั่น ช่วยรักษารสชาติ<br>และกลิ่นหอมของไวน์</li><li>ปรับตั้งระดับอุณหภูมิความเย็นคงที่ 12 - 18C°&nbsp;</li><li>ประตูแบบดูดปิด กระจกนิรภัย 2 ชั้น ลดการเกิดฝ้าและหยดน้ำ ป้องกันแสง UV&nbsp;</li><li>ปลอดจากสาร CFC ความชื้น และกลิ่นอับ ทำความสะอาดง่าย</li><li>หน้าจอตัวเลขแสงสีน้ำเงิน แตะสัมผัสตั้งค่าอุณหภูมิเป็น C° หรือ F°<br>  และเปิด-ปิดแสงไฟในตู้ LED ที่หน้าจอนี้</li><li>รับรองมาตรฐานผลิตภัณฑ์จากสถาบัน CE, RoHS&nbsp;</li><li>รับประกัน 2&nbsp;ปี</li></ul><div style=\"color:#dc8a00\"><p><strong>หมายเหตุ</strong></p><ul><li>เสียงและอาการสั่นของตู้ไวน์ทั่วไป เกิดจากตัว Compressor</li><li>การสั่นมีผลเสีย ต่อการเร่งหมักบ่ม (Wine aging) ทำให้รสชาติไวน์ด้อยคุณภาพ</li><li>ขวดมาตรฐาน 750 มล. ( ∅7.6 x (สูง)31.5 ซม. )<br></li></ul></div></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;WCL-BCW-70A</div><div>วัสดุ&nbsp;:           แผ่นเหล็กเคลือบสีกันฝุ่น <br>ขนาด : กว้าง 43 x ลึก 52 สูง 74 ซม.<br>                  น้ำหนัก :&nbsp;19.5 กิโลกรัม<br>กำลังไฟ :      220 V/50 Hz 65&nbsp;W<br>สี :               ดำ</div><br><p><strong>ออฟชั่นพิเศษ&nbsp;:&nbsp;</strong></p><div><ul><li>ชั้นวางตระแกรงไม้</li><li>กรอบประตูสแตนเลส</li></ul></div><br><div><strong><p><span style=\"text-decoration:underline\">แนะนำอุณหภูมิ&nbsp;แช่ไวน์แต่ละชนิด</span></p></strong></div><div><ul><li>ไวน์แดง 14-18&nbsp;C° , 57-64&nbsp;F°</li><li>ไวน์ขาว&nbsp;9-14 C° , 48-57 F°<br></li><li>ไวน์ทั่วไป&nbsp;10-12 C° , 50-54 F°<br></li></ul></div><div><br></div>  ', 3, 6, 0, 0, 0, 0, 0, '', 'N', 'N'),
(46, 'WCL-BCW-69D', 'ตู้แช่ไวน์กระจก 2 ประตู 2 ตอน (24 ขวด)', '<h2><strong>ตู้แช่ไวน์กระจก   2 ประตู 2 ตอน 69 ลิตร/24&nbsp;ขวด<br>โซนคู่&nbsp;แยกแช่ตามชนิดของไวน์ <br>ตอนบน&nbsp;: 8 ขวด&nbsp;<br>ตอนล่าง&nbsp;: 16 ขวด&nbsp;<br></strong></h2><div><ul><li>ระบบทำความเย็นล้ำยุค Thermoelectric Cooling Technology&nbsp;<br>   เก็บแช่คงคุณภาพไวน์ดีกว่าตู้ระบบความเย็นแบบ Compressor <br>   เครื่องเดินเงียบ ไร้เสียงรบกวนและตู้ไม่สั่น ช่วยรักษารสชาติ<br>และกลิ่นหอมของไวน์</li><li>ปรับตั้งระดับอุณหภูมิความเย็นคงที่ ตอนบน&nbsp;8 - 18C°&nbsp; ตอนล่าง&nbsp;12 - 18C°</li><li>ประตูแบบดูดปิด กระจกนิรภัย 2 ชั้น ลดการเกิดฝ้าและหยดน้ำ ป้องกันแสง UV&nbsp;</li><li>ปลอดจากสาร CFC ความชื้น และกลิ่นอับ ทำความสะอาดง่าย</li><li>หน้าจอตัวเลขแสงสีน้ำเงิน แตะสัมผัสตั้งค่าอุณหภูมิเป็น C° หรือ F°<br>  และเปิด-ปิดแสงไฟในตู้ LED ที่หน้าจอนี้</li><li>รับรองมาตรฐานผลิตภัณฑ์จากสถาบัน CE, RoHS&nbsp;</li><li>รับประกัน 2&nbsp;ปี</li></ul><div style=\"color:#dc8a00\"><p><strong>หมายเหตุ</strong></p><ul><li>เสียงและอาการสั่นของตู้ไวน์ทั่วไป เกิดจากตัว Compressor</li><li>การสั่นมีผลเสีย ต่อการเร่งหมักบ่ม (Wine aging) ทำให้รสชาติไวน์ด้อยคุณภาพ<br></li><li>ขวดมาตรฐาน 750 มล. ( ∅7.6 x (สูง)31.5 ซม. )<br></li></ul></div></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;WCL-BCW-69D</div><div>วัสดุ&nbsp;:           แผ่นเหล็กเคลือบสีกันฝุ่น <br>ขนาด : กว้าง 43 x ลึก 52 สูง 74 ซม.<br>                  น้ำหนัก :&nbsp;19.5 กิโลกรัม<br>กำลังไฟ :      220 V/50 Hz 130&nbsp;W<br>สี :               ดำ<br><br></div><p><strong>ออฟชั่นพิเศษ&nbsp;:&nbsp;</strong></p><div><ul><li>ชั้นวางตระแกรงไม้</li><li>กรอบประตูสแตนเลส</li></ul></div><br><div><strong><p><span style=\"text-decoration:underline\">แนะนำอุณหภูมิ&nbsp;แช่ไวน์แต่ละชนิด</span></p></strong></div><div><ul><li>ไวน์แดง 14-18&nbsp;C° , 57-64&nbsp;F°</li><li>ไวน์ขาว&nbsp;9-14 C° , 48-57 F°<br></li><li>ไวน์ทั่วไป&nbsp;10-12 C° , 50-54 F°<br></li></ul></div><div><br></div>  ', 3, 6, 0, 0, 0, 0, 0, '', 'N', 'N'),
