(62, 'HRD-RCY-67410-W', 'ไดร์เป่าผมติดผนัง เสียบวางหัวลง', '<h2><strong>ไดร์เป่าผมติดผนัง (เสียบวางหัวลง)</strong></h2><div><ul><li>รูปทรง เสียบวางหัวลง ง่ายต่อการหยิบใช้ ตัวมอเตอร์และพัดลมคุณภาพสูง ทำงานเงียบ รับประกัน 1 ปี<br></li><li>เปิด-ปิด ปุ่มที่ตัวฐานเพื่อจ่ายกระแสไฟฟ้าเข้าตัวเครื่องเริ่มใช้งาน</li><li>กดปุ่มที่ด้ามเครื่อง เพื่อหมุนมอเตอร์เป่าลมทำงานเป็นเอกลักษณ์ความปลอดภัย สำหรับไดร์เป่าผมใช้ในห้องพักโรงแรม สถานประกอบการ และบ้านพัก<br></li><li>เครื่องจะตัดอัตโนมัติ ถ้ามีการใช้งานจนความร้อนขึ้นสูงเกินผิดวิสัย แล้วเครื่องจะกลับทำงานใหม่เมื่อความร้อนลดลงระดับปกติ ช่วยป้องกันไฟซ๊อตจากการใช้งาน<br></li><li>ปรับระดับลมร้อนได้ 2 ระดับ โดยเลื่อนตัวปรับขึ้น-ลง</li><li>มีปลั๊กเสียบที่ฐาน&nbsp;เพื่อเสียบเครื่องใช้กำลังไฟต่ำ</li><li><span style=\"color:#ff0000\">ได้รับ มอก.1985-2549 เลขที่ น21600-908/1985</span><br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;HRD-RCY-67410-W</div><div>แรงดันไฟฟ้า : AC220v/50Hz</div><div>กำลังไฟ :&nbsp;1200 W</div><div>ระบบป้องกัน : ตัดไฟอัตโนมัติเมื่อเกิดความร้อนสูงเกิน</div><div>สี :&nbsp;ขาว</div><div><br></div><br><div><strong><span style=\"text-decoration-line:underline\"><p style=\"display:inline !important\">ข้อกำหนดและเงื่อนไขการรับประกัน</p></span></strong></div><div><strong><span style=\"text-decoration:underline\"><p style=\"display:inline !important\"><br></p></span></strong></div><div><div>บริษัทฯ รับประกันความบกพร่อง ชำรุด เสียหาย อันเนื่องมาจากมาตรฐานการผลิต และการใช้ผลิตภัณฑ์อย่าง&nbsp; ถูกวิธี เป็นการใช้งานตามปกติ ในระยะเวลารับประกัน 1 ปี นับจากวันที่จัดส่งสินค้า (บริษัทยินดีเปลี่ยนสินค้าให้ใหม่&nbsp; ในกรณีสินค้าชำรุดเกิดจากการผลิต ภายใน 7 วัน นับจากวันที่เซ็นรับสินค้าและฝ่ายช่างบริษัทฯ ได้ตรวจสอบแล้ว)</div><div><strong><br></strong></div><div><strong>กรณีบริการซ่อมในระยะเวลาประกัน&nbsp;<br></strong></div><div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;บริษัทบริการรับซ่อมและเปลี่ยนอะไหล่ให้ฟรีในระยะเวลารับประกัน 1 ปี&nbsp; ตามที่ฝ่ายช่างบริษัทได้ตรวจสอบแล้วว่าอะไหล่ชิ้นที่เสียนั้นมิได้เกิดจาก กรณีไม่อยู่ในข่ายประกัน 5 ข้อดังกล่าวต่อไปนี้</div><div><strong><br></strong></div><div><strong>กรณีไม่อยู่ในข่ายประกัน</strong></div><div><ol><li>การชำรุดของผลิตภัณฑ์ ที่ใช้งานผิดวัตถุประสงค์ที่ออกแบบไว้ อุปกรณ์ แตก หัก ร้าว เนื่องจากการกระแทก&nbsp; หรือหล่น</li><li>ความเสียหายที่เกิดจากอุบัติเหตุ ภัยธรรมชาติ (ฟ้าฝ่า น้ำท่วม) ไฟตก จากแมลงและสัตว์ และการนำไปใช้งานในสภาพแวดล้อมที่ผิดปกติเกี่ยวกับอุณหภูมิความชื้น สารเคมี หรือเกิดจากความประมาทในการใช้งาน</li><li>ความเสียหายสืบเนื่องมาจาการนำอุปกรณ์อื่นมาต่อพ่วง การซ่อมแซมและดัดแปลงอย่างไม่ถูกต้องรวมทั้งการใช้อะไหล่อื่นมาทดแทน</li><li>แรงเคลื่อนไฟฟ้าไม่สม่ำเสมอจากหน้าสัมผัสหัวปลั๊กที่เป็นสะพานไฟ เช่น ผู้ใช้เสียบปลั๊กไฟไม่แน่น ทำให้ไฟเกิดการสปาร์ค</li><li>ขณะที่ใช้งานสินค้าเกิดการลัดวงจร</li></ol></div><div><strong>หมายเหตุ&nbsp;</strong></div><div><ul><li>ลูกค้าเป็นผู้ออกค่าใช้จ่ายในการส่งซ่อมและรับสินค้ากลับ</li><li>ในวันแจ้งซ่อม ควรระบุเลขที่ใบกำกับสินค้าและวันที่</li><li>สินค้าที่เสียหายหรือมีตำหนิเกิดจากบริษัทขนส่ง จะไม่อยู่ในข่ายการประกัน&nbsp;</li><li>สินค้าที่ส่งมาซ่อมจะถูกตรวจสอบโดยช่างผู้ชำนาญการของบริษัทฯ ว่าเกิดจากสาเหตุใด<br></li></ul></div>  <p style=\"text-decoration-line:underline;font-weight:bold;display:inline !important\"><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ไดร์เป่าผมติดผนัง/HRD-RCY-67410-W-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"ไดร์เป่าผมติดผนัง เสียบวางหัวลง\" width=\"700\" height=\"2730\"><br></p></div>  ', 3, 7, 26, 0, 0, 0, 0, '', 'N', 'N'),
