(67, 'HRD-Bag', 'ถุงผ้ากำมะหยี่ สำหรับใส่ไดร์เป่าผม', '<h2><strong>ถุงผ้ากำมะหยี่&nbsp;สำหรับใส่ไดร์เป่าผม</strong></h2><div><ul><li>สำหรับแม่บ้านจัดเก็บไดร์เป่าผมเข้าลิ้นชักให้เป็นระเบียบ หลังจากลูกค้าใช้งาน</li><li>ช่วยถนอมไดร์เป่าผมให้ดูใหม่ ไม่เป็นริ้วรอย</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;HRD-Bag</div><div>วัสดุ : กำมะหยี่</div><div>สี&nbsp;: ดำ</div><div>ขนาด : <br></div><div><ul><li>(ก)22 x (ส)19 ซม.</li><li>(ก)22 x (ส)29 ซม.<br></li></ul></div>  ', 3, 7, 27, 0, 0, 0, 0, '', 'N', 'N'),
(68, 'HRD-JF4018-BL', 'ไดร์เป่าผม แบบพับได้', '<h2><strong>ไดร์เป่าผม แบบพับได้</strong></h2><div><ul><li>รูปทรงเรียวทันสมัย หัวเป่าปรับหมุนตามการใช้งาน</li><li>ด้ามจับพับเก็บได้ พร้อมสายไฟขดยืดหด ใช้งานสะดวก</li><li>ตัวมอเตอร์และพัดลมคุณภาพสูง เสียงเงียบ</li><li>ใช้งานโดยการกดปุ่มที่ด้ามมือจับ เพื่อหมุนมอเตอร์เป่าผมทำงานเป็นเอกลักษณ์ความปลอดภัยโดยเฉพาะ&nbsp;เครื่องเป่าผมโรงแรม</li><li>เครื่องจะตัดอัตโนมัติ หากมีการใช้งานความร้อนสะสมสูงเกิน แล้วจะกลับมาใช้งานใหม่ เมื่อเครื่องคลายความร้อนลงระดับปกติ ช่วยป้องกันไฟซ๊อตให้กับผู้ใช้และผู้ประกอบการ</li><li>ปรับระดับลมเย็น 1&nbsp;ระดับ และปรับระดับลมร้อน 2 ระดับ ด้วยการเลื่อนปุ่มปรับ ขึ้น-ลง</li><li>เป็นที่นิยมใช้ในโรงแรมและสถานประกอบการที่คำนึงถึงความปลอดภัย</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;HRD-JF4018-BL</div><div>วัสดุ : พลาสติกคุณภาพอย่างดี<br>แรงดับไฟฟ้า : AC220V/50Hz</div><div>กำลังไฟ :&nbsp;1,875&nbsp;วัตต์<br>ระบบป้องกัน : ตัดไฟอัตโนมัติเมื่อเกิดความร้อนสูงเกิน</div><div>สี : ดำ</div><div><br></div><div><br></div>  ', 3, 7, 27, 0, 0, 0, 0, '', 'N', 'Y'),
(69, 'HRD-JF4016', 'ไดร์เป่าผม แบบพับได้', '<h2><strong>ไดร์เป่าผม แบบพับได้</strong></h2><div><ul><li>รูปทรงเรียวทันสมัย หัวเป่าปรับหมุนตามการใช้งาน</li><li>ด้ามจับพับเก็บได้ พร้อมสายไฟขดยืดหด ใช้งานสะดวก</li><li>ตัวมอเตอร์และพัดลมคุณภาพสูง เสียงเงียบ</li><li>ใช้งานโดยการกดปุ่มที่ด้ามมือจับ เพื่อหมุนมอเตอร์เป่าผมทำงานเป็นเอกลักษณ์ความปลอดภัยโดยเฉพาะ&nbsp;เครื่องเป่าผมโรงแรม</li><li>เครื่องจะตัดอัตโนมัติ หากมีการใช้งานความร้อนสะสมสูงเกิน แล้วจะกลับมาใช้งานใหม่ เมื่อเครื่องคลายความร้อนลงระดับปกติ ช่วยป้องกันไฟซ๊อตให้กับผู้ใช้และผู้ประกอบการ</li><li>ปรับระดับลมเย็น 1&nbsp;ระดับ และปรับระดับลมร้อน 2 ระดับ ด้วยการเลื่อนปุ่มปรับ ขึ้น-ลง</li><li>เป็นที่นิยมใช้ในโรงแรมและสถานประกอบการที่คำนึงถึงความปลอดภัย</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ : พลาสติกคุณภาพอย่างดี<br>แรงดับไฟฟ้า : AC220V/50Hz</div><div>กำลังไฟ :&nbsp;1,600 วัตต์<br>ระบบป้องกัน : ตัดไฟอัตโนมัติเมื่อเกิดความร้อนสูงเกิน</div><div>รหัสสินค้า :&nbsp;HRD-JF4016-IV</div><div>สี : งาช้าง</div><div><br></div><div>รหัสสินค้า :&nbsp;HRD-JF4016-BL</div><div>สี : ดำ</div><div><br></div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/HRD-JF4016-IV/HRD-HF4016-IV--1.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"ไดร์เป่าผมพกพา\" width=\"650\" height=\"874\"><br></div><div><br></div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/HRD-JF4016-IV/HRD-HF4016-IV--2.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"ไดร์เป่าผมพับได้\" width=\"650\" height=\"632\"><br></div>  ', 3, 7, 27, 0, 0, 0, 0, '', 'N', 'Y'),
