(72, 'HRD-JF404', 'ไดร์เป่าผม แบบพับได้', '<h2><strong>ไดร์เป่าผม แบบพับได้</strong></h2><div><ul><li>รูปทรงเรียวทันสมัย หัวเป่าปรับหมุนตามการใช้งาน ด้ามจับพับเก็บได้ ใช้คงทน ยาวนาน</li><li>ตัวมอเตอร์และพัดลมคุณภาพสูง เสียงเงียบ</li><li>ใช้งานโดยการกดปุ่มที่ด้ามมือจับ เพื่อหมุนมอเตอร์เป่าผมทำงานเป็นเอกลักษณ์ความปลอดภัยโดยเฉพาะ&nbsp;เครื่องเป่าผมโรงแรม</li><li>เครื่องจะตัดอัตโนมัติ หากมีการใช้งานความร้อนสะสมสูงเกิน แล้วจะกลับมาใช้งานใหม่ เมื่อเครื่องคลายความร้อนลงระดับปกติ ช่วยป้องกันไฟซ๊อตให้กับผู้ใช้และผู้ประกอบการ</li><li>ปรับระดับลมร้อนได้ 2 ระดับ โดยการเลื่อนปุ่มปรับ ขึ้น-ลง</li><li>เป็นที่นิยมใช้ในโรงแรมและสถานประกอบการที่คำนึงถึงความปลอดภัย</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ : พลาสติกคุณภาพอย่างดี<br>แรงดับไฟฟ้า : AC220V/50Hz</div><div>กำลังไฟ :&nbsp;1,000 วัตต์<br>ระบบป้องกัน : ตัดไฟอัตโนมัติเมื่อเกิดความร้อนสูงเกิน</div><div>รหัสสินค้า :&nbsp;&nbsp;HRD-JF404-BL</div><div>สี :&nbsp;ดำ + เส้นตัดเทาอ่อน</div><div><br></div><div><br></div><div><br></div>  ', 3, 7, 27, 0, 0, 0, 0, '', 'N', 'Y'),
(73, 'HDD-HP-2011W', 'เครื่องเป่ามือ', '<h2><strong>เครื่องเป่ามือทรงตั้ง</strong></h2><div><ul><li>เครื่องเป่ามือแบบทรงตั้ง เป่าลมเจ็ทความเร็วสูง 2 ด้าน ประหยัดพลังงาน ควบคุมด้วยชิพเทคโนโลยีชั้นสูง และประสิทธิภาพการทำงานที่ดีเยี่ยม</li><li>มอเตอร์ชนิดความเร็วสูง เสียงไม่ดัง ช่วยให้เป่ามือ ได้แห้งเร็วในเวลา 5-7 วินาที ประหยัดพลังงานประสิทธิภาพการทำงานสูง</li><li>ป้องกันความปลอดภัยหลายชั้น การป้องกันกระแสเกิน&nbsp;ระบบอุณหภูมิร้อนเกิน ป้องกันไฟฟ้าลัดวงจร</li><li>ใช้กันแพร่หลายโรงแรม, โรงพยาบาล, สำนักงาน และโรงงาน</li><li>ผลิตด้วย&nbsp;กรอบพลาสติกเกรดอุตสาหกรรม แข็งแรงทนทาน และสีเมททาลิคสวยเงางาม</li></ul></div><p><strong>สินค้ารับประกัน 1 ปี</strong></p><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;HDD-HP-2011W<br>วัสดุ พลาสติก :&nbsp;ABS<br>แรงดันไฟฟ้า : AC220V/50Hz.&nbsp;<br>ขนาดมอเตอร์ : 1900W<br>ความเร็วลม: 95m/s<br>ระบบป้องกัน : ไฟตัดอัตโนมัติความร้อนสูงเกิน/ไฟลัดวงจร<br>การติดตั้ง : สูงจากพื้นไม่น้อยกว่า 15 ซม.<br>ขนาด :&nbsp;68.5x 29 x 22 ซม.<br>สี : ขาว</div><div></div><div><br></div>  ', 3, 44, 30, 0, 0, 0, 0, '', 'N', 'N'),
(74, 'HDD-HP-9838', 'เครื่องเป่ามือ', '<h2><strong>เครื่องเป่ามือ</strong></h2><div><ul><li>ติดตั้งด้วยระบบแสงอินฟาเรด&nbsp;ควบคุมด้วยชิพเทคโนโลยีชั้นสูง ช่วยสมรรถนะเครื่องทำงานได้คงที่ แม่นยำ&nbsp;</li><li>ออกแบบรูปทรง ล้ำสมัยนิยม สันขอบสมส่วนลงตัว พื้นผิวเรียบนวล ด้วยการพิมพ์สกรีนฟิล์ม</li><li>มอเตอร์ชนิดความเร็วสูง เสียงไม่ดัง ช่วยให้เป่ามือ ได้แห้งเร็วในเวลา 10-15 วินาที ประหยัดพลังงาน ประสิทธิภาพการทำงานสูง</li><li>ป้องกันอุณหภูมิความร้อนสูงเกินจากการใช้งานเป็นเวลานาน</li><li>วัสดุผลิตด้วยกรอบพลาสติกเกรดอุตสาหกรรม แข็งแรงทนทาน และสีเมททาลิค สวยเงางาม&nbsp;</li><li>ใช้กันแพร่หลายในโรงแรม&nbsp;, โรงพยาบาล ,&nbsp;สำนักงานและโรงงาน</li></ul></div><p><strong>สินค้ารับประกัน 1 ปี</strong></p><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;:&nbsp;HDD-HP-9838<br>วัสดุ : พลาสติก ABS<br>แรงดันไฟฟ้า : AC.220V/50HZ.<br>ขนาดมอเตอร์ : 1500W<br>ระยะ Sensor 12(บวกลบไม่เกิน3) ซม.&nbsp;<br>ช่วงเวลาเป่า :&nbsp;1 รอบ 50 วินาที&nbsp;<br>อุณหภูมิลมเป่าร้อนที่ &nbsp;:&nbsp;35-50 องศา&nbsp;<br>ฟิวส์ : ตัดความร้อนเกิน ที่150 องศา<br>ระบบป้องกัน : ความร้อนสูงเกินจากการใช้งานเป็นเวลานาน<br>ขนาด :&nbsp;26.5 x 14.5 x 20 ซม.&nbsp;<br>สี : ขาว<div><br></div></div>  ', 3, 44, 31, 0, 0, 0, 0, '', 'N', 'N'),
