(78, 'HDD-HP-9888', 'เครื่องเป่ามือ', '<h2><strong>เครื่องเป่ามือ</strong></h2><div><ul><li>ติดตั้งด้วยระบบแสงอินฟาเรด&nbsp;ควบคุมด้วยชิพเทคโนโลยีชั้นสูง ช่วยสมรรถนะเครื่องทำงานได้คงที่ แม่นยำ&nbsp;</li><li>ออกแบบรูปทรง ล้ำสมัยนิยม สันขอบสมส่วนลงตัว พื้นผิวเรียบนวล ด้วยการพิมพ์สกรีนฟิล์ม</li><li>มอเตอร์ชนิดความเร็วสูง เสียงไม่ดัง ช่วยให้เป่ามือ ได้แห้งเร็วในเวลา 10-15 วินาที ประหยัดพลังงาน ประสิทธิภาพการทำงานสูง</li><li>ป้องกันอุณหภูมิความร้อนสูงเกินจากการใช้งานเป็นเวลานาน</li><li>วัสดุผลิตด้วยกรอบพลาสติกเกรดอุตสาหกรรม แข็งแรงทนทาน และสีเมททาลิค สวยเงางาม&nbsp;</li><li>ใช้กันแพร่หลายในโรงแรม&nbsp;, โรงพยาบาล ,&nbsp;สำนักงานและโรงงาน</li></ul></div><p><strong>สินค้ารับประกัน 1 ปี</strong></p><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;:&nbsp;HDD-HP-9888<br>วัสดุ : พลาสติก ABS<br>แรงดันไฟฟ้า : AC.220V/50HZ.<br>ขนาดมอเตอร์ : 1000W.<br>ระยะ Sensor 12(บวกลบไม่เกิน3) ซม.&nbsp;<br>ช่วงเวลาเป่า :&nbsp;1 รอบ 50 วินาที&nbsp;<br>อุณหภูมิลมเป่าร้อนที่ &nbsp;:&nbsp;35-50 องศา&nbsp;<br>ฟิวส์ : ตัดความร้อนเกิน ที่150 องศา<br>ระบบป้องกัน : ความร้อนสูงเกินจากการใช้งานเป็นเวลานาน<br>ขนาด :&nbsp;24.8 x 17.4&nbsp;x 25 ซม.&nbsp;<br>สี : เมททาลิกเงิน</div><div></div><div><br></div><div><br></div>  ', 3, 44, 31, 0, 0, 0, 0, '', 'N', 'N'),
