(81, 'SPM-JL-A2', 'เครื่องขัดรองเท้าอัตโนมัติ ตัวใหญ่', '<h2><strong>เครื่องขัดรองเท้าอัตโนมัติ ตัวใหญ่</strong></h2><div><ul><li>หัวขัดหมุนทำงานด้วย&nbsp;Sensor และ หัวขัดหมุนทำงาน&nbsp;ด้วยการกดปุ่มฝาด้านบน</li><li>หัวขัดรองเท้า 2 หัว หมุนทำงานด้วยระบบ Sensor</li><li>หัวขัดเส้นใยฟู (ขัดเงา) + ขนแปรง (ปัดฝุ่น) ทนทาน แรงขัดเงาสูง</li><li>เพียงแค่ยื่นเท้าผ่าน Sensor เข้าหา หัวขัดจะหมุนขัดรองเท้าอัตโนมัติทันที โดยดันแตะน้ำยาที่กระบอก แล้วพลิกเท้าให้ขัดโดยรอบ&nbsp;ทั้ง 2 ข้าง</li><li>เสียงเครื่องเบา ดังระดับเสียงคุยกันปกติ&nbsp;≤&nbsp;50 dB</li><li>ใช้ส่วนตัว บ้านพัก และสถานบริการทั่วไป</li><li>ไฟฟ้า AC 220V/50Hz 60W</li><li>ความเร็วมอเตอร์ 1100 รอบ/นาที</li><li>พร้อมน้ำยาขัดเงา 1 ขวด</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>ขนาด : &nbsp;53&nbsp;x&nbsp;26 x 96 ซม.  </div><div>กระบอกน้ำยา : 150 ML.</div><div>น้ำหนัก : 25 กก.  </div><div>วัสดุ สี : ตู้ไม้ ดำ+&nbsp;สแตนเลสทอง และ สแตนเลสเงิน</div><div><br></div><div><p><strong>หมายเหตุ</strong></p></div><div>พื้นพรม อาจมีการปรับเปลี่ยนสี ในการผลิตแต่ละครั้ง <br>กรุณาสอบถามก่อนสั่งซื้อ</div><div><br></div>  ', 3, 8, 0, 0, 0, 0, 0, '', 'N', 'N'),
(82, 'SPM-JL-K1', 'เครื่องขัดรองเท้าอัตโนมัติ ตัวใหญ่', '<h2><strong>เครื่องขัดรองเท้าอัตโนมัติ ตัวใหญ่</strong></h2><div><ul><li>หัวขัดหมุนทำงานด้วย&nbsp;Sensor และ หัวขัดหมุนทำงาน&nbsp;ด้วยการกดปุ่มฝาด้านบน</li><li>หัวขัดรองเท้า 2 หัว หมุนทำงานด้วยระบบ Sensor</li><li>หัวขัดเส้นใยฟู (ขัดเงา) + ขนแปรง (ปัดฝุ่น) ทนทาน แรงขัดเงาสูง</li><li>เพียงแค่ยื่นเท้าผ่าน Sensor เข้าหา หัวขัดจะหมุนขัดรองเท้าอัตโนมัติทันที โดยดันแตะน้ำยาที่กระบอก แล้วพลิกเท้าให้ขัดโดยรอบ&nbsp;ทั้ง 2 ข้าง</li><li>เสียงเครื่องเบา ดังระดับเสียงคุยกันปกติ&nbsp;≤&nbsp;50 dB</li><li>ใช้ส่วนตัว บ้านพัก และสถานบริการทั่วไป</li><li>ไฟฟ้า AC 220V/50Hz 60W</li><li>ความเร็วมอเตอร์ 1100 รอบ/นาที</li><li>พร้อมน้ำยาขัดเงา 1 ขวด</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>ขนาด : &nbsp;53&nbsp;x&nbsp;26 x 96 ซม.  </div><div>กระบอกน้ำยา : 150 ML.</div><div>น้ำหนัก : 25 กก.  </div><div><br></div><div><p><strong>หมายเหตุ</strong></p></div><div>พื้นพรม อาจมีการปรับเปลี่ยนสี ในการผลิตแต่ละครั้ง <br>กรุณาสอบถามก่อนสั่งซื้อ</div><div><br></div>  ', 3, 8, 0, 0, 0, 0, 0, '', 'N', 'N'),
