(90, 'MNB-BCH-36-(BL)(W)', 'ตู้เย็น-มินิบาร์ 36 ลิตร', '<h2><strong>มินิบาร์ ตู้เย็นโรงแรม</strong></h2><div><ul><li>ระบบทำความเย็นเทอร์โมอิเล็กทริก ฮีทไปป์ เทคโนโลยี ซึ่งใช้กันมายาวนานทางด้านวิศวกรรมการบินและอวกาศ <span style=\"text-decoration:underline\">ช่วยประหยัดค่าไฟ และไม่ใช้ตัวคอมเพรสเซอร์ เหมือนตู้เย็นทั่วไป</span></li><li>ตัวตู้ไม่เกิดการสั่นและเสียงรบกวน (0 เดซิเบล)</li><li>ประสิทธิภาพความเย็น 3~8˚C (ณ อุณหภูมิภายในห้องแอร์ 25˚C)</li><li>ปลอดสาร CFC และผลิตภัณฑ์เป็นมิตรกับสิ่งแวดล้อม</li><li>ภายในตู้ออกแบบตั้งวางตะแกรงได้หลายระดับชั้น เพื่อจัดวางขวด-กระป๋องเครื่องดื่ม ทั้งแนวตั้งและแนวนอนได้อย่างลงตัว รวมทั้งเก็บแช่ เครื่องสำอาง และเวชภัณฑ์น้ำ&nbsp;ที่ต้องมีอุณหภูมิความเย็นพอเหมาะ เพื่อเก็บคงคุณภาพไว้ได้อย่างดี</li><li>บานประตูฝาทึบ ขาตั้งตู้เย็นปรับได้  หลอดไฟในตู้นวลแสง LED<br></li><li>บานพับประตูและโครงตู้ผลิตจากเหล็กกล้า และพ่นด้วยสีกันฝุ่น</li><li>รับรองจากสถาบันมาตราฐานโลก ETL , CE , ROHS</li><li>รับประกัน 2&nbsp;ปี</li><li>หลังหมดอายุประกัน มีอะไหล่และบริการซ่อม<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุภายนอกตู้ : เหล็กกล้าพ่นด้วยสีกันฝุ่น</div><div>วัสดุภายในตู้ : พลาสติกคุณภาพอย่างดี</div><div>ขนาด : 36&nbsp;ลิตร (1.27 คิว)</div><div>ขนาดภายนอก  : (กว้าง)38 x (ลึก)44.5&nbsp;x (สูง)47.5 ซม.              <br>ขนาดภายใน  : (กว้าง)29.3 x (ลึก)27.5 x (สูง)36.2  ซม.</div><div>กำลังไฟ : 220V/50Hz &nbsp; 65W<br>สายไฟยาว : 160 ซม.</div><div>น้ำหนัก : 11.2&nbsp;กิโลกรัม</div><div>เสียง : 0&nbsp;dBA<br></div><div><br></div><div>รหัสสินค้า :&nbsp;MNB-BCH-36-BL</div><div>สี :&nbsp;ดำ</div><div><br></div><div><div>รหัสสินค้า :&nbsp;MNB-BCH-36-W</div><div>สี :&nbsp;ขาว</div>  </div><div><br></div><p><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ตู้เย็นโรงแรม/hotelmate-heatpipe-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"เปรียบเทียบแผงวงจรหลังตู้\" width=\"600\" height=\"660\"></p><br><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/เครื่องใช้ไฟฟ้า/ตู้เย็นโรงแรม/heat%20pipe-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"แผงวงจรและการทำงาน\" width=\"600\" height=\"360\"><br></div>  ', 3, 5, 29, 0, 0, 0, 0, '', 'N', 'N'),
