(104, 'HSB-FD-1935L-(BL)(W)', 'ตู้เซฟโรงแรม แบบลูกบิด', '<h2><strong>ตู้เซฟโรงแรม แบบลูกบิด</strong></h2><div><ul><li>ตู้เซฟอิเล็คโทรนิค เปิด-ปิด&nbsp;กึ่งอัตโนมัติปุ่มกอดหน้าจอดิจิตอลเรืองแสง LED</li><li>ใช้งานง่าย กดตั้งรหัสส่วนตัว 3-6 หลัก แล้วปิดตู้ล็อคอัตโนมัติ&nbsp;</li><li>ขับเคลื่อนด้วยมอเตอร์ แกนเหล็กหนา 20 มิล<br></li><li>ป้อนรหัสผิดต่อกัน&nbsp;3 ครั้ง หน้าจอจะขึ้นคำว่า \"HOLD\"&nbsp;ระบบเครื่องจะหยุดทำงาน 5 นาที</li><li>กรณีลูกค้าลืมรหัสกดส่วนตัว เปิดตู้ได้ด้วยรหัสเครื่องหรือใช้กุญแจไข<br></li><li>แจ้งเตือนเมื่อถ่านในตู้เชฟไฟอ่อนหรือหมดให้ใช้กล่องไฟแบตเตอรี่ฉุกเฉินเสียบแทน<br></li><li>ติดตั้งโดยขันน๊อตยึดติดกับพื้นด้านล่างหรือผนังตู้</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ : เหล็กกล้าเคลือบด้วยสีกันฝุ่น<br>แบตเตอรี่ : 2A 1.5V จำนวน 4 ก้อน<br>ขนาด : (กว้าง)35.5&nbsp;x (ลึก)26 x (สูง)19 ซม.<br>น้ำหนัก : 8&nbsp;กิโลกรัม<br><br></div><div>รหัสสินค้า :&nbsp;HSB-FD-1935L-BL</div><div>สี : ดำ</div><div><br></div><div><div>รหัสสินค้า&nbsp;HSB-FD-1935L-W</div><div>สี :&nbsp;ขาว</div>  <br></div>  ', 1, 4, 6, 0, 0, 0, 0, '', 'N', 'N'),
(105, 'HSB-FD-2042A-(BL)', 'ตู้เซฟโรงแรม หน้าปัดเหลี่ยมมน', '<h2><strong>ตู้เซฟโรงแรม หน้าปัดเหลี่ยมมน</strong></h2><div><ul><li>ตุู้เซฟอิเล็คโทรนิค เปิด-ปิด อัตโนมัติ ปุ่มกดหน้าจอดิจิตอลเรืองแสง LED</li><li>ใช้งานง่าย กดตั้งรหัสส่วนตัว 4-8 หลัก แล้วปิดตู้ล็อคอัตโนมัติ&nbsp;</li><li>ขับเคลื่อนด้วยมอเตอร์&nbsp;แกนเหล็กหนา 20 มิล</li><li>กรณีกดรหัสส่วนตัวผิดต่อเนื่อง 3 ครั้ง ระบบเครื่องจะหยุดทำงาน 5 นาที พร้อมเสียงเตือน 1 นาที</li><li>กรณีลูกค้าลืมรหัสกดส่วนตัว เปิดตู้ได้ด้วยรหัสเครื่องหรือใช้กุญแจไข</li><li>แจ้งเตือนเมื่อถ่านในตู้เชฟไฟอ่อนหรือหมดให้ใช้กล่องไฟแบตเตอรี่ฉุกเฉินเสียบแทน</li><li>ติดตั้งโดยขันน๊อตยึดติดกับพื้นด้านล่างหรือผนังตู้</li><li>รับประกัน 1 ปี</li></ul><p><strong>คุณสมบัติ</strong></p></div><div>รหัสสินค้า : HSB-FD-2042A-(BL)<br></div><div>วัสดุ : เหล็กกล้าเคลือบด้วยสีกันฝุ่น</div><div>แบตเตอรี่ : 2A 1.5V จำนวน 4 ก้อน</div><div>ขนาด : (กว้าง)42&nbsp;x (ลึก)37 x (สูง)20 ซม.</div><div>น้ำหนัก :&nbsp;11 กิโลกรัม</div><div>สี : ดำ</div><div><br></div><div><br></div>  ', 1, 4, 6, 0, 0, 0, 0, '', 'N', 'N'),
(106, 'HSB-FD-2042B-(BL)(W)', 'ตู้เซฟโรงแรม หน้าปัดเงินทรงรี', '<h2><strong>ตู้เซฟโรงแรม หน้าปัดเงินทรงรี</strong></h2><div><ul><li>ตุู้เซฟอิเล็คโทรนิค เปิด-ปิด อัตโนมัติ ปุ่มกดหน้าจอดิจิตอลเรืองแสง LED</li><li>ใช้งานง่าย กดตั้งรหัสส่วนตัว 4-8 หลัก แล้วปิดตู้ล็อคอัตโนมัติ&nbsp;</li><li>ขับเคลื่อนด้วยมอเตอร์&nbsp;แกนเหล็กหนา 20 มิล</li><li>ป้อนรหัสผิดติดต่อกัน 3 ครั้ง หน้าจอจะขึ้นคำว่า \"HOLD\" ระบบเครื่องจะหยุดทำงาน 5 นาที</li><li>กรณีลูกค้าลืมรหัสกดส่วนตัว สามารถเปิดตู้ได้ด้วยรหัสเครื่อง หรือใช้กุญแจไข</li><li>แจ้งเตือนเมื่อถ่านในตู้เชฟไฟอ่อนหรือหมด&nbsp;ให้ใช้กล่องไฟแบตเตอรี่ฉุกเฉินเสียบแทน</li><li>ติดตั้งโดยขันน๊อตยึดติดกับพื้นด้านล่างหรือผนังตู้</li><li>รับประกัน 1 ปี</li></ul><p><strong>คุณสมบัติ</strong></p></div><div>วัสดุ : เหล็กกล้าเคลือบด้วยสีกันฝุ่น</div><div>แบตเตอรี่ : 2A 1.5V จำนวน 4 ก้อน</div><div>ขนาด : (กว้าง)42&nbsp;x (ลึก)37 x (สูง)20 ซม.</div><div>น้ำหนัก :&nbsp;11 กิโลกรัม</div><div><br></div><div>รหัสสินค้า : HSB-FD-2042B-(BL)<br>สี : ดำ<br><br>รหัสสินค้า : HSB-FD-2042B-(W)<br>สีขาว<br></div><div><br></div><div><br></div>  ', 1, 4, 6, 0, 0, 0, 0, '', 'N', 'N'),
(107, 'HSB-FD-1628D-(BL)(W)', 'ตู้เซฟโรงแรม หน้าปัดเหลี่ยม รุ่นเล็ก', '<h2><strong>ตู้เซฟโรงแรม หน้าปัดเหลี่ยม รุ่นเล็ก</strong></h2><div><ul><li>ตุู้เซฟอิเล็คโทรนิค เปิด-ปิด อัตโนมัติ ปุ่มกดหน้าจอดิจิตอลเรืองแสง LCD</li><li>ใช้งานง่าย กดตั้งรหัสส่วนตัว 3-6 หลัก ตู้ล็อคอัตโนมัติ&nbsp;</li><li>ขับเคลื่อนด้วยมอเตอร์&nbsp;แกนเหล็กหนา 20 มิล</li><li>ป้อนรหัสส่วนตัวผิดติดต่อกัน 3 ครั้ง เครื่องจะหยุดทำงาน 5 นาที</li><li>กรณีลูกค้าลืมรหัสกดส่วนตัว เปิดตู้ได้ด้วย&nbsp;รหัสเครื่องหรือใช้กุญแจไข</li><li>ติดตั้งโดยขันน๊อตยึดติดกับพื้นด้านล่างหรือผนังตู้</li><li>รับประกัน 1 ปี</li></ul><p><strong>คุณสมบัติ</strong></p></div><div>วัสดุ : เหล็กกล้าเคลือบด้วยสีกันฝุ่น</div><div>แบตเตอรี่ : 2A 1.5V จำนวน 4 ก้อน</div><div>ขนาด : (กว้าง)28&nbsp;x (ลึก)23.5 x (สูง)16.5 ซม.</div><div>น้ำหนัก : 5.2 กิโลกรัม</div><div><br></div><div>รหัสสินค้า : HSB-FD-1628D-(BL)<br>สี : ดำ<br><br>รหัสสินค้า : HSB-FD-1628D-(W)<br>สีขาว<br></div><div><br></div><div><br></div>  ', 1, 4, 6, 0, 0, 0, 0, '', 'N', 'N'),
(108, 'HSB-FD-2042B-1', 'ตู้เซฟโรงแรม รุ่นพิเศษเปิดด้วย การ์ด', '<h2><strong>ตู้เซฟโรงแรม รุ่นพิเศษเปิดด้วย การ์ด<br></strong></h2><div><ul><li>ตู้เซฟอีเลคโทรนิค เปิด-ปิดอัตโนมัติ หน้าจอดิจิตอลเรืองแสง LCD</li><li>ใช้งานง่าย เปิด-ปิดตู้เซฟได้มากถึง 4 วิธี <br>                              -&nbsp;กดรหัสส่วนตัว 4-8 หลัก<br>                              -&nbsp;กดรหัสเครื่อง 6 หลัก (โรงแรมตั้งรหัสไว้)<br>                              - สแกนการ์ดแบบสัมผัส&nbsp;ที่หน้าปัดตู้เซฟ&nbsp;<br>-&nbsp;กุญแจไขเปิดตู้เซฟ</li><li>กรณีกดรหัสผิดติดต่อกัน 3 ครั้ง เครื่องจะล๊อคหยุดทำงาน 15 นาที</li><li>กรณีการ์ดหาย หรือลืมรหัสกดส่วนตัว เปิดตู้เซฟด้วยรหัสเครื่อง<br>  หรือ กุญแจได้</li><li>มีฟังค์ชั่นการบันทึกข้อมูลใช้งานได้ 199 ครั้ง</li><li>ขับเคลื่อนปิดตู้เซฟด้วยมอเตอร์ แกนเหล็กคู่หนา 20 มิล</li><li>แจ้งเตือนเมื่อถ่านในตู้เซฟไฟอ่อนหรือหมด ให้ใช้กล่องไฟ<br>   ฉุกเฉินเสียบแทน</li><li>ติดตั้งโดยขันน๊อตยึดติดตู้เซฟ กับพื้นด้านล่างหรือผนังตู้</li><li>รับประกัน 1 ปี</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : HSB-FD-2042B-1<br></div><div>วัสดุ : เหล็กกล้าเคลือบด้วยสีกันฝุ่น<br>แบตเตอรี่ : 2A 1.5V จำนวน 4 ก้อน<br>ขนาด : (กว้าง)42&nbsp;x (ลึก)37&nbsp;x (สูง)20&nbsp;ซม.<br>น้ำหนัก : 10.7&nbsp;กิโลกรัม<br>สี : ดำ</div><div><br></div><div>  <br></div>  ', 1, 4, 6, 0, 0, 0, 0, '', 'N', 'N'),
(109, 'IRT-JF484', 'ตะขอแขวนโต๊ะรีดผ้า', '<h2><strong>ตะขอแขวนโต๊ะรีดผ้า</strong></h2><div><ul><li>เก็บแขวนโต๊ะรีดผ้าได้ง่ายสะดวก</li><li>ลวดเหล็กหนาหุ้มพลาสติก คงรูปไม่งอ</li><li>ติดตั้งกับผนัง แข็งแรง ทนทาน</li><li>วัสดุเหล็กหนาเคลือบพลาสติก ยึดติดผนัง คงรูปไม่ยืดงอ</li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p></div><div><p>รหัสสินค้า :&nbsp;&nbsp;IRT-JF484<br>วัสดุ : ลวดเหล็กหนา<br>ขนาด : 13&nbsp;x 12.5 x 7.5 cm<br>สี : ดำ</p></div><div>  <br></div><br><div><br></div>  ', 1, 1, 3, 0, 0, 0, 0, '', 'N', 'N'),
(110, 'MNM-MC-1158-9Inch', 'กระจกส่องหน้า มีไฟส่อง', '<h2><strong>กระจกส่องหน้าตั้งโต๊ะ&nbsp;กระจกขยายตั้งโต๊ะ กระจกตั้งโต๊ะ</strong></h2><div><ul><li>ออกแบบรูปทรง มีไฟส่อง&nbsp;หรูหรา เด่นสะดุดตา</li><li>ตั้งวาง ปรับระดับได้ชัดเจนทุกมุมมอง 360 องศา</li><li>กระจกส่องหน้าธรรมดา 1 ด้าน ขยาย 5&nbsp;เท่า 1 ด้าน</li><li>ช่วยเพิ่มอารมณ์สุนทรีย์ในการตกแต่งหน้า</li><li>เหมาะสำหรับ สุภาพสตรีส่องกระจกแต่งหน้า ได้เห็น สี แสง เงา รายละเอียดบนใบหน้าได้คมชัดยิ่งขึ้น<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div><strong></strong>รหัสสินค้า :&nbsp;MNM-MC-1158-9Inch<br>วัสดุ :&nbsp;ทองแดงชุบโครเมี่ยม<br>ขนาด :&nbsp;∅ 9&nbsp;นิ้ว กรอบกระจกกว้าง 5.5 ซม.<br>กระจกขยาย :&nbsp;5 เท่า</div><div>สี : เงิน</div><div><br></div><div><div>รหัสสินค้า :&nbsp;MNM-MC-1158-9Inch-G<br>วัสดุ :&nbsp;ทองแดงชุบโครเมี่ยม<br>ขนาด :&nbsp;∅ 9&nbsp;นิ้ว กรอบกระจกกว้าง 5.5 ซม.<br>กระจกขยาย :&nbsp;5 เท่า</div><div>สี : ทอง</div><div><br></div>  <br></div>  ', 1, 3, 4, 0, 0, 0, 0, '', 'N', 'N'),
(111, 'MNM-MC-111-3(6)Inch', 'กระจกส่องหน้า กระจกขยาย', '<h2><strong>กระจกส่องหน้าตั้งโต๊ะ&nbsp;กระจกขยายตั้งโต๊ะ กระจกตั้งโต๊ะ</strong></h2><div><ul><li>ออกแบบรูปทรง ขาตั้งปรับเอนได้&nbsp;หรูหรา เด่นสะดุดตา</li><li>ตั้งวาง ปรับระดับได้ทุกมุมมอง 360 องศา</li><li>กระจกส่องหน้าธรรมดา 1 ด้าน ขยาย 3 เท่า 1 ด้าน</li><li>ช่วยเพิ่มอารมณ์สุนทรีย์ในการตกแต่งหน้า</li><li>เหมาะสำหรับ สุภาพสตรีส่องกระจกแต่งหน้า ได้เห็น สี แสง เงา รายละเอียดบนใบหน้าได้คมชัดยิ่งขึ้น<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div><strong></strong>รหัสสินค้า :&nbsp;MNM-MC-111-3(6)Inch<br>วัสดุ :&nbsp;ทองแดงชุบโครเมี่ยม<br>ขนาด :&nbsp;∅ 3&nbsp;นิ้ว และ ∅6 นิ้ว<strong></strong></div>  ', 1, 3, 4, 0, 0, 0, 0, '', 'N', 'N'),
