(122, 'MNM-069-1912D-9Inch', 'กระจกติดผนัง ไม่มีไฟ แบบฐานกลม', '<h2><strong>กระจกติดผนัง ไม่มีไฟ แบบฐานกลม<br></strong></h2><div><ul><li>รูปทรงแบบ ขาพับ 2 ตอน และฐานเป็นเหลี่ยมติดผนัง</li><li>รุ่นบางพิเศษ 1.5 cm.<br></li><li>กระจกขยาย 3 เท่า ด้านเดียว</li><li>ใช้งานสะดวกคล่องตัว พับเก็บแนบติดกับผนัง</li><li>เหมาะสำหรับ สุภาพสตรีส่องกระจกแต่งหน้า ได้เห็น สี แสง เงา รายละเอียดบนใบหน้าได้คมชัดยิ่งขึ้น<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div><strong></strong>รหัสสินค้า :&nbsp;MNM-069-1912D-9inch<br>วัสดุ :&nbsp;Stinless steel 304 และ ทองแดงชุบ<br>ขนาด :&nbsp;∅ 9&nbsp;นิ้ว</div>  ', 1, 3, 5, 0, 0, 0, 0, '', 'N', 'N'),
(123, 'TSB-YC-25-13', 'กล่องทิชชู่ไม้', '<h2><strong>กล่องทิชชู่ไม้ น้ำตาลเข้ม</strong></h2><ul><li>วัสดุ ไม้สีน้ำตาลเข้ม</li><li>กล่อง 1 ชั้น เปิดฝาสไลด์ด้านข้าง</li><li>ใส่เนื้อกระดาษทิชชู่ แผ่นยาวไว้ข้างใน โดยไม่ต้องใช้ชนิดบรรจุกล่อง ช่วยให้ท่านประหยัดค่าใช้จ่ายได้มากขึ้น</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : TSB-YC-25-13</div><div>สีหนัง : น้ำตาลเข้ม</div><div>ขนาด : 12 x 24 x 5.8 ซม.</div>  ', 1, 32, 8, 0, 0, 0, 0, '', 'N', 'N'),
