(137, 'TSB-PU-1', 'กล่องทิชชู่หนัง ลายตาราง', '<div><div><h2><strong>กล่องทิชชู่หนัง ลายตาราง</strong></h2><ul><li>หนัง PU ลายตาราง</li><li>กล่อง 1 ชั้น เปิดฝาด้านล่าง พร้อมแม่เหล็กดูด</li><li>ด้านในเป็นผ้า Non Wowen ใส่เนื้อกระดาษทิชชู่ แผ่นยาว ไว้ข้างใน โดยไม่ต้องใช้ชนิดบรรจุกล่อง ช่วยให้ท่านประหยัดค่าใช้จ่ายได้มากขึ้น</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : TSB-PU-1</div><div>สีหนัง : น้ำตาล + น้ำตาลแดง ลายตาราง</div><div>ขนาด : 12 x 24 x 7.5 ซม.</div>  <br></div></div>  ', 1, 32, 8, 0, 0, 0, 0, '', 'N', 'N'),
(138, 'TSB-PU-3', 'กล่องทิชชู่หนัง ลายดอกไม้พิมพ์ลึก', '<h2><strong>กล่องทิชชู่หนัง ลายดอกไม้พิมพ์ลึก</strong></h2><ul><li>หนัง PU ครีมลายดอกไม้ พิมพ์ลึก</li><li>กล่อง 1 ชั้น เปิดฝาด้านล่าง พร้อมแม่เหล็กดูด</li><li>ด้านในเป็นผ้า Non Wowen ใส่เนื้อกระดาษทิชชู่ แผ่นยาว ไว้ข้างใน โดยไม่ต้องใช้ชนิดบรรจุกล่อง ช่วยให้ท่านประหยัดค่าใช้จ่ายได้มากขึ้น</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :TSB-PU-3</div><div>สีหนัง : สีครีม ลายดอกไม้พิมพ์ลึก</div><div>ขนาด : 12.5 x 24 x 6.5 ซม.</div>  ', 1, 32, 8, 0, 0, 0, 0, '', 'N', 'N'),
(139, 'TSB-PU-4', 'กล่องทิชชู่หนัง ลายเส้นนูนเฉียง', '<h2><strong>กล่องทิชชู่หนัง ลายเส้นนูนเฉียง</strong></h2><ul><li>หนัง PU ลายเส้นนูนเฉียง</li><li>กล่อง 1 ชั้น เปิดฝาด้านล่าง พร้อมแม่เหล็กดูด</li><li>ด้านในเป็นผ้า Non Wowen ใส่เนื้อกระดาษทิชชู่ แผ่นยาว ไว้ข้างใน โดยไม่ต้องใช้ชนิดบรรจุกล่อง ช่วยให้ท่านประหยัดค่าใช้จ่ายได้มากขึ้น</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : TSB-PU-4</div><div>สีหนัง : น้ำตาล + น้ำตาลแดง ลายตาราง</div><div>ขนาด : 12.5 x 24.5 x 7 ซม.</div>  ', 1, 32, 8, 0, 0, 0, 0, '', 'N', 'N'),
(140, 'TSB-234-1', 'กล่องทิชชู่อะคริลิคใส', '<h2><strong>กล่องทิชชู่อะคริลิคใส</strong></h2><ul><li>วัสดุอะคริลิค  </li><li>กล่อง 1 ชั้น เปิดฝาด้านบน</li><li>แต่งมุมด้วยอคิลิคแท่งกลม</li><li>ใส่เนื้อกระดาษทิชชู่ แผ่นสั้นไว้ข้างใน โดยไม่ต้องใช้ชนิดบรรจุกล่อง ช่วยให้ท่านประหยัดค่าใช้จ่ายได้มากขึ้น</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : TSB-234-1</div><div>สี :&nbsp;อะคริลิค</div><div>ขนาด : 17.5 x 12.5 x 9.5 ซม.</div><div><br></div><div><strong>ขนาดและรูปแบบสามารถปรับเปลี่ยนได้ตามความต้องการ&nbsp;</strong></div>  ', 1, 32, 9, 0, 0, 0, 0, '', 'N', 'N'),
(141, 'TSB-13x13x13', 'กล่องทิชชู่อะคริลิค ทรงสี่เหลี่ยม', '<h2><strong>กล่องทิชชู่อะคริลิคทรงสี่เหลี่ยม (POP UP)</strong></h2><ul><li>วัสดุ&nbsp;อะคริลิค</li><li>กล่อง 1 ชั้น เปิดฝาด้านบน</li><li>ใส่เนื้อกระดาษทิชชู่ แผ่นสั้นไว้ข้างใน โดยไม่ต้องใช้ชนิดบรรจุกล่อง ช่วยให้ท่านประหยัดค่าใช้จ่ายได้มากขึ้น</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : TSB-13x13x13</div><div>สี : ดำ, ขาว, ใส, ม่วง, เหลือง, แดง, น้ำเงิน</div><div>ขนาด : 13 x 13 x 13 ซม.<br><br></div><div><strong>ขนาดและรูปแบบสามารถปรับเปลี่ยนได้ตามความต้องการ <br><br></strong></div>  ', 1, 32, 9, 0, 0, 0, 0, '', 'N', 'N'),
(142, 'TSB-9043', 'กล่องทิชชู่ทรงเหลี่ยม', '<h2><strong>กล่องทิชชู่ทรงเหลี่ยม (POP-UP)</strong></h2><ul><li>วัสดุ โพลีคาร์บอเนต  PC</li><li>กล่อง 1 ชั้น เลือนฝาเปิดด้านล่าง</li><li>ใส่เนื้อกระดาษทิชชู่ แผ่นสั้น</li></ul><div><p><strong>คุณสมบัติเฉพาะ</strong></p>รหัสสินค้า : TSB-9043<br>สี:  ดำ /  ใส<br>ขนาด:    13 x 13 x 14 cm.</div>  ', 1, 32, 9, 0, 0, 0, 0, '', 'N', 'N'),
(143, 'TSB-005-P65', 'กล่องทิชชู่ทรงสี่เหลี่ยม POP-UP', '<h2>กล่องทิชชู่ทรงสี่เหลี่ยม POP-UP<br></h2><div><ul><li>กล่อง 1 ชั้น เลื่อนฝาเปิดด้านล่าง<br></li><li>กล่องทิชชู่ทรงสี่เหลี่ยม POP-UP<br></li></ul></div><div><strong>คุณสมบัติเฉพาะ</strong></div><div><strong><br></strong></div><div>รหัสสินค้า :&nbsp;TSB-005-P65</div><div>วัสดุ อะคริลิค สีดำ ความหนา 5 mm.</div><div>ขนาด :&nbsp;(L)13&nbsp;x (W)13 x (H)6.5 ซม.<br></div><div><br></div>  ', 1, 32, 9, 0, 0, 0, 0, '', 'N', 'N'),
(144, 'CTR-J-50', 'ที่แขวนเสื้อสูท ขาตั้งเดี่ยว', '<h2><strong>ที่แขวนเสื้อสูท ขาตั้งเดี่ยว</strong></h2><div><ul><li>รูปทรงไม้แขวนเสื้อสูท พร้อมราวพาดกางเกง</li><li>ฐานไม้ทรงกลม ตั้งวางมั่นคง ดูสง่างาม</li><li>มีถาดหลุมวางเข็มกลัด และกระดุมเสื้อ</li><li>งานช่างฝีมือประณีต ผลิตจากท่อนไม้เนื้อแข็งขัดมัน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;CTR-J-50<br>วัสดุ ไม้ + สแตนเลส<br>ขนาด&nbsp;∅32 x 116 ซม.<br>สี โอ๊ต + ทอง</div>  ', 1, 36, 17, 0, 0, 0, 0, '', 'N', 'N'),
(145, 'CTR-J-57', 'ที่แขวนเสื้อสูท ขาตั้งเดี่ยว ทรงสูง', '<h2><strong>ที่แขวนเสื้อสูท ขาตั้งเดี่ยว ทรงสูง</strong></h2><div><ul><li>กลึงทรงพุ่มหงาย เรียวสวยงาม</li><li>ใช้แขวน สูท เนคไท&nbsp;หมวกและอื่นๆ</li><li>ฐานไม้ทรงกลม ตั้งวางมั่นคง ดูสง่างาม</li><li>งานช่างฝีมือปราณีต ผลิตจากท่อนไม้เนื้อแข็ง</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;CTR-J-57<br>วัสดุ ไม้<br>ขนาด&nbsp;∅43 x 200 ซม.&nbsp;<br>สี โอ๊ค</div>  ', 1, 36, 17, 0, 0, 0, 0, '', 'N', 'N'),
(146, 'CTR-J-33', 'ที่แขวนเสื้อสูท ขาตั้งเดี่ยว ทรงสูง', '<h2><strong>ที่แขวนเสื้อสูท ขาตั้งเดี่ยว ทรงสูง</strong></h2><div><ul><li>ราวก้านสแตนเลสปุ่มกลม ทรงพุ่มหงาย ตั้งขึ้นเรียวงาม&nbsp;</li><li>แขวนชุดสูท,เนคไท, หมวกและอื่นๆ<br></li><li>วัสดุไม้เนื้อแข็งขัดเงา+สเตนเลสชุบไทเทเนียม</li><li>ฐานไม้ทรงกลม</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;CTR-J-33<br>วัสดุด ไม้ + สแตนเลส<br>ขนาด&nbsp;∅40 x 178 ซม.<br>สี โอ๊ค +&nbsp;ทอง</div>  ', 1, 36, 17, 0, 0, 0, 0, '', 'N', 'N'),
(147, 'CTR-J-40', 'ที่แขวนเสื้อสูท ขาตั้งเดี่ยว ทรงสูง', '<h2><strong>ที่แขวนเสื้อสูท ขาตั้งเดี่ยว ทรงสูง</strong></h2><div><ul><li>ราวก้านสแตนเลสปุ่มกลม ดัดโค้งตั้งขึ้นเรียวงาม&nbsp;</li><li>แขวนชุดสูท,เนคไท, หมวกและอื่นๆ</li><li>ฐานหินอ่อนกลม ตั้งวางในห้องดูภูมิฐาน เคลื่อนย้ายสะดวก</li><li>ผลิตด้วยวัสดุ เนื้อไม้แข็งขัดเงา และสแตนเลสชุบไทเทเนียมทอง</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;CTR-J-40<br>วัสดุ ไม้ + สแตนเลส<br>ขนาด&nbsp;&nbsp;∅ 40 x 184 ซม.&nbsp;<br>สี โอ๊ค + ทอง</div>  ', 1, 36, 17, 0, 0, 0, 0, '', 'N', 'N');
