(148, 'CTR-J-16C', 'ที่แขวนเสื้อสูท ขาตั้งเดี่ยว', '<h2><strong>ที่แขวนเสื้อสูท ขาตั้งเดี่ยว&nbsp;<br></strong></h2><div><ul><li>แขวนเสื้อสูทได้กระชับ</li><li>เข้ารูปทรง พร้อมราวแขวนกางเกง</li><li>ฐานสแตนเลสทรงสีเหลี่ยม</li><li>ตั้งวางในห้องดูภูมิฐาน เคลื่อนย้ายสะดวก</li><li>มีถาดวางเข็มกลัดและกระดุม</li><li>ผลิตด้วยวัสดุแข็งแรง ทนทาน อายุการใช้งานได้ยาวนาน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า CTR-J-16C<br>วัสดุ สแตนเลส + ไม้<br>ขนาด&nbsp;(L)47 x (W)15&nbsp;x (H)124 ซม.<br>สี ธรรมชาติ + เงิน</div><div><br></div><div></div>  ', 1, 36, 17, 0, 0, 0, 0, '', 'N', 'N'),
(149, 'CTR-J-16B', 'ที่แขวนเสื้อสูท ขาตั้งเดี่ยว', '<h2><strong>ที่แขวนเสื้อสูท ขาตั้งเดี่ยว&nbsp;</strong></h2><div><ul><li>แขวนเสื้อสูทได้กระชับ</li><li>เข้ารูปทรง พร้อมราวแขวนกางเกง</li><li>ฐานสแตนเลสทรงสีเหลี่ยม</li><li>ตั้งวางในห้องดูภูมิฐาน เคลื่อนย้ายสะดวก</li><li>มีถาดวางเข็มกลัดและกระดุม</li><li>ผลิตด้วยวัสดุแข็งแรง ทนทาน อายุการใช้งานได้ยาวนาน</li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p></div><div>รหัสสินค้า : CTR-J-16B<br>วัสดุ : สแตนเลส + ไม้<br>ขนาด : (L)47 x (W)15&nbsp;x (H)124 ซม.<br>สี : ธรรมชาติ + เงิน</div><div><br></div><div></div>  ', 1, 36, 17, 0, 0, 0, 0, '', 'N', 'N'),
(150, 'CTR-J-16A', 'ที่แขวนเสื้อสูท ขาตั้งเดี่ยว', '<h2><strong>ที่แขวนเสื้อสูท ขาตั้งเดี่ยว</strong></h2><div><ul><li>แขวนเสื้อสูทได้กระชับ</li><li>เข้ารูปทรง พร้อมราวแขวนกางเกง</li><li>ฐานสแตนเลสทรงกลม</li><li>ตั้งวางในห้องดูภูมิฐาน เคลื่อนย้ายสะดวก</li><li>มีถาดวางเข็มกลัดและกระดุม</li><li>ผลิตด้วยวัสดุแข็งแรง ทนทาน อายุการใช้งานได้ยาวนาน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : CTR-J-16A<br>วัสดุ : สแตนเลส + ไม้<br>ขนาด : (L)47 x (W)15&nbsp;x (H)124 ซม.<br>สี : โอ๊ค</div><div><br></div><div></div>  ', 1, 36, 17, 0, 0, 0, 0, '', 'N', 'N'),
(151, 'CTR-J-32-B', 'ที่แขวนเสื้อสูท ทรงขาตั้งคู่โค้ง', '<h2><strong>ที่แขวนเสื้อสูท ทรงขาตั้งคู่</strong></h2><div><ul><li>รูปทรงไม้แขวนเสื้อสูท พร้อมราวพาดกางเกง</li><li>ขาตั้งคู่ ตั้งมั่นคง ดูสง่างาม</li><li>มีถาดหลุมวางเข็มกลัด กระดุมเสื้อ และราวแขวนเนคไท พร้อมชั้นวางรองเท้า</li><li>งานช่างฝีมือปราณีต ผลิตจากท่อนไม้เนื้อแข็งขัดมัน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;CTR-J-32-B<br>วัสดุ ไม้ + สแตนเลส<br>ขนาด&nbsp;(L)41&nbsp;x (W)35 x (H)116&nbsp;ซม.<br>สี โอ๊ต</div>  ', 1, 36, 18, 0, 0, 0, 0, '', 'N', 'N'),
(152, 'CTR-J-32', 'ที่แขวนเสื้อสูท ทรงขาตั้งคู่โค้ง', '<h2><strong>ที่แขวนเสื้อสูท ทรงขาตั้งคู่โค้ง</strong></h2><div><ul><li>รูปทรงไม้แขวนเสื้อสูท พร้อมราวพาดกางเกง</li><li>ขาตั้งคู่โค้ง ตั้งวางมั่นคง ดูสง่างาม</li><li>มีถาดหลุมวางเข็มกลัด กระดุมเสื้อ และรางแขวนเนคไท พร้อมชั้นวางรองเท้า</li><li>งานช่างฝีมือปราณีต ผลิตจากท่อนไม้เนื้อแข็งขัดมัน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;CTR-J-32<br>วัสดุ ไม้ +&nbsp;สแตนเลสชุบทอง<br>ขนาด (L)46 x (W)35 x (H)115 ซม.<br>สี โอ๊ค + ทอง</div><div><br></div>  ', 1, 36, 18, 0, 0, 0, 0, '', 'N', 'N'),
(153, 'CTR-J-31', 'ที่แขวนเสื้อสูท ทรงขาตั้งคู่', '<h2><strong>ที่แขวนเสื้อสูท ทรงขาตั้งคู่</strong></h2><div><ul><li>รูปทรงไม้แขวนเสื้อสูท พร้อมราวพาดกางเกง</li><li>ขาตั้งคู่ ตั้งมั่นคง ดูสง่างาม</li><li>มีถาดหลุมวางเข็มกลัด กระดุมเสื้อ และราวแขวนเนคไท พร้อมชั้นวางรองเท้า</li><li>งานช่างฝีมือปราณีต ผลิตจากท่อนไม้เนื้อแข็งขัดมัน</li><li>มีล้อเคลื่อนย้ายได้สะดวก</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;CTR-J-31&nbsp;<br>วัสดุ ไม้ +&nbsp;สแตนเลสชุบทอง<br>ขนาด&nbsp;(L)49&nbsp;x (W)35 x (H)121 ซม.<br>สี โอ๊ต&nbsp;+ ทอง</div>  ', 1, 36, 18, 0, 0, 0, 0, '', 'N', 'N'),
(154, 'PSC-HB114BS', 'เครื่องชั่งน้ำหนักดิจิตอล ทรงเหลี่ยม', '<h2><strong>เครื่องชั่งน้ำหนักดิจิตอล ทรงสี่เหลี่ยม</strong></h2><div><ul><li>เทคโนโลยีใหม่ขึ้นชั่งได้ทันที (ไม่ต้องใช้เท้าแตะสัมผัสเพื่อเปิดเครื่อง)</li><li>ติดตั้งด้วยระบบเกย์วัดเซ็นเซอร์ความแม่นยำสูง</li><li>แป้นเหยียบไม่ไผ่ลายขวาง&nbsp;หนา 1.5 ซม.</li><li>พิกัดน้ำหนักชั่ง : 6-180 กิโลกรัม/13.2-396 ปอนด์</li><li>ค่าผันแปร&nbsp;0.1 กิโลกรัม/0.2 ปอนด์</li><li>ขนาดหน้าจอ LED&nbsp;: 7.2 x 2.8&nbsp;ซม.</li><li>ตัวเลข LED : 2.5 ซม.</li><li>ตั้งค่าชั่งเป็นหน่วย กิโลกรัม/ปอนด์/สโตน (1 กิโลกรัม = 2.2 ปอนด์)</li><li>ปิดเครื่อง&nbsp;อัตโนมัติภายใน 6 วินาที</li><li>หน้าจอแจ้งเตือนเมื่อแบตเตอรี่ไฟอ่อนหรือชั่งเกิดพิกัด</li><li>ได้รับรองมาตราฐานจากสถาบัน CE และ RoHS</li></ul></div><div><strong>คุณสมบัติเฉพาะ</strong></div><div><strong><br></strong></div><div>รหัสสินค้า :&nbsp;PSC-HB114BS</div><div>วัสดุ : ไม่ไผ่</div><div>แบตเตอรี่ : กระดุมลิเธียม&nbsp;จำนวน&nbsp;1 ก้อน (จัดให้)</div><div>ขนาด : (กว้าง)30&nbsp;x&nbsp;(ยาว)30 x&nbsp;(สูง)3.5 ซม.</div><div><br></div><div><br></div>  ', 1, 35, 0, 0, 0, 0, 0, '', 'N', 'N'),
