(160, 'WBC-010-026(A)(B)(C)', 'เตียงเด็ก', '<h2><strong>เตียงเด็ก</strong></h2><ul><li>ผลิตออกแบบเตียงนอนเด็กเพื่อใช้ในโรงแรมโดยเฉพาะ&nbsp;</li><li>เก็บพับ ล๊อคล้อ เคลื่อนย้ายสะดวกได้ลงตัวทุกมุมห้อง&nbsp;</li><li>แผงข้างปรับยก ขึ้น-ลง ล๊อคกระชับแน่นหนามั่นคง&nbsp;</li><li>โครงสร้างแข็งแรง ไม่มีเสี้ยน ได้มาตรฐานความปลอดภัย&nbsp;</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p>\r\n<div>\r\nวัสดุเตียง :     ไม้บีช           <br>\r\nรูปแบบ :    เก็บพับ ล๊อคล้อ เคลื่อนย้ายสะดวก          <br>\r\nขนาดเตียง :    (กว้าง) 63 x&nbsp;(ยาว) 111 x&nbsp;(สูง) 93 ซม.  ลูกล้อ 2 นิ้ว            <br>\r\nรหัสสินค้า : WBC-010-026A<br>\r\nสี : แดงวอลนัท<br> \r\n<br>\r\nรหัสสินค้า : WBC-010-026B<br>\r\nสี :    ไม้ธรรมชาติ         <br> \r\n<br>\r\nรหัสสินค้า : WBC-010-026C<br>\r\nสี :    ขาว          <br>   \r\n\r\n \r\n           \r\n<br>วัสดุที่นอน :    ใยมะพร้าว + ฟองน้ำ           <br>\r\nขนาด :    (กว้าง) 58 x&nbsp;(ยาว) 106 x&nbsp;(สูง) 5 ซม.  </div>\r\n<div><br></div><br><p><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/WBC-010-026-X/WBC-010-026-X-4.jpg\" style=\"max-width:100%\" alt=\"เตียงเด็ก โรงแรม\"><br></p><p><br></p>  ', 1, 37, 21, 0, 0, 0, 0, '', 'N', 'N'),
