(165, 'CNC-GX-033G', 'รถเข็นทำความสะอาด', '<h2><strong>รถเข็นทำความสะอาด พลาสติก&nbsp;</strong></h2><div><ul><li>ชั้นวางเป็นพลาสติกหนา&nbsp;</li><li>รูปทรงกระทัดรัด เข็นใช้งานคล่องตัว&nbsp;</li></ul></div><p><strong>คุณสมบัติเฉพาะ&nbsp;</strong></p><div>รหัสสินค้า&nbsp;CNC-GX-033G&nbsp;</div><div>วัสดุพลาสติก PP ผ้าอ๊อกฟอร์ดสีเหลือง&nbsp;</div><div>ขนาด (กว้าง)46&nbsp;x&nbsp;(ยาว)120&nbsp;x&nbsp;(สูง)100 ซม.</div><div><br></div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/อุปกรณ์ทำความสะอาด/CNC-GX-033G.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"รถเข็นทำความสะอาด พลาสติก\" width=\"600\" height=\"1821\"><br></div><div><br></div>  ', 6, 0, 0, 0, 0, 0, 0, '', 'N', 'N'),
(166, 'FLL-B190-(BL)(W)', 'ไฟฉาย LED ติดผนัง', '<div><h2><strong>ไฟฉายติดผนัง</strong></h2><strong><p style=\"display:inline !important\"><strong></strong></p></strong></div><div><ul><li>หลอดไฟ LED&nbsp; 13&nbsp;หลอด</li><li>กระบอกอลูมิเนียมขัดเงา มองเห็นได้ในที่มืด ช่วยบอกตำแหน่งที่ตั้งไฟฉาย&nbsp;และใช้แบตเตอรี่แบบรีชาร์จ 3&nbsp;ก้อน</li><li>แผงยึดติดผนัง พร้อมเดือยแยกถ่าน เพื่อหยุดการใช้ไฟ เมื่อไม่ได้ใช้งาน และหยิบจับถนัดมือ</li><li>มีปุ่มกด เปิด-ปิด ไฟฉาย พร้อมแท่นชาร์จไฟ</li><li>เหมาะกับการติดตั้งในห้องพักโรงแรม และโรงงานเมื่อเกิดไฟดับ<br></li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p>วัสดุ : สแตนเลส<br>แบตเตอรี่ : ถ่านรีชาร์จ 2A จำนวน 3 ก้อน<strong><br></strong>ขนาด : (ยาว) 19.2 x (กว้าง)6 x (สูง)6 ซม.<strong><br></strong></div><div><strong><br></strong></div><div>รหัสสินค้า : FLL-B190-BL  </div><div>สี : ดำ</div><div><br></div><div><div>รหัสสินค้า : FLL-B190-W<br></div><div>สี : ขาว</div></div><div><br></div><p><strong>ข้อมูลเพิ่มเติมการใช้งาน</strong></p><div><ul><li>มีปุ่มกด เปิด-ปิด ที่ด้ามไฟฉาย</li><li>ด้ามไฟฉายขณะกดเปิดใช้งาน เมื่อวางเสียบกับแป้นเก็บ ไฟก็จะดับหยุดใช้งาน เมื่อหยิบด้ามไฟฉายออกจากแป้นไฟจะติดอัตโนมัติ</li><li>ด้ามไฟฉายขณะกดปิดใช้งาน เมื่อวางเสียบกับแป้นเก็บ ไฟยังดับหยุดใช้งาน เมื่อหยิบด้ามไฟฉาย&nbsp;ออกจากแป้นไฟก็ยังคงดับอยู่ปกติ</li><li>ระหว่างถือใช้งาน กดปุ่มเปิด-ปิดได้ตามปกติ</li></ul><div><br></div></div>  ', 2, 29, 0, 0, 0, 0, 0, '', 'N', 'N'),
(167, 'FLL-B198-(BL)(S)', 'ไฟฉาย LED ติดผนัง มีจุดพรายน้ำ', '<h2><strong>ไฟฉายติดผนัง&nbsp;(มีจุดพรายน้ำ)</strong></h2><div><ul><li>หลอดไฟ LED 1 หลอด</li><li>มีจุดพรายน้ำที่ตัวแผงติดผนัง ช่วยบอกตำแหน่งที่ตั้งไฟฉาย และหยิบจับใช้งานสะดวก<br></li><li>แผงยึดติดผนัง เพื่อยก วาง เปิด-ปิดไฟฉายอัตโนมัติ</li><li>เหมาะกับการติดตั้งในห้องพักโรงแรม และโรงงานเมื่อเกิดไฟดับ<br></li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p>แบตเตอรี่ : ถ่าน 3A จำนวน 4 ก้อน<br></div><div>ขนาด&nbsp;: (ยาว)13&nbsp;x (กว้าง)3.8 x (ลึก)4&nbsp;ซม.<br><p>รหัสสินค้า : FLL-B198-BL<br>สี : ดำ</p></div><div><div><div>รหัสสินค้า : FLL-B198-S  </div>  สี : เงิน</div></div><div><br></div><p><strong>ข้อมูลเพิ่มเติมการใช้งาน</strong></p><div><ul><li>กดเปิด-ปิด ที่ก้นตัวด้ามไฟฉาย ระหว่างถือใช้งาน</li><li>วางด้ามไฟฉายขณะไฟติดหรือดับที่แป้นเสียบ ไฟจะดับหยุดการใช้งาน</li><li>เมื่อหยิบด้ามไฟฉายออกจากแป้นไฟก็จะติดโดยอัตโนมัติ</li></ul></div><div></div><div><br></div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องพัก/ไฟฉายติดผนัง/FLL-B198-%28BL%29%28S%29-detail-1_001.jpg\" style=\"vertical-align:baseline;border:0px #000000\" width=\"600\" height=\"1498\"><br></div>  ', 2, 29, 0, 0, 0, 0, 0, '', 'N', 'N'),
(168, 'FLL-IS3223B', 'ไฟฉายฉุกเฉิน ติดผนัง', '<h2><strong>ไฟฉายติดผนัง ไฟฉายฉุกเฉิน ติดผนัง</strong></h2><div><ul><li>หลอดไฟ LED 3 หลอด</li><li>แผงยึดติดผนัง พร้อมเดือยแยกถ่าน เพื่อหยุดการใช้ไฟ เมื่อไม่ได้ใช้งานและหยิบจับถนัดมือ</li><li>เหมาะกับการติดตั้งในห้องพักโรงแรม และโรงงานเมื่อเกิดไฟดับ<br></li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p><strong></strong>วัสดุ : <strong></strong>พลาสติกอย่างดี<strong><br></strong>แบตเตอรี่ : แบบ D จำนวน 2 ก้อน<br>ขนาด : (ยาว)23.3 x (กว้าง)6.5 x (สูง)6 ซม.<strong><br></strong></div><div><strong><br></strong></div>  ', 2, 29, 0, 0, 0, 0, 0, '', 'N', 'N'),
(169, 'FLL-B-091', 'ไฟฉายฉุกเฉิน ติดผนัง มีจุดพรายน้ำ', '<h2><strong>ไฟฉายติดผนัง&nbsp;(มีจุดพรายน้ำ)</strong></h2><div><ul><li>ด้านบนกระบอกไฟฉายชุบโครเมี่ยมเงา</li><li>มีจุดพลายน้ำ ช่วยบอกตำแหน่งที่ตั้งไฟฉาย และสะดวกในการหยิบจับถนัดมือ<br></li><li>แผงยึดติดผนัง พร้อมเดือยแยกถ่าน เพื่อหยุดการใช้ไฟ เมื่อไม่ได้ใช้งาน</li><li>เหมาะกับการติดตั้งในห้องพักโรงแรม และโรงงาน เมื่อเกิดไฟฟ้าดับ<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong><br></p><div>วัสดุ : พลาสติกอย่างดี<br>แบตตเตอรี่ : ถ่านแบบ D จำนวน 2 ก้อน<br></div><div>ขนาด : (ยาว)21 x (กว้าง)6.5 x (สูง)5.5 ซม.  </div><div><br></div><div><p>รหัสสินค้า : FLL-B-091-R/S<br>สี : แดง</p></div><div></div>รหัสสินค้า : FLL-B-091-BL/S<br><div>สี : ดำ</div><br><div>รหัสสินค้า : FLL-B-091-G/S<br>สี : เทา</div><div><br></div><div>รหัสสินค้า : FLL-B-091-K/S<br>สี : กาแฟ</div><div><br></div>  ', 2, 29, 0, 0, 0, 0, 0, '', 'N', 'N'),
(170, 'FLL-B195', 'ไฟฉายติดผนัง มีไฟกระพริบ', '<h2><strong>ไฟฉายติดผนัง&nbsp;(มีไฟกระพริบ)</strong></h2><div><ul><li>มีไฟกระพริบตลอดเวลา เพื่อบอกตำแหน่งที่ตั้งไฟฉาย สะดวกต่อการหยิบใช้</li><li>แผงยึดติดผนัง พร้อมเดือยแยกถ่าน เพื่อหยุดการใช้ไฟ เมื่อไม่ได้ใช้งาน</li><li>เหมาะกับการติดตั้งในห้องพักโรงแรม และโรงานเมื่อเกิดไฟฟ้าดับ<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong><br></p><div>วัสดุ : พลาสติกอย่างดี<br>แบตเตอรี่ : ถ่านแบบ D จำนวน 2 ก้อน<br></div><div>ขนาด : (ยาว)21&nbsp;x (กว้าง)5.5 x (สูง)5 ซม.  </div><div><br></div><div>รหัสสินค้า : FLL-B195-R<br>สี : แดง</div><div><br></div><div>รหัสสินค้า : FLL-B195-BL<br>สี : ดำ</div><div><br></div><div>รหัสสินค้า : FLL-B195-G<br>สี : เทา<br></div><div><br></div><div>รหัสสินค้า : FLL-B195-K<br>สี : กาแฟ</div><div><br></div>  ', 2, 29, 0, 0, 0, 0, 0, '', 'N', 'N'),
(171, 'LGR-J-13B', 'โต๊ะวางกระเป๋าสเตนเลส', '<h2><strong>โต๊ะวางกระเป๋าสเตนเลส</strong></h2><div><ul><li>ทรงใหม่ทันสมัย ท่อสเตนเลสแบน สายพาดอย่างดี 5 เส้น</li><li>ทนทานแข็งแรง รับน้ำหนักได้มากกว่า</li><li>มีพนักพิงจัดตั้งวางข้างตู้เสื้อผ้าได้อย่างลงตัว</li><li>เคลื่อนย้ายสะดวกตามการใช้สอย เป็นเฟอร์นิเจอร์ เก็บพับได้</li><li>รับน้ำหนักได้สูงสุด 200 กก.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong><br></p><div>วัสดุ&nbsp;สเตนเลสสีทอง<br>ขนาด (ย)61 x (ก)47 x (ส)67 ซม.</div><div><br></div><div>รหัสสินค้า LGR-J-13B-G<br></div><div>สี&nbsp;ทอง</div><div><br></div><div>รหัสสินค้า LGR-J-13B-S<br>สี เงิน<br></div><div><strong><br></strong></div><div><strong>รับน้ำหนักได้สูงสุด 200 กก.</strong><br></div><div><br></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(172, 'LGR-J-12A-G', 'โต๊ะวางกระเป๋าสเตนเลส', '<h2><strong>โต๊ะวางกระเป๋าสเตนเลส</strong></h2><div><ul><li>ทรงใหม่ทันสมัย ท่อสเตนเลสแบน สายพาดอย่างดี 4 เส้น</li><li>ทนทานแข็งแรง รับน้ำหนักได้มากกว่า</li><li>จัดตั้งวางข้างตู้เสื้อผ้าได้อย่างลงตัว</li><li>เคลื่อนย้ายสะดวกตามการใช้สอย เป็นเฟอร์นิเจอร์ เก็บพับได้</li><li>รับน้ำหนักได้สูงสุด 200 กก.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ&nbsp;สเตนเลสชุบสีทอง<br>ขนาด (ย)50 x (ก)40 x (ส)55 cm.  </div><div><br></div><div>รหัสสินค้า LGR-J-12A-G<br></div><div>สี ทอง</div><div><br></div><div>รหัสสินค้า LGR-J-12A-S <br>สี เงิน<br></div><div><br></div><div><strong>รับน้ำหนักได้สูงสุด 200 กก.</strong></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(173, 'LGR-J13-NA', 'โต๊ะวางกระเป๋าสแตนเลส', '<h2><strong>โต๊ะวางกระเป๋าสแตนเลส</strong></h2><div><ul><li>ท่อสแตนเลสหนาใหญ่ สายพาดเหนียวอย่างดี 5 เส้น รับน้ำหนักและแรงกระแทก</li><li>ทนทาน แข็งแรง พร้อมยางยึดกับผนังห้อง ช่วยให้ตั้งวางได้อย่างมั่นคง</li><li>น้ำหนักเบาเคลื่อนย้ายสะดวก เป็นเฟอร์นิเจอร์ เก็บพับได้</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;LGR-J13-NA</div><div>วัสดุ&nbsp;สเตนเลส</div><div>ขนาด (ย)55 x (ก)50 x (ส)70 ซม.</div><div>สี เงิน</div><div><br></div><div><strong>รับน้ำหนักได้สูงสุด&nbsp;150 กก.</strong></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(174, 'LGR-J-48', 'โต๊ะวางกระเป๋าไม้', '<h2><strong>โต๊ะวางกระเป๋าไม้</strong></h2><div><ul><li>รูปทรงเฟอร์นิเจอร์ไม้หนา งานประณีต เข้าชุดกับตู้เสื้อผ้า สายพาด 5 เส้น</li><li>ทนทาน แข็งแรง มีพนักพิงช่วยให้ตั้งวางได้อย่างมั่นคง </li><li>เคลื่อนย้ายสะดวกตามการใช้สอย เป็นเฟอร์นิเจอร์เก็บพับได้</li><li>ตั้งวางได้อย่างมั่นคง รับน้ำหนักได้สูงสุด 200 กก.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า LGR-J-48B  </div><div>วัสดุ ไม้เนื้อแข็ง</div><div>ขนาด (ย)60 x (ก)45 x (ส)68 cm.  </div><div><br></div><div>รหัสสินค้า LGR-J-48<br>สี เชอรี่</div><div><br></div><div>รหัสสินค้า LGR-J-48B<br></div><div>สี&nbsp;ธรรมชาติ</div><div><br></div><div><br></div><div><strong>รับน้ำหนักสูงสุด 200 กก.</strong></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(175, 'LGR-J-48C', 'โต๊ะวางกระเป๋าไม้', '<h2><strong>โต๊ะวางกระเป๋าไม้</strong></h2><div><ul><li>รูปทรงเฟอร์นิเจอร์ไม้ งานปราณีต เข้าชุดกับตู้เสื้อผ้า สายพาด 5 เส้น</li><li>ทนทานแข็งแรง รับน้ำหนักได้มากกว่า</li><li>เคลื่อนย้ายสะดวกตามการใช้สอย เป็นเฟอร์นิเจอร์เก็บพับได้<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า LGR-J-48C<br>  </div><div>วัสดุ ไม้เนื้อแข็ง</div><div>ขนาด (ย)61 x (ก)44 x (ส)55 cm.  </div><div>สี&nbsp;ดำ</div><div><br></div><div><strong>รับน้ำหนักสูงสุด 200 กก.</strong></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(176, 'LGR-J13', 'โต๊ะวางกระเป๋าสแตนเลส', '<h2><strong>โต๊ะวางกระเป๋าสแตนเลส สายพาด&nbsp;4 เส้น</strong></h2><div><ul><li>ท่อสแตนเลสหนาใหญ่ สายพาดเหนียวอย่างดี 4&nbsp;เส้น รับน้ำหนักและแรงกระแทก</li><li>ทนทาน แข็งแรง ตั้งวางได้อย่างมั่นคง</li><li>น้ำหนักเบาเคลื่อนย้ายสะดวก เป็นเฟอร์นิเจอร์ เก็บพับได้</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;LGR-J13</div><div>วัสดุ&nbsp;สเตนเลส</div><div>ขนาด (ย)55 x (ก)50 x (ส)70 ซม.</div><div>สี เงิน</div><div><br></div><div><strong>รับน้ำหนักได้สูงสุด&nbsp;150 กก.</strong></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(177, 'LGR-J-43', 'โต๊ะวางกระเป๋าสแตนเลส', '<h2><strong>โต๊ะวางกระเป๋าสแตนเลสแบน&nbsp;สายพาด&nbsp;6 เส้น</strong></h2><div><ul><li>ทรงใหม่ทันสมัย ท่อสแตนเลสแบน สายพาดอย่างดี 6 เส้น</li><li>ทนทานแข็งแรง รับน้ำหนักได้มากกว่า 100 กิโลกรัม</li><li>มีพนักพิงจัดตั้งวางข้างตู้เสื้อผ้าได้อย่างลงตัว</li><li>เครื่องย้ายสะดวกตามการใช้สอย เป็นเฟอร์นิเจอร์ เก็บพับได้<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : LGR-J-43<br>วัสดุ : สแตนเลส<br>ขนาด : (ย)65 x (ก)60 x (ส)60 ซม.<br>สี : เงิน<br></div><div><br></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(178, 'LGR-J-49', 'โต๊ะวางกระเป๋าไม้', '<h2><strong>โต๊ะวางกระเป๋าไม้</strong></h2><div><ul><li>รูปทรงเฟอร์นิเจอร์ไม้หนา งานประณีต เข้าชุดกับตู้เสื้อผ้า สายพาด 6&nbsp;เส้น</li><li>ทนทาน แข็งแรง มีพนักพิงช่วยให้ตั้งวางได้อย่างมั่นคง</li><li>เคลื่อนย้ายสะดวกตามการใช้สอย เป็นเฟอร์นิเจอร์ เก็บพับได้</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;LGR-J-49</div><div>วัสดุไม้เนื้อแข็ง</div><div>ขนาด&nbsp;(L)60 x (W)46 x (H)52 cm.</div><div>สี ธรรมชาติ</div><div><br></div><div><strong>รับน้ำหนักได้สูงสุด200 กก.</strong></div>  ', 2, 30, 0, 0, 0, 0, 0, '', 'N', 'N'),
(179, 'STR-J-30D', 'โต๊ะวางถาด', '<h2><strong>โต๊ะวางถาด สายพาด 3 เส้น</strong></h2><div><ul><li>รูปทรงตัวเอ็กซ์ แบบตัวโต๊ะใช้วางถาด 2 ชั้น รับน้ำหนักถาดชั้นบนและชั้นล่างได้อย่างลงตัว มั่นคง</li><li>สายพาด 3 เส้น และชั้นวางไม้ช่วยยึดขาโต๊ะให้แข็งแรง รับน้ำหนักมากขึ้น</li><li>ขนาดความสูงได้มาตราฐาน งานประกอบเฟอร์นิเจอร์ไม้ปราณีต</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;STR-J-30D  </div><div>วัสดุ : ไม้เนื้อแข็ง สีโอ๊ค</div><div>ขนาด : (L)58 x (W)40 x (H)84 cm.</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/สินค้าภัตตาคาร/โต๊ะวางถาด/STR-J-30D-min.jpg\" width=\"800\" height=\"1500\"><br></div>  ', 4, 41, 0, 0, 0, 0, 0, '', 'N', 'N'),
(180, 'STR-J-30B', 'โต๊ะวางถาด', '<h2><strong>โต๊ะวางถาด สาย 3 เส้น</strong></h2><div><ul><li>รูปทรงตัวเอ็กซ์ แบบตัวโต๊ะใช้วางถาด 1&nbsp;ชั้น รับน้ำหนักถาดซ้อนกันได้อย่างมั่นคง</li><li>ทนทาน แข็งแรง สายพาด 3 เส้น&nbsp;เก็บพับเคลื่อนย้ายสะดวก</li><li>ขนาดความสูงได้มาตราฐาน งานประกอบเฟอร์นิเจอร์ไม้ปราณีต</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;STR-J-30B</div><div>วัสดุ :&nbsp;ไม้เนื้อแข็ง สีโอ๊ค</div><div>ขนาด : (L)46 x (W)46 x (H)60 cm.</div><div><br></div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/สินค้าภัตตาคาร/โต๊ะวางถาด/STR-J-30B-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"โต๊ะวางถาด สายพาด 3 เส้น\" width=\"600\" height=\"1162\"><br></div><div><strong></strong></div>  ', 4, 41, 0, 0, 0, 0, 0, '', 'N', 'N'),
(181, 'STR-J-30', 'โต๊ะวางถาด', '<h2><strong>โต๊ะวางถาด สายพาด&nbsp;3 เส้น</strong></h2><div><ul><li>รูปทรงตัวเอ็กซ์ แบบตัวโต๊ะใช้วางถาด&nbsp;1&nbsp;ชั้น รับน้ำหนักถาดซ้อนกันได้อย่างมั่นคง</li><li>ทนทาน แข็งแรง สายพาด 3 เส้น&nbsp;เก็บพับเคลื่อนย้ายสะดวก</li><li>ขนาดความสูงได้มาตราฐาน งานประกอบเฟอร์นิเจอร์ไม้ปราณีต</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;STR-J-30</div><div>วัสดุ :&nbsp;ไม้เนื้อแข็ง สีโอ๊ค</div><div>ขนาด : (L)46 x (W)50.5 x (H)80 cm.</div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/สินค้าภัตตาคาร/โต๊ะวางถาด/STR-J-30-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"โต๊ะวางถาด สายพาด 3 เส้น\" width=\"600\" height=\"1027\"><br></div>  ', 4, 41, 0, 0, 0, 0, 0, '', 'N', 'N'),
(182, 'PDM-16', 'โพเดี่ยม/แท่นบรรยาย', '<h2><strong>โพเดี่ยม&nbsp;/ แท่นบรรยาย ทรงเหล็กแผ่นเอียง ชั้นวางไม้ด้านบนโค้ง</strong></h2><div><ul><li>รูปทรงดีไซร์ สไตล์โมเดิร์น สแตสเลสโค้งคู่ประกบด้านข้าง เหล็กแผ่นสีดำเฉียงเข้าฐานล่างเหล็กเว้ารับมุมสี่ด้าน</li><li>ชั้นวางโพเดี่ยมไม้สีน้ำตาล พร้อมอุปกรณ์ส่องไฟและก้านเสียบไมค์</li><li>การออกแบบรูปลักษณ์ สร้างสรรค์เข้ากับสรีระ เสริมให้ผู้บรรยายมีความสะดวก พร้อมมั่นใจ</li><li>ผลิตด้วยเครื่องจักรมาตรฐาน ทุกขั้นตอน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;PDM-16</div><div><div>ส่วนสีดำ แผ่นเหล็กพ่นสี</div><div>ส่วนเสา สแตนเลส</div><div>ส่วนวางเอกสาร เนื้อไม้</div><div>ขนาด (กxยxส)60&nbsp;x 57 x 130 ซม.</div>  </div><div></div>  ', 2, 23, 0, 0, 0, 0, 0, '', 'N', 'N'),
(183, 'PDM-36', 'โพเดี่ยม/แท่นบรรยาย', '<h2><strong>โพเดี่ยม/แท่นบรรยาย</strong></h2><div><ul><li>รูปทรงดีไซร์ สไตล์โมเดิร์น สแตสเลสกลมแท่งคู่ประกบด้านข้าง เหล็กแผ่นโค้งสีดำเข้าฐานล่างเหล็กเว้ารับมุมสี่ด้าน</li><li>ชั้นวางโพเดี่ยมกระจกแผ่นหนา มีอุปกรณ์ก้านส่องไฟ</li><li>การออกแบบรูปลักษณ์ สร้างสรรค์เข้ากับสรีระ เสริมให้ผู้บรรยายคล่องตัวตลอดการสัมมนา แม้ในที่มืด</li><li>ผลิตด้วยเครื่องจักรมาตรฐาน ทุกขั้นตอน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;PDM-36</div><div>ส่วนสีดำ แผ่นเหล็กพ่นสี</div><div>ส่วนเสา สแตนเลส</div><div>ส่วนวางเอกสาร แก้ว</div><div>ขนาด (กxยxส)51 x 57 x 120 ซม.</div>  ', 2, 23, 0, 0, 0, 0, 0, '', 'N', 'N'),
(184, 'PDM-92', 'โพเดี่ยม/แท่นบรรยาย', '<h2><strong>โพเดี่ยม/แท่นบรรยายทรงไม้เฉียง ชั้นวางไม้หุ้มหนังขอบสเตนเลส</strong></h2><div><ul><li>รูปทรงดีไซร์ สไตล์โมเดิร์น สแตสเลสโค้งคู่ประกบด้านข้าง ไม้แผ่นหุ้มหนัง PU สีน้ำตาลเข้ม เฉียงเข้าฐานล่างไม้ตัดขอบสเตนเลสเว้ารับมุมสี่ด้าน</li><li>การออกแบบรูปลักษณ์ สร้างสรรค์เข้ากับสรีระ เสริมให้ผู้บรรยายมีความสะดวก พร้อมมั่นใจ</li><li>ผลิตด้วยเครื่องจักรมาตรฐาน ทุกขั้นตอน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;PDM-92</div><div>วัสดุ&nbsp;ไม้หุ้มหนัง PU + สแตนเลส<br>ขนาด ด้านบน&nbsp;(ก)40&nbsp;x (ย)49 ซม.</div><div>ขนาด ฐานล่าง&nbsp;(กxยxส)&nbsp;49 x 49 x 116.5 ซม.</div><div>สีไม้หุ้มหนัง PU สีน้ำตาลเข้ม + สแตนเลสสีเงิน</div><br><div><br></div>  ', 2, 23, 0, 0, 0, 0, 0, '', 'N', 'N'),
(185, 'PDM-91', 'โพเดี่ยม/แท่นบรรยาย', '<h2><strong>โพเดี่ยม/แท่นบรรยายทรงไม้เฉียง ชั้นวางไม้ขอบสเตนเลส</strong></h2><div><ul><li>รูปทรงดีไซร์ สไตล์โมเดิร์น สแตสเลสโค้งคู่ประกบด้านข้าง ไม้แผ่นสีน้ำตาล เฉียงเข้าฐานล่างไม้ตัดขอบสเตนเลสเว้ารับมุมสี่ด้าน</li><li>การออกแบบรูปลักษณ์ สร้างสรรค์เข้ากับสรีระ เสริมให้ผู้บรรยายมีความสะดวก พร้อมมั่นใจ</li><li>ผลิตด้วยเครื่องจักรมาตรฐาน ทุกขั้นตอน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;PDM-91</div><div>วัสดุไม้+สแตนเลส</div><div>ขนาด ด้านบน (ก)40 x (ย)49 ซม.<br>ขนาด ฐานล่าง&nbsp;(กxยxส)&nbsp;49 x 49 x 116.5 ซม.<br></div><div>สีไม้พ่นด้วยสีน้ำตาล+สแตนเลสเงิน</div>  ', 2, 23, 0, 0, 0, 0, 0, '', 'N', 'N'),
(186, 'RCL-YG-338K', 'เชือกดึงตากผ้า ทรงแปดเหลี่ยม', '<h2><strong>เชือกดึงตากผ้า ทรงแปดเหลี่ยม</strong></h2><div><ul><li>1 ชุดประกอบด้วย 2 ชิ้น (ตัวหลักและตัวลูก) <br>ติดตั้งเสร็จแล้วดึงเชือกจากตัวหลักมาเกี่ยวกับตัวลูก</li><li>ทรงเหลี่ยมแปดเหลี่ยม มีปุ่มยึด-คลายเชือก ขนาด 1.2 ซม.</li><li>ติดตั้งสะดวก ในห้องน้ำหรือระเบียงห้องพัก</li><li>เหมาะสำหรับ ตากชุดชั้นใน ถุงเท้าและอื่นๆ</li><li>ไม่สิ้นเปลืองพื้นที่ สะดวกในการใช้สอย</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : RCL-YG-338K</div><div>ขนาดตัวหลัก : (เส้นผ่านศูนย์กลาง)9.3 x (H) 2.8 ซม</div><div>ขนาดตัวลูก :  (L)6.5 x (W)3&nbsp;ซม.</div><div>ขนาดไนล่อน : ยาวดึงยาวสุด 2.8 เมตร หนา 1.5 -2 มม.</div>  ', 2, 28, 0, 0, 0, 0, 0, '', 'N', 'N'),
(187, 'RCL-YG-338F', 'เชือกดึงตากผ้า ทรงสี่เหลี่ยม', '<h2><strong>เชือกดึงตากผ้า ทรงสี่เหลี่ยม</strong></h2><div><ul><li>1 ชุดประกอบด้วย 2 ชิ้น (ตัวหลักและตัวลูก) <br>ติดตั้งเสร็จแล้วดึงเชือกจากตัวหลักมาเกี่ยวกับตัวลูก</li><li>ทรงเหลี่ยมตัดมุม มีปุ่มยึด-คลายเชือก ขนาด 1.2 ซม.</li><li>ติดตั้งสะดวก ในห้องน้ำหรือระเบียงห้องพัก</li><li>เหมาะสำหรับ ตากชุดชั้นใน ถุงเท้าและอื่นๆ</li><li>ไม่สิ้นเปลืองพื้นที่ สะดวกในการใช้สอย</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : RCL-YG-338F</div><div>ขนาดตัวหลัก : (เส้นผ่านศูนย์กลาง)9.3 x H 2.8 ซม</div><div>ขนาดตัวหมุนบนตัวหลัก : 1.2 ซม</div><div>ขนาดตัวลูก :  6.75 x 3.45 x 0.85 ซม.</div><div>ขนาดไนล่อน : ดึงสูงสุด 2.8 เมตร หนา 1.5 - 2  มม.</div>  ', 2, 28, 0, 0, 0, 0, 0, '', 'N', 'N'),
(188, 'RCL-YG-338Y', 'เชือกดึงตากผ้า ทรงกลม', '<h2><strong>เชือกดึงตากผ้า ทรงกลม</strong></h2><div><ul><li>1 ชุดประกอบด้วย 2 ชิ้น (ตัวหลักและตัวลูก) <br>ติดตั้งเสร็จแล้วดึงเชือกจากตัวหลักมาเกี่ยวกับตัวลูก</li><li>ทรงกลม มีปุ่มยึด-คลายเชือก ขนาด 1.2 ซม.</li><li>ติดตั้งสะดวก ในห้องน้ำ ระเบียงห้องพัก</li><li>เหมาะสำหรับ ตากชุดชั้นใน ถุงเท้า และอื่นๆ</li><li>ไม่สิ้นเปลืองพื้นที่ สะดวกในการใช้สอย</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : RCL-YG-338Y</div><div>ขนาดตัวหลัก : (เส้นผ่านศูนย์กลาง)9.3 x (H) 2.8 ซม</div><div>ขนาดตัวลูก : (L)6.5 x (W)3. ซม.</div><div>ขนาดไนล่อน : ยาวสูงสุด 2.5 เมตร หนา&nbsp;2 มม.</div>  ', 2, 28, 0, 0, 0, 0, 0, '', 'N', 'N'),
(189, 'UBS-J23B-(IP)(SS)', 'เครื่องสวมถุงร่มเปียก', '<h2><strong>เครื่องสวมถุงร่มเปียก</strong></h2><div><ul><li>รูปทรงเหลี่ยม ทันสมัย</li><li>มีที่เสียบถุงร่ม ด้านข้าง 1&nbsp;ช่อง</li><li>ส่วมใส่ถุงร่มยาวหรือถุงร่มพับ</li><li>ใช้งานง่าย เพียงแค่เสียบร่มแล้วดันออกด้านข้าง</li><li>จัดตั้งวางหน้าทางเข้าอาคารกันพื้นเปียก</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ เหล็กเคลือบสี<br>ขนาด 32&nbsp;x 21 x73&nbsp;ซม.</div><div>น้ำหนัก 9.5 กิโลกรัม</div><div><br></div><div>รหัสสินค้า UBS-J23B-IP<br>สี น้ำตาลอ่อน</div><div><br></div><div>รหัสสินค้า UBS-J23B-SS<br>สี เงิน<br></div><div><br></div><p><strong>พร้อมถุงพลาสติก 1 แพ็ค (แพ็คละ 100 ใบ)</strong></p>  ', 2, 26, 0, 0, 0, 0, 0, '', 'N', 'N'),
