(195, 'SCB-13S', 'ป้ายเตือน ไม้+สเตนเลส', '<h2><strong>ป้ายเตือนความปลอดภัย ไม้+สเตนเลส</strong><br></h2><div><ul><li>วัสดุไม้ + สเตนเลส 201</li><li>ขนาด L59 x W38 x H57 CM.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า SCB-13S-CWF<br>ข้อความบนป้ายเตือน Caution Wet Floor (ป้ายสีเงิน)<br><br>รหัสสินค้า SCB-13S-CIP<br>ข้อความบนป้ายเตือน Cleaning in progres<br><br>รหัสสินค้า SCB-13S-OOS<br>ข้อความบนป้ายเตือน Out of service<br><br>รหัสสินค้า SCB-13S-APP<br>ข้อความบนป้ายเตือน Appropriate parking<br><br>รหัสสินค้า SCB-13S-PSA<br>ข้อความบนป้ายเตือน Parking space is not available<br><br>รหัสสินค้า SCB-13S-NP<br>ข้อความบนป้ายเตือน No Parking<br> </div><div><br></div>  ', 2, 40, 0, 0, 0, 0, 0, '', 'N', 'N'),
