(197, 'UBS-J18A', 'ที่ใส่ร่ม/ที่เก็บร่ม', '<h2><strong>ใส่ร่ม/ที่เก็บร่ม</strong></h2><div><ul><li>รูปทรงชั้นตั้งวาง&nbsp;สี่เหลี่ยม แบ่งเป็น&nbsp;18&nbsp;ช่องเสียบร่ม</li><li>พร้อมกุญแจล็อค</li><li>ชิ้นงาม เฟอร์นิเจอร์หรูหรา สวยงามใช้เก็บร่มด้ามยาวได้อย่างกระชับ และปลอดภัย</li><li>ตั้งวาง&nbsp;เคลื่อนย้ายสะดวก</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า UBS-J18A<br>วัสดุ เหล็กเคลือบสี + สแตนเลส<br>ขนาด (L)82&nbsp;x (W)40 x (H)83 cm.<br>สี&nbsp;น้ำตาล +&nbsp;ทอง</div><div><br></div><div><img src=\"http://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้พื้นที่ส่วนกลาง/ที่ใส่ร่ม/UBS-J18A.jpg\" style=\"vertical-align:baseline;border:0px #000000\" width=\"650\" height=\"1433\"><br></div>  ', 2, 21, 0, 0, 0, 0, 0, '', 'N', 'N'),
(198, 'UBS-J35-(G)(S)', 'ที่ใส่ร่ม/ที่เก็บร่ม', '<h2><strong>ที่ใส่ร่ม/ที่เก็บร่ม</strong></h2><div><ul><li>รูปทรงชั้นตั้งวางสี่เหลี่ยม แบ่งเป็น 24 ช่องเสียบร่ม ชั้นล่างปูพรมเทียม</li><li>ชิ้นงานเฟอร์นิเจอร์ปราณีต ดูดีสวยงาม ใช้เก็บร่มด้ามยาว และแขวนร่มพับได้</li><li>ตั้งวาง เคลื่อนย้ายสะดวก</li><li>ขนาด 84 x 34 x 55 cm.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า UBS-J35-G<br>วัสดุ สแตนเลส (เคลือบสีทอง)<br>สี&nbsp;ทอง<br><br>รหัสสินค้า UBS-J35-S<br>วัสดุ สแตนเลส<br>สี&nbsp;เงิน</div><div><br></div>  ', 2, 21, 0, 0, 0, 0, 0, '', 'N', 'N'),
(199, 'UBS-J39A-(SS)(IP)', 'ที่ใส่ร่ม/ที่เก็บร่ม', '<h2><strong>ที่เก็บร่ม ที่ใส่ร่มทรงสี่เหลี่ยม</strong></h2><div><ul><li>รูปทรงสี่เหลี่ยมทันสมัย ฉลุด้านข้าง ช่วยให้ร่มแห้งเร็ว</li><li>จัดเก็บร่มได้อย่างลงตัว&nbsp;ดูดี</li><li>ตั้งวาง เคลื่อนย้ายสะดวก เข้ากับทุกมุมห้อง</li><li>ขนาด (L)36 x (W)28 x (H)66&nbsp;cm.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><p>รหัสสินค้า&nbsp;UBS-J39A-IP<br>วัสดุ เหล็กเคลือบสี<br>สี&nbsp;น้ำตาล</p><br><div><br></div>  ', 2, 21, 0, 0, 0, 0, 0, '', 'N', 'N'),
