(201, 'UBS-J27-SPC', 'ที่ใส่ร่ม/ที่เก็บร่ม', '<h2><strong>ที่เก็บร่ม&nbsp;ที่ใส่ร่มทรงกระบอก</strong></h2><div><ul><li>รูปทรงกระบอกทันสมัย ฉลุรอบถัง ช่วยให้ร่มแห้งเร็วขึ้น</li><li>จัดเก็บร่มได้อย่างลงตัวดูดี</li><li>ตั้งวาง เคลื่ยนย้ายได้สะดวก เข้ากับทุกมุมห้อง</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า UBS-J27-SPC<br>วัสดุ แผ่นเหล็กเคลือบสี<br>ขนาด&nbsp;∅22 x 61 ซม.<br>สี เทาอ่อน</div>  ', 2, 21, 0, 0, 0, 0, 0, '', 'N', 'N'),
(202, 'UBS-J27-SSR', 'ที่ใส่ร่ม/ที่เก็บร่ม', '<h2><strong>ที่เก็บร่ม&nbsp;ที่ใส่ร่มทรงกระบอก&nbsp;สแตนเลส&nbsp;</strong></h2><div><ul><li>รูปทรงกระบอกทันสมัย ฉลุรอบถัง ช่วยให้ร่มแห้งเร็วขึ้น</li><li>จัดเก็บร่มได้อย่างลงตัวดูดี</li><li>ตั้งวาง เคลื่ยนย้ายได้สะดวก เข้ากับทุกมุมห้อง</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า UBS-J27-SSR<br>วัสดุ สแตนเลส<br>ขนาด&nbsp;∅22 x 61 ซม.<br>สี&nbsp;เงิน</div>  ', 2, 21, 0, 0, 0, 0, 0, '', 'N', 'N'),
(203, 'UBS-J-08A-(BRR)(SSR)', 'ที่ใส่ร่ม/ที่เก็บร่ม', '<h2><strong>ที่ใส่ร่ม/ที่เก็บร่ม</strong></h2><div><ul><li>รูปทรงชั้นตั้งวาง สี่เหลี่ยม แบ่งเป็น 18 ช่องเสียบร่ม  พร้อมกุญแจล็อก</li><li>ชั้นงาม เฟอร์นิเจอร์หรูหรา สวยงามใช้เก็บร่มด้ามยาวได้อย่างกระชับ และปลอดภัย</li><li>ตั้งวาง มีลูกล้อเคลื่อนย้ายสะดวก</li><li>ขนาด  : (L)56 x (W)48 x (H)86 cm.</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;UBS-J-08A-BRR<br>วัสดุ :&nbsp;สแตนเลส เคลือบสีทอง<br>สี :&nbsp;ทอง<br><br>รหัสสินค้า :&nbsp;UBS-J-08A-SSR<br>วัสดุ :&nbsp;สแตนเลส<br>สี : เงิน</div><div><br></div>  ', 2, 21, 0, 0, 0, 0, 0, '', 'N', 'N'),
(204, 'AST-129C', 'ที่ทิ้งก้นบุหรี่ ทรงถังเหลี่ยม', '<h2><strong>ที่ทิ้งก้นบุหรี่ ทรงถังเหลี่ยม</strong></h2><div><ul><li>ออกแบบรูปทรง ถังเหลี่ยม มีช่องรูทิ้งก้นบุหรี่ 3 แถว</li><li>ช่วยป้องกันไฟจากการทิ้งก้นบุหรี่กระจัดกระจาย</li><li>ผลิตด้วยวัสดุสแตนเลส ตั้งดูเด่น สะดุดตา ทนทาน</li><li>ถอดกล่องทิ้งก้นบุหรี่สะดวก ทำความสะอาดง่าย</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p></div><div>รหัสสินค้า AST-129C<br>วัสดุ : สแตนเลส<br>ขนาด : (W)22&nbsp;x (L)22 x (H)88&nbsp;CM.</div>  ', 2, 39, 0, 0, 0, 0, 0, '', 'N', 'N'),
(205, 'AST-129B', 'ที่ทิ้งก้นบุหรี่ ทรงขาเสา', '<h2><strong>ที่ทิ้งก้นบุหรี่ &nbsp; ทรงขาเสา</strong></h2><div><ul><li>ออกแบบรูปทรงกระทัดรัด&nbsp;ขาเสานิยมสไตล์ยุโรป</li><li>ช่วยป้องกันไฟจากการทิ้งก้นบุหรี่กระจัดกระจาย</li><li>ผลิตด้วยวัสดุสแตนเลส ตั้งดูเด่น สะดุดตา ทนทาน</li><li>ถอดกล่องทิ้งก้นบุหรี่สะดวก ทำความสะอาดง่าย</li></ul><p><strong>คุณสมบัติเฉพาะ  </strong></p></div><div>รหัสสินค้า AST-129B<br>วัสดุ : สแตนเลส<br>ขนาด : (ฐาน) ∅23 x (เสา) ∅10 x (H)110 CM.</div>  ', 2, 39, 0, 0, 0, 0, 0, '', 'N', 'N'),
(206, 'AST-129A', 'ที่ทิ้งก้นบุหรี่ ทรงขาเสา', '<h2><strong>ที่ทิ้งก้นบุหรี่ &nbsp; ทรงขาเสา</strong></h2><div><ul><li>ออกแบบรูปทรงกระทัดรัด&nbsp;ขาเสานิยมสไตล์ยุโรป</li><li>ช่วยป้องกันไฟจากการทิ้งก้นบุหรี่กระจัดกระจาย</li><li>ผลิตด้วยวัสดุสแตนเลส ตั้งดูเด่น สะดุดตา ทนทาน</li><li>ถอดกล่องทิ้งก้นบุหรี่สะดวก ทำความสะอาดง่าย</li><li>ทิ้งก้นบุหรี่ได้ประมาณ 7,000 มวน</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p>รหัสสินค้า AST-129A<br>วัสดุ : สแตนเลส<br>ขนาด :&nbsp;(ฐาน)&nbsp;∅23&nbsp;x (เสา) ∅10 x&nbsp;(H)110&nbsp;CM.</div>  ', 2, 39, 0, 0, 0, 0, 0, '', 'N', 'N'),
(207, 'NMR-J-3A-G', 'ชั้นวางโบว์ชัวร์-จุลสาร-แผ่นพับ', '<h2><strong>ชั้นวางจุลสาร โบว์ชัวร์</strong></h2><div><ul><li>แบบตั้งโต๊ะเคลือบด้วยทองเงา<br></li><li>แบบ ราวกั้นเดี่ยวหยิบใส่ได้สะดวก<br></li><li>คงทนถาวร ใช้ยาวนาน<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ:</strong></p><div>รหัสสินค้า :&nbsp;NMR-J-3A-G</div><div>วัสดุ : สแตนเลส</div><div>ขนาด : (W)15 x (L)37 x (H)22&nbsp;ซม.</div><div>สี :&nbsp;ทอง</div><br><div><br></div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(208, 'NMR-J-3-G', 'ชั้นวางโบว์ชัวร์-จุลสาร-แผ่นพับ', '<h2><strong>ชั้นวางโบว์ชัวร์ จุลสาร แผ่นพับ</strong></h2><div><ul><li>แบบตั้งโต๊ะเคลือบด้วยทองเงา<br></li><li>แบบ 2 ชั้น หยิบใส่ได้สะดวกยิ่งขึ้น<br></li><li>คงทนถาวร ใช้ยาวนาน<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ:</strong></p><div>รหัสสินค้า :&nbsp;NMR-J-3-G  </div><div>ขนาด : (W)25&nbsp;x (L)47 x (H)37&nbsp;ซม.  </div><div>วัสดุ : สแตนเลส  </div><div>สี : ทอง</div><div><br></div><br><div><br></div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(209, 'NMR-J-61(A)(B)', 'ชั้นวางนิตยสาร-หนังสือพิมพ์', '<h2><strong>ชั้นวางนิตยสาร-หนังสือพิมพ์</strong></h2><div><ul><li>ชั้นวางนิตยสารแบบตั้ง 2 ด้าน ทรงสูง<br></li><li>แบบตั้งพื้น ชั้นวางไม้ทรงสูง แข็งแรง</li><li>ชั้นวางเห็นชื่อหน้าปกนิตยสาร หลายแนว เด่นชัด</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ&nbsp; : ไม้</div><div>ขนาด :&nbsp; (W)42 x (L)59 x(H)137 ซม.</div><div><br></div><div>รหัสสินค้า : NMR-J-61A</div><div>สี : น้ำตาลอ่อน<br></div><div><br></div><div>รหัสสินค้า : NMR-J-61B</div><div>สี : น้ำตาลเข้ม<br></div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(210, 'NMR-J-55', 'ชั้นวางนิตยสาร-หนังสือพิมพ์', '<h2><strong>ชั้นวางนิตยสาร-หนังสือพิมพ์</strong></h2><ul><li>แบบตั้งพื้น ทรงชั้นโค้ง</li><li>รองรับนิตยสาร ด้วยหนัง PU</li><li>รูปทรงชิ้นงาน เฟอร์นิเจอร์ไม้</li><li>วางข้างโซฟา นั่งหยิบอ่านสะดวก สบาย</li></ul><p><strong>คุณสมบัติเฉพาะ</strong></p><p>    รหัสสินค้า :&nbsp;NMR-J-55<br>วัสดุ:  ไม้หุ้มหนังสีน้ำตาลเข็ม + หนัง PU<br>ขนาด:  (W) 48 x (L) 51.5 x(H) 78.5 ซม.</p><p>รหัสสินค้า : NMR-J-55<br>สี:  น้ำตาลเข้ม</p><p>รหัสสินค้า : NMR-J-55A<br>สี : เชอร์รี่</p><p>รหัสสินค้า : NMR-J-55B <br>สี : ธรรมชาติ<br></p>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(211, 'NMR-J-38', 'ชั้นวางนิตยสาร-หนังสือพิมพ์', '<h2><strong>ชั้นวางนิตยสาร-หนังสือพิมพ์</strong></h2><div><ul><li>แบบตั้งพื้น มีลูกล้อเคลื่อนย้ายสะดวก</li><li>แยกชั้นวางนิตรสาร-หนังสือพิมพ์ (6 ฉบับ) เป็นสัดส่วน หยิบวางสะดวก</li><li>รูปทรงทันสมัย แข็งแรง</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : NMR-J-38</div><div>วัสดุ : โครงสเตนเลส No.201 เคลือบทองเหลือง</div><div>ขนาด : (W)40 x (L)65&nbsp;x (H)90&nbsp;cm.</div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(212, 'NMR-J-28', 'ชั้นวางนิตยสาร-หนังสือพิมพ์', '<h2><strong>ชั้นวางนิตยสาร-หนังสือพิมพ์</strong></h2><div><ul><li>แบบตั้งพื้น มีลูกล้อเคลื่อนย้ายสะดวก</li><li>แยกชั้นวางนิตรสาร-หนังสือพิมพ์ (6 ฉบับ) เป็นสัดส่วน หยิบวางสะดวก</li><li>รูปทรงทันสมัย แข็งแรง</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp; NMR-J-28  </div><div>วัสดุ : เหล็ก เคลือบสีขาวเทา<br>ขนาด : (W)38 x (L)63.5 x (H)92 cm.<br></div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(213, 'NMR-J-2', 'ชั้นวางนิตยสาร-หนังสือพิมพ์', '<h2><strong>ชั้นวางนิตยสาร-หนังสือพิมพ์</strong></h2><div><ul><li>แบบตั้งพื้น มีลูกล้อเคลื่อนย้ายสะดวก</li><li>แยกชั้นวางนิตรสาร-หนังสือพิมพ์ (4 ฉบับ)</li><li>เป็นสัดส่วน หยิบวางสะดวก</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;NMR-J-2</div><div>วัสดุ : โครงสเตนเลส No.201 เคลือบทองเหลือง</div><div>ขนาด : (W)33 x (L)66 x (H)132.5 ซม.</div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(214, 'NMR-J-6', 'ชั้นวางนิตยสาร-หนังสือพิมพ์', '<h2><strong>ชั้นวางหนังสือพิมพ์ - นิตยสาร</strong></h2><div><ul><li>ทรงสูง ตั้งวางมั่นคง ทนทาน</li><li>ด้านบนเป็นราวเหล็ก ด้านล่างเป็นกล่องเหล็ก</li><li>จัดวางทั้งหนังสือพิมพ์และนิตยสาร เห็นเด่นชัด</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;NMR-J-6</div><div>วัสดุ : เหล็ก&nbsp;</div><div>ขนาด : (W)30 x (L)35 x (H)133.5 ซม.<br>สี : ดำ</div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
(215, 'SOD-13178', 'ที่กดสบู่ อคิลิคแบบตั้งวาง', '<h2><strong>ที่กดสบู่ อคิลิคใส แบบตั้งวาง</strong></h2><div><ul><li>รูปทรงทันสมัย สี่เหลี่ยมมน หัวจุกปั๊มหมุนได้ 360 องศา แยกอิสระจากเกลียวหมุนเปิด-ปิด ได้แน่นคงทน</li><li>กดน้ำยาได้ปริมาณแน่นอนไม่ไหลเยิ้ม</li><li>ตั้งวางดูภูมิฐาน หรูหรา ใช้สะดวก</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ : อคิลิค</div><div>ขนาด :&nbsp;(W)8 x&nbsp;(L)9 x (H)14 cm.</div><div>ปริมาตร :&nbsp;280 ml.</div><div><br></div><div>รหัสสินค้า : SOD-13178</div><div>สี : เบส<br></div><div><br></div><div>รหัสสินค้า : SOD-13178-CL</div><div>สี : ใส<br></div><div><br></div><br><div><strong><span style=\"text-decoration-line:underline\">Tip/Warning</span></strong></div><div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
(216, 'SOD-068-W(T)', 'ที่กดสบู่ ติดผนัง', '<h2><strong>ที่กดสบู่ติดผนัง</strong></h2><div><ul><li>รูปทรงทันสมัย ถูกสุขลักษณะ เปิดฝาด้านบน พร้อมกุญแจล็อคเปิด-ปิดฝา</li><li>กระบอกพลาสติกใสอย่างดี เห็นน้ำยา วัสดุและอุปกรณ์ภายในชัดเจน</li><li>ปั๊มกดน้ำยาเหลี่ยม คล่องสะดวกได้ปริมาณน้ำยาไหลคงที่</li><li>ผลิตจากประเทศไต้หวัน แข็งแรง ทนทานทุกสภาพอากาศ</li><li>ใช้งานได้ยาวนาน ผ่านการทดสอบตกไม่แตก</li><li>วัสดุ ฝา+ปุ่มกด+แผงติด ผลิตจากพลาสติก ABS กระบอกพลาสติกใส PC</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ : ฝา+ปุ่มกด+แผงติด ผลิตจากพลาสติก ABS กระบอกพลาสติกใส PC<br>รหัสสินค้า : SOD-068-W(T)</div><div>สี : ฝา-ปั๊มกดสีขาว, กระบอกใส  </div><div>รูปแบบ : หัวเดี่ยว</div><div>ขนาด : (H)14.5 x (W)5.0 x (D)7.0 cm.</div><div>ปริมาตร : 200 ml.</div><br><div><br></div><div><br></div><div><br></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div><br></div><div><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
