(226, 'SOD-CD-1006C-S', 'ที่กดสบู่ คริสตัลกลม สีเงิน', '<h2><strong>ที่กดสบู่ ติดผนังเดี่ยว คริสตัลกลม สีเงิน</strong></h2><div><ul><li>รูปทรงทันสมัย คงทน กระบอกใสสวนงามเห็นน้ำยา</li><li>เติมน้ำยา จากด้านบน</li><li>พร้อมกุญแจล็อกเปิด-ปิด ฝาด้านบน</li><li>จ่ายน้ำยา โดยการกดปั๊ม</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SOD-CD-1006C-S</div><div>ขนาด : 8 x 9 x 19 cm.</div><div>ปริมาตร : 300 ml.</div><div>สี :&nbsp;เงิน<br></div><div><br></div><div><br></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div><div><br></div>  <br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
