(228, 'SOD-068-LT0890-600', 'ที่กดสบู่เหลวอัตโนมัติ', '<h2><strong>ที่กดสบู่เหลวอัตโนมัติ<br></strong></h2><div><ul><li>จ่ายน้ำยาด้วยระบบเซ็นเซอร์  (Infrared sensor)<br></li><li>เพียงยื่นมือรองรับสบู่เหลวด้านล่างกระบอกหัวจ่าย<br></li><li>ระยะเซ็นเซอร์ห่างจากด้านล่างกระบอกหัวจ่าย   0-10 cm.<br></li><li>ปริมาตรการไหลสบู่เหลว 1 ml. /  ครั้ง<br></li><li>ใช้ถ่าน ขนาด AA  Alkaline  จำนวน  4 ก้อน    กำลังไฟ : DC 6V<br></li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SOD-068-LT0890-600</div><div>วัสดุ :&nbsp;พลาสติก ABS</div><div>รูปแบบ : หัวเดี่ยว  </div><div>สี : ขาว + ใส</div><div>ขนาด : (H)16.5 x (W)10&nbsp;x (L)11&nbsp;cm.</div><div>ปริมาตร :600 ml.</div><div><br></div><div><br></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><br><div><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
(229, 'SOD-CD-1006', 'ที่กดสบู่ติดผนัง กระบอกดำ', '<h2><strong>ที่กดสบู่ ติดผนัง กระบอกดำ&nbsp;สีขาว</strong></h2><div><ul><li>รูปทรงทันสมัย คงทน</li><li>เติมน้ำยา จากด้านบน</li><li>พร้อมกุญแจล็อกเปิด-ปิด ฝาด้านบน</li><li>จ่ายน้ำยา โดยการกดปั๊ม</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>ขนาด : (L)13.5&nbsp;x (W)9 x (H)19.2 cm.</div><div>ปริมาตร : 300 ml.</div><div><br></div><div>รหัสสินค้า : SOD-CD-1006A<br>สี : ขาว<br><br>รหัสสินค้า : SOD-CD-1006B<br>สี : เงิน<br><br>รหัสสินค้า : SOD-CD-1006D<br>สี : ทองแดง<br></div><div><br></div><div><strong><span style=\"text-decoration:underline\"><br></span></strong></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><strong><br></strong></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
(230, 'SPD-13142', 'จานวางสบู่ ทรงเหลี่ยมยาว', '<h2><strong>จานวางสบู่อะคริลิคหนาสีดำ ทรงเหลี่ยมยาว</strong></h2><div><ul><li>รูปทรงสี่เหลี่ยม</li><li>พื้นหนามนหงาย ทำร่อง 3 เส้นเพื่อวางสบู่ได้อย่างลงตัว</li><li>ด้านล่างเห็นปุ่มกลมเล็ก 4 จุดกันลื่น</li><li>ออกแบบพิถีพิถัน ดูดี มีน้ำหนัก</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;SPD-13142</div><div>วัสดุอะคริลิคหนา สีดำ</div><div>ขนาด&nbsp;7 x 9 หนา 2 ซม.</div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(231, 'SPD-13141', 'จานวางสบู่ ทรงสี่เหลี่ยมพับฉาก', '<h2><strong>จานวางสบู่อะคริลิคสีดำ ทรงสี่เหลี่ยมพับฉาก</strong></h2><div><ul><li>รูปทรงพื้นสี่เหลี่ยมพับฉากขอบเข้าด้านข้าง</li><li>ตั้งวางสบู่ก้อนได้ลงตัว มีสไตล์ ล้ำสมัย&nbsp;</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;SPD-13141</div><div>วัสดุ&nbsp;อะคริลิค สีดำ</div><div>ขนาด&nbsp;10.5 x 8 ซม.</div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(232, 'SPD-12001-BL', 'จานวางสบู่ทรงสี่เหลี่ยมใหญ่', '<h2><strong>จานวางสบู่อะคริลิคสีดำ ทรงสี่เหลี่ยมใหญ่</strong></h2><div><ul><li>รูปทรงสีเหลี่ยมโค้งมน แบบมาตราฐาน</li><li>มีปุ่มยกสูง&nbsp;เนื้ออะคริลิคหนา</li><li>จัดวางสบู่ก้อนได้ลงตัวเหมาะสมดูดี มีสไตล์</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : SPD-12001-BL</div><div>วัสดุ : อะคริลิคหนาอย่างดี</div><div>ขนาด : (ก)9.2&nbsp;x (ย)11.5 x (ส)2 ซม.</div><div>สีดำ</div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(233, 'SPD-15021-B', 'จานวางสบู่แก้วหนา ทรงเรือ', '<h2><strong>จานวางสบู่แก้วหนา ทรงเรือ</strong></h2><div><ul><li>รูปทรงเรือ ผิวด้านนอกเป็นลายเส้นคลื่นริ้วนูนยาว</li><li>เนื้อแก้วหนาสีเขียวใส จัดวางสบู่ได้ลงตัว</li><li>ตั้งเด่นสง่างาม สไตล์คลาสสิค ทันสมัย</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SPD-15021-B  </div><div>วัสดุ :&nbsp;แก้วหนา  </div><div>ขนาด : 13 x 7.5 x 3 ซม.</div><div>สี : ฟ้าใส</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/จานวางสบู่/SPD-15021-B-600x400-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"จานวางสบู่แก้ว\" width=\"600\" height=\"400\"><br></div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(234, 'SPD-15020-G', 'จานวางสบู่แก้วหนา ทรงเรือ', '<h2><strong>จานวางสบู่แก้วหนา ทรงเรือ</strong></h2><div><ul><li>รูปทรงเรือ ผิวด้านนอกเป็นลายเส้นคลื่นริ้วนูนยาว</li><li>เนื้อแก้วหนาสีเขียวใส จัดวางสบู่ได้ลงตัว</li><li>ตั้งเด่นสง่างาม สไตล์คลาสสิค ทันสมัย</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SPD-15020-G  </div><div>วัสดุ : แก้วหนา  </div><div>ขนาด : 13 x 7.5 x 3 ซม.</div><div>สี : เขียวใส&nbsp;</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/จานวางสบู่/SPD-15020-G-960x1440-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"จานวางสบู่แก้ว สีเขียวใส\" width=\"600\" height=\"900\"><br></div><div><br></div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(235, 'SPD-15019-B', 'จานวางสบู่แก้วหนา ทรงทองแท่ง', '<h2><strong>จานวางสบู่แก้วหนา ทรงทองแท่ง</strong></h2><div><ul><li>รูปทรงทองแท่ง ผิวด้านนอกทำเป็นลายชั้นทอง</li><li>พื้นล่างมีปุ่มยกลอย จัดวางสบู่ได้ลงตัว</li><li>ตั้งเด่นสง่างาม สไตล์คลาสสิค ทันสมัย</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SPD-15019-B</div><div>วัสดุ : แก้วหนา&nbsp;</div><div>ขนาด : 11.5 x 7.5 x 4 ซม.</div><div>สี : น้ำเงินใส&nbsp;</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/จานวางสบู่/SPD-15019-B-600x400-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"จานวางสบู่แก้ว\" width=\"600\" height=\"400\"><br></div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(236, 'SPD-15018-Pur', 'จานวางสบู่แก้วหนา ทรงฝักข้าวโพด', '<h2><strong>จานวางสบู่แก้วหนา ทรงฝักข้าวโพด</strong></h2><div><ul><li>รูปทรงฝักข้าวโพด</li><li>ผิวด้านนอกแต่งเป็นลายข้าวโพด</li><li>กลีบโทนม่วงไล่สีลงปลายใส</li><li>จัดวางสบู่ได้ลงตัว ดูสวยงาม น่ารัก สไตล์ธรรมชาติ</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SPD-15018-Pur</div><div>วัสดุ : แก้วหนา&nbsp;</div><div>ขนาด : 10.5 x 7 x 2 ซม.</div><div>สี : ม่วงไล่โทนใส</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/จานวางสบู่/SPD-15018-Pur-960x1440-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"จานวางสบู่แก้ว ทรงฟักข้าวโพด\" width=\"600\" height=\"900\"><br></div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(237, 'SPD-15017-B\r\n', 'จานวางสบู่แก้วหนา ทรงปลา', '<h2><strong>จานวางสบู่แก้วหนา ทรงปลา</strong></h2><div><ul><li>รูปทรงปลา ผิวด้านนอกหนารับกับขอบหางปลา</li><li>เนื้อแก้วหนาสีฟ้าพื้นล่างกลม</li><li>จัดวางสบู่ก้อนกลมได้กระชับลงตัว สไตล์มาตราฐาน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SPD-15017-B</div><div>วัสดุ : แก้วหนา&nbsp;</div><div>ขนาด : 9.5 x 8.5 x 2.5 ซม.</div><div>สี : ฟ้าใส</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/จานวางสบู่/SPD-15017-B-960x1440-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"จานสบู่ แก้วหนา ทรงปลา\" width=\"600\" height=\"900\"><br></div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
(238, 'SPD-15016-BL', 'จานวางสบู่แก้วหนา ทรงใบองุ่น', '<h2><strong>จานวางสบู่แก้วคริสตัลหนา ทรงใบองุ่น</strong></h2><div><ul><li>รูปทรงใบองุ่น ผิวนูน</li><li>ด้านนอกแต่งเส้นเป็นร่องใบ</li><li>เนื้อกระจกคริสตัลใสแซมน้ำเงินใหญ่หนา</li><li>วางสบู่ก้อนได้อย่างลงตัว</li><li>มีคุณค่าสมราคา ดูสวยงามสไตล์ธรรมชาติ&nbsp;</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า : SPD-15016-BL</div><div>วัสดุ : กระจกคริสตัลหนา</div><div>ขนาด : 12.5 x 8.5 x 3 ซม.</div><div>สี : ใสแซมน้ำเงิน</div><div><br></div><div><img src=\"https://www.enrhotelproducts.co.th/back-office/plungin/el_editor/files/img_products/ของใช้ในห้องน้ำ/จานวางสบู่/SPD-15016-BL-960x1440-min.jpg\" style=\"vertical-align:baseline;border:0px #000000\" alt=\"จานวางสบู่แก้ว ทรงใบองุ่น\" width=\"600\" height=\"900\"><br></div>  ', 5, 14, 0, 0, 0, 0, 0, '', 'N', 'N'),
