(300, 'ORB-GPX-153D', 'ถังขยะกลางแจ้ง ทรงเหลี่ยมคู่', '<div><strong>ถังขยะพื้นที่ส่วนกลาง/ถังขยะสนาม</strong></div><div><ul style=\"padding-left:40px\"><li>รูปทรงถังสมัยใหม่ ตั้งดูเด่น ชวนมอง ทนทาน</li><li>ถังทิ้งขยะ 2 ถัง พิมพ์บอก ถัง \"Recyclable\" ถัง \"Not-Recyclable\"</li><li>มีช่องเล็กตรงกลางเสา ช่องบนทิ้งก้นบุหรี่ ช่องล่างทิ้งแบตเตอรี่และแผ่นซีดี</li></ul></div><div><strong><br></strong></div><div><strong>คุณสมบัติเฉพาะ</strong></div><div><ul><li>รหัสสินค้า ORB-GPX-153D</li><li>วัสดุ แผ่นเหล็กเคลือบสี</li><li>ขนาด (L)100&nbsp;x (W)35&nbsp;x (H)101 Cm.</li><li>สี แผ่นเหล็กเคลือบ (ดำ) ถัง (เหลือง กับ เขียว)</li></ul></div><div><br></div><div><br></div><div><br></div><div></div>  ', 2, 20, 0, 0, 0, 0, 0, '', 'N', 'N'),
