(302, 'ALC-057-5020', 'นาฬิกาปลุกดิจิตอล', '<h2><strong>นาฬิกาปลุกดิจิตอล แบบกล่องไม้สีดำ</strong></h2><div><ul><li>หน้าจอตัวเลข LED (สีน้ำเงิน) 8 บิท</li><li>ฟังก์ชั่นนาฬิกา : ชั่วโมง นาที (แสดงค่า 12 หรือ 24 ชั่วโมง)</li><li>ฟังก์ชั่นวันที่ : เดือน วัน ปี (จากปี 2000-2099)</li><li>ฟังก์ชั่นนาฬิกาปลุก : ตั้งค่าปลุก 1 - ปลุก 2 - ปลุก 3</li><li>ปรับตั้งอุณหภูมิ : ค่า&nbsp;เซลเซียส หรือ ฟาเรนไฮด์</li><li>ตั้งแสดงหน้าจอ : กดปุ่ม UP เปลี่ยนค่า dp-1 dp-2 dp-3</li><li>ปุ่มประหยัดไฟ : กดปุ่ม Down เลือก เปิดประหยัดไฟ (oNsd) แสดงเวลาหน้าจอดับหลัง 30 วินาที ปิด แสดง --Sd</li><li>ฟังก์ชั่นเสียงควบคุม : ขณะเปิดประหยัดไฟ ให้ตบมือหรือพูดเสียงดัง ไฟหน้าจอจะแสดงขึ้นมา</li><li>ปุ่ม : Set Up Down (เวลากดปุ่มตั้งค่าต่างจะมีเสียง)</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;ALC-057-5020</div><div></div><div>ขนาด : 15&nbsp;x 4 x 7 cm</div><div>ระบบไฟ :&nbsp;</div><div><span style=\"white-space:pre\">  </span>1.&nbsp;ใช้สายเสียบ USB AC/DC 5V.&nbsp;</div><div><span style=\"white-space:pre\">  </span>2. ถ่านไฟฉาย 3A 1.5V 3 ก้อน&nbsp;</div><div><span style=\"white-space:pre\">  </span>3. แบตเตอรี่ลิเธียม 3V.</div><div><br></div><div><br></div>  ', 1, 34, 19, 0, 0, 0, 0, '', 'N', 'N'),
