(307, 'ACW-3800', 'สเปรย์แอลกอฮอล์', '<h2><strong>สเปรย์แอลกอฮอล์</strong></h2><div><ul><li>น้ำยาล้างมือ เอทิลแอลกอฮอล์ 70% V/V</li><li>ฉีดพ่น เพื่อสุขอนามัยมือ (สัมผัสกับสิ่งของต่างๆ) โดยไม่ต้องล้างออก</li><li>น้ำยาล้างมือที่เป็นสูตรเฉพาะ ใช้ Alcohol Denatured เหมาะกับผิวมือ</li><li>ช่วยกำจัดสิ่งสกปรกและยับยั้งการเจริญของแบคทีเรียได้ดี</li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p></div><div><p>รหัสสินค้า :&nbsp;&nbsp;ACW-3800<br>ส่วนประกอบ : Alcohol Denat. , Aqua<br>ขนาดบรรจุ : 1 แกลลอน (3.8&nbsp;ลิตร)<br>เลขที่จดแจ้ง&nbsp;:&nbsp;73-1-6300022692<br>โรงงานผลิต : บริษัท บีเอเอส แมนูแฟคเจอริ่ง จำกัด&nbsp;<br>มาตราฐาน :&nbsp;GMP , อย. ,&nbsp;&nbsp;ISO&nbsp;9001, ISO 14001<br></p></div><br><div><br></div>  ', 8, 45, 0, 0, 0, 0, 0, '', 'N', 'N'),
(308, 'LHS-3800', 'สบู่เหลวล้างมือ', '<h2><strong>สบู่เหลวล้างมือ</strong></h2><div><ul><li>หยดสบู่เหลวลงบนฝ่ามือ ฟอกมือให้ทั่ว (20 วินาที) แล้วล้างออกด้วน้ำสะอาด</li><li>มีส่วนผสม&nbsp; Polyquaternium-7&nbsp;สารช่วยทำความสะอาดให้ผิวนุ่มลื่น</li><li>Cocamidopropyl Betaine สารชนิด ที่ทำความสะอาดผิว ระคายเคืองน้อย</li><li>Lauramine Oxide สารทำความสะอาด ขจัดสิ่งสกปรกและหมักหม่ม</li><li>Disodium Edta ช่วยให้สารผสมคงตัว เก็บใช้ได้นานขึ้น</li><li>ช่วยกำจัดสิ่งสกปรกได้อย่างหมดจด<br></li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p></div><div><p>รหัสสินค้า :&nbsp;&nbsp;LHS-3800<br>ส่วนประกอบ : Aqua , Sodium Laureth.Sulfate , Cocamidopropyl Betaine , Cocamine MEA , Polyquaternium-7 , Lauramine Oxide , Sodium Chloride , Fragrance , Disodium Edta , Citric Acid , Methylchloroisothiazolinone , Cl 14720 (Acid Red 14) , Methylisothiazolinone<br>ขนาดบรรจุ : 1 แกลลอน (3.8&nbsp;ลิตร)<br>เลขที่จดแจ้ง&nbsp;:&nbsp;73-1-6300018811<br>โรงงานผลิต : บริษัท บีเอเอส แมนูแฟคเจอริ่ง จำกัด&nbsp;<br>มาตราฐาน :&nbsp;ISO&nbsp;9001, ISO 14001, อย., GMP<br></p></div><br><div><br></div>  ', 8, 45, 0, 0, 0, 0, 0, '', 'N', 'N'),
(309, 'PSC-HF114A', 'เครื่องชั่งน้ำหนักดิจิตอล ทรงเหลี่ยม', '<h2><strong>เครื่องชั่งน้ำหนักดิจิตอล ทรงสี่เหลี่ยม</strong></h2><div><ul><li>เทคโนโลยีใหม่ขึ้นชั่งได้ทันที (ไม่ต้องใช้เท้าแตะสัมผัสเพื่อเปิดเครื่อง)</li><li>ติดตั้งด้วยระบบเกย์วัดเซ็นเซอร์ความแม่นยำสูง</li><li>แป้นเหยียบกระจกนิรภัยสีดำ&nbsp;หนา 6 มิล</li><li>พิกัดน้ำหนักชั่ง : 5-180 กิโลกรัม/11-396 ปอนด์</li><li>ค่าผันแปร&nbsp;0.1 กิโลกรัม/0.2 ปอนด์</li><li>ขนาดหน้าจอ LED&nbsp;: 7.3 x 2.8&nbsp;ซม.</li><li>ตัวเลข LED : 2 ซม.</li><li>ตั้งค่าชั่งเป็นหน่วย กิโลกรัม/ปอนด์/สโตน (1 กิโลกรัม = 2.2 ปอนด์)</li><li>ปิดเครื่อง อัตโนมัติภายใน 6 วินาที</li><li>หน้าจอแจ้งเตือนเมื่อแบตเตอรี่ไฟอ่อนหรือชั่งเกิดพิกัด</li><li>ได้รับรองมาตราฐานจากสถาบัน CE และ RoHS</li></ul></div><div><strong>คุณสมบัติเฉพาะ</strong></div><div><strong><br></strong></div><div>รหัสสินค้า :&nbsp;PSC-HF114A</div><div>วัสดุ : กระจกนิรภัยสีดำ</div><div>แบตเตอรี่ : ถ่าน&nbsp;3A จำนวน&nbsp;1 ก้อน (จัดให้)</div><div>ขนาด : (กว้าง)30&nbsp;x&nbsp;(ยาว)30 x&nbsp;(สูง)3.5 ซม.</div><div>น้ำหนักเครื่องชั่ง : 1.55 กิโลกรัม</div><div><br></div>  ', 1, 35, 0, 0, 0, 0, 0, '', 'N', 'N'),
