(314, 'ICB-JF6102', 'กระติกน้ำแข็งสแตนเลส 2ชั้น', '<h2><strong>กระติกน้ำแข็งสแตนเลส 2ชั้น</strong></h2><div><div><ul><li>ตัวถังสแตนเลส 2 ชั้น ขอบ 1 ซม.&nbsp;ไร้รอยต่อ</li><li>รูปทรงกระบอก มีที่คีบน้ำแข็งสอดเก็บช่องฝาปิด</li><li>ปุ่มจับฝาโค้งมน ถนัดมือ ผิวนอกขัดเงาพิเศษ</li><li>ห่วงหูหิ้วแบนกระชับมือ</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;ICB-JF6102</div><div>วัสดุ :&nbsp;สแตนเลสอย่างดี<br>ปริมาตร&nbsp;: 1.3 ลิตร<br>ขนาด :&nbsp;∅14&nbsp;x สูง 19 cm.</div>  </div><div></div>  ', 4, 9, 0, 0, 0, 0, 0, '', 'N', 'N'),
