(317, 'BWO-J32-BL', 'ที่เปิดขวด/ที่เปิดจุกขวด', '<h2><strong>ที่เปิดขวด/ที่เปิดจุกขวด</strong></h2><div><ul><li>ใช้เพื่อเปิดฝาขวด ,&nbsp;เปิดจุกขวด ,&nbsp;ตัดซีลหุ้มฝาขวด</li></ul></div><div><p><strong>คุณสมบัติเฉพาะ</strong></p></div><div>รหัสสินค้า&nbsp;BWO-J32-BL</div><div>วัสดุ : สแตนเลสหนา + พลาสติก<br>ขนาด : (ย) 11 ซม.<br>สี :&nbsp;ดำ</div>  ', 4, 11, 0, 0, 0, 0, 0, '', 'N', 'N'),
(318, 'SOD-122A-2', 'ที่กดสบู่ ติดผนัง ทรงมน', '<h2><strong>ที่กดสบู่ติดผนัง ทรงมน</strong></h2><div><ul><li>รูปทรงหรูหรา ทันสมัย ช่องเติมน้ำยากว้าง เปิดฝาด้าน บน พร้อมกุญแจล็อกเปิด- ปิดฝา</li><li>วัสดุ พลาสติก ABS</li><li>กระบอกพลาสติกมนใสอย่างดี เห็นน้ำยา วัสดุและอุปกรณ์ภายในชัดเจน</li><li>ปั๊มกดน้ำยากลม คล่องสะดวกได้ปริมาณน้ำยาไหลคงที่</li><li>แข็งแรงทนทาน ทุกสภาพอากาศ ใช้งานได้ยาวนาน</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า :&nbsp;SOD-122A-2</div><div>สี :&nbsp;ฝา-ปั๊มกดสีขาวทึบ,กระบอกใส</div><div>รูปแบบ : หัวคู่  </div><div>ขนาด : (H)19.5 x (W)8.7 x (D)15.5 cm.</div><div>ปริมาตร : 350 ml. x 2</div><div><br></div><div><br></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
