(323, 'SOD-073(A)(W)-2(T)', 'ที่กดสบู่ ติดผนัง หัวคู่', '<h2><strong>ที่กดสบู่ติดผนัง หัวคู่</strong></h2><div><ul><li>รูปทรงทันสมัย ถูกสุขลักษณะ เปิดฝาด้านบน พร้อมกุญแจล็อคเปิด-ปิดฝา</li><li>วัสดุ พลาสติก ABS ทั้งใบ</li><li>ปั๊มกดน้ำยากลม คล่องสะดวกได้ปริมาณน้ำยาไหลคงที่</li><li>ผลิตจากประเทศไต้หวัน แข็งแรง ทนทานทุกสภาพอากาศ</li><li>ใช้งานได้ยาวนาน ผ่านการทดสอบตกไม่แตก</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p>รูปแบบ : หัวคู่<div>ขนาด : (H)16.2 x (W)11.0 x (D)8.10 cm.</div><div>ปริมาตร : 300 ml. x 2</div><div><br></div><div>รหัสสินค้า : SOD-073A-2(T)<br>สี : ฝา-ปั๊มกดสีโครมเงิน, กระบอกสีขาวทึบ</div><div><br></div><div>รหัสสินค้า : SOD-073W-2(T)<br>สี : ขาวทึบ<br></div><div><br></div><div><br></div><div><br></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
