(327, 'SOD-CD-2006(X)', 'ที่กดสบู่ติดผนังหัวคู่ กระบอกดำ', '<h2><strong>ที่กดสบู่ติดผนังหัวคู่ กระบอกดำ&nbsp;สีขาว<br></strong></h2><div><ul><li>รูปทรงทันสมัย คงทน</li><li>เติมน้ำยา จากด้านบน</li><li>พร้อมกุญแจล็อกเปิด-ปิด ฝาด้านบน</li><li>จ่ายน้ำยา โดยการกดปั๊ม</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong><br></p><div>วัสดุ : พลาสติก</div><div>ขนาด : (L)13.5&nbsp;x (W)9 x (H)19.2 cm.</div><div>ปริมาตร : 300 ml. x 2</div><div><br></div><div>รหัสสินค้า : SOD-CD-2006A<br></div><div>สี : ขาว<br></div><div><br></div><div>รหัสสินค้า : SOD-CD-2006B<br>สี : เงิน</div><div><br></div><div>รหัสสินค้า : SOD-CD-2006D<br>สี : ทองแดง<br></div><div><br></div><div><br></div><div><strong><span style=\"text-decoration:underline\"><br></span></strong></div><div><div><strong><span style=\"text-decoration:underline\">Tip/Warning</span></strong></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><strong><br></strong></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div><br></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
(328, 'SOD-7103-(X)', 'ที่กดสบู่ ทรงกระบอกยาว', '<h2><strong>ที่กดสบู่ ติดผนัง 3 หัว ทรงกระบอกยาว</strong></h2><div><ul><li>สำหรับเติมน้ำยา ต่างชนิด ใช้ในห้องสวีท พิเศษ</li><li>รูปทรงหรูหรา ทันสมัย ช่องเติมน้ำยากว้าง เปิดฝาด้าน บน พร้อมกุญแจล็อคเปิด- ปิดฝา</li><li>กระบอกชนิดลดความถ่วง กดง่ายได้ปริมาณแน่นอน ไม่ไหลเยิ้ม</li><li>ที่แป้นใช้กุญแจขันล็อคกับกระบอกได้ ป้องกันสูญหาย</li><li>จ่ายน้ำยา โดยการดึงแกนเข้าหาตัว</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>วัสดุ : กระบอกพลาสติก ABS , แผ่นครอบ Stainless 304</div><div>ขนาด : (H)24.1x(W)10.0x(L)30.9cm.&nbsp;</div><div><div>ปริมาตร : 500 ml. x 3</div><div><br></div><div>รหัสสินค้า : SOD-7103-C</div><div>สี : กระบอกขาว, ฝาโครมเงิน, แผ่นครอบขัดซาติน</div><div><br></div><div>รหัสสินค้า :SOD-7103-D<br>สี : กระบอกเงิน, ฝาโครมเงิน, แผ่นครอบขัดซาติน</div><div><br></div><div>รหัสสินค้า : SOD-7103-E<br>สี : กระบอกดำ, ฝาโครมเงิน, แผ่นครอบขัดซาติน<br></div>  </div><div><br></div><div><br></div><div><div><span style=\"text-decoration:underline\"><strong>Tip/Warning</strong></span></div><div>ที่กดสบู่ ควรเติมด้วยสบู่เหลวที่มีความเข้นข้นปานกลางถึงมากเท่านั้น</div><div><br></div><div><strong>หากพบว่าสบู่เหลวกดไม่ออก ให้ปฎิบัติดังนี้</strong></div><div>1. เติมน้ำเปล่าลงไปประมาณ 100 มล.</div><div>2. กดปุ่มค้างไว้ประมาณ 10 วินาที เพื่อไล่ฟองอากาศออกจากหัวปั๊ม และทำซ้ำอีก 2-3 ครั้ง</div><div>3. จากนั้นให้กดปุ่มถี่ๆ ขึ้น จนน้ำออก</div>  <br></div><div><br></div><div><br></div><div></div>  ', 5, 13, 0, 0, 0, 0, 0, '', 'N', 'N'),
(329, 'NMR-CH-08A', 'ชั้นวางนิตยสาร-หนังสือพิมพ์', '<p><strong>ชั้นวางนิตยสาร-หนังสือพิมพ์</strong></p><div><ul><li>แบบตั้งพื้น ชั้นวางไม้ทรงสูง แข็งแรง</li><li>ชั้นวางเห็นชื่อหน้าปกนิตยสาร หลายแนวเด่นชัด</li></ul></div><p><strong>คุณสมบัติเฉพาะ</strong></p><div>รหัสสินค้า&nbsp;NMR-CH-08A</div><div>วัสดุไม้</div><div>ขนาด (W)28&nbsp;x (L)34&nbsp;x (H)100 CM.</div>  ', 2, 22, 0, 0, 0, 0, 0, '', 'N', 'N'),
